(34, 'buku_sup_soto_sisca', '1000 RESEP MASAKAN & KUE SISCA SOEWITOMO YANG', 3, '1000 RESEP MASAKAN & KUE SISCA SOEWITOMO YANG\nPALING DICARI\n\nOleh: Sisca Soewitomo\nGM 21001100293\n\nPenerbit PT Gramedia Pustaka Utama\nKompas Gramedia Building Blok I Lantai 5\nJl. Palmerah Barat 29 -37, Jakarta 10270\n\nEditor\nIntarina Hardiman & Yudho Asmoro\n\nDesain Grafis\nAnis by Gagas Ulung\n\nDiterbitkan pertama kali oleh\nPT Gramedia Pustaka Utama\nAngota IKAPI, Jakarta, November 2010\n\nHak cipta dilindungi oleh Undang-undang. Dilarang mengutip atau\nmemperbanyak sebagian atau seluruh isi buku ini tanpa izin tertulis dari\nPenerbit.\n\nSanksi Pelanggaran Pasal 72 Undang-undang Nomor 19 Tahun 2002\nTentang Hak Cipta\n\nBarangsiapa dengan sengaja melanggar dan tanpa hak melakukan perbuatan\nsebagaimana dimaksud dalam Pasal 2 Ayat (1) atau Pasal 49 Ayat (1) dan\nAyat (2) dipidana dengan pidana penjara masing-masing paling singkat 1\n(satu) bulan dan/atau denda paling sedikit Rp 1.000.000,00 (satu juta rupiah),\natau pidana penjara paling lama 7 (tujuh) tahun dan/atau denda paling banyak\nRp 5.000.000.000,00 (lima miliar rupiah).\n\nBarangsiapa dengan sengaja menyiarkan, memamerkan, mengedarkan,\natau menjual kepada umum suatu ciptaan atau barang hasil pelanggaran\nhak cipta atau hak terkait sebagai dimaksud pada Ayat (1) dipidana dengan\npidana penjara paling lama 5 (lima) tahun dan/atau denda paling banyak Rp\n500.000.000,00 (lima ratus juta rupiah).\n\ncetak oleh Percetakan Gramedia\nuar Tanggung Jawab Percetakan', '[0.0016532392, -0.0032824955, 0.021250298, -0.012536455, 0.014269923, 0.015289004, -0.024272146, 0.0321164, 0.0036277238, 0.05171711, 0.050053135, 0.0009047928, 0.1031548, -0.0037230283, -0.04439489, -0.06539562, -0.032959614, 0.0103500085, -0.13329424, -0.0014890252, -0.005303458, 0.014604683, 0.017688774, -0.0015735438, -0.0012348724, -0.05881503, 0.021785272, -0.024478415, 0.0025765623, -0.018126264, 0.017312437, 0.043641947, 0.008248818, -0.013179907, 0.0