(35, 'buku_sup_soto_sisca', 'Poakika', 4, 'Poakika\n\nebagai praktisi boga ternama dan berpengalaman puluhan\n\ntahun, Sisca Soewitomo, tahu benar apa keinginan para\npembacanya. Buku masakan ini dihadirkan sebagai bukti\nkecintaannya pada dunia kuliner Indonesia. Tidak tanggung-tanggung\nsebanyak seribu resep terangkum dalam buku yang sangat pantas\ndikoleksi!\n\nMengumpulkan, mengujicoba resep, menuliskannya, dan merangkum\nke dalam pembagian bab-bab terpadu, tentu membutuhkan\nkesabaran, ketelitian, terutama pengalaman panjang sebagai praktisi\nboga mumpuni.\n\nKeseribu resep dalam buku masakan ini bisa memenuhi setiap\nselera, mulai dari anak-anak hingga orang dewasa. Mulai dari\npemasak pemula hingga yang berkeinginan membuka usaha di\nbidang boga. Mulai dari pemilih makanan hingga penikmat makanan\nlezat. Luar biasa!\n\nIngin tantangan mencicipi satu per satu resep-resep dalam buku ini?\n\nMengapa tidak! Anda akan beruntung karena akan semakin mahir\nberkreasi di dapur dalam membuat masakan terlezat...\n\nSalam,', '[0.017105142, -0.018031875, 0.033157624, 0.01600371, 0.01879186, 0.0020627973, -0.05335323, 0.009957086, 0.031057931, 0.013958039, 0.020362614, 0.059473388, 0.06987793, -0.010634731, -0.073971994, -0.07109337, 0.022166809, 0.0635881, -0.07799855, 0.016289163, 0.0063617765, 0.03365838, 0.017667359, -0.056147166, -0.07355532, -0.04419258, -0.0071527013, -0.048164506, -0.022273254, 0.004604279, 0.07052002, 0.06235458, -0.0040790685, -0.027500072, 0.02395891, 0.032343253, -0.039098904, 0.00067899993, 0.009449452, -0.06199621, -0.021291908, 0.051559716, 0.0064656716, 0.029158406, -0.0548577, -0.042771317, 0.019890359, 0.04273579, -0.020940904, 0.05550345, 0.027296092, 0.006864759, -0.014612516, 0.055591542, -0.040989455, 0.02000574, -0.019051747, 0.017104583, -0.041206032, 0.025892688, -0.032245606, 0.0280458, -0.10309125, 0.006471005, 0.0033521794, -0.006041873, -0.02773238, -0.012735063, 0.021842388, 0.024124471, -0.050811492, 0.004554437, -0.050381977