(49, 'buku_sup_soto_sisca', 'SUP & SOTO', 19, 'SUP & SOTO\nSup & Soto Ikan, Ayam\n1. Sup Rollade Ayam udang\n\nBahan: Kaldu:\n\nRollade: 2 sdm margarin\n\n2 butir telur, 1 kuning telur, dansdt 1 buah bawang bombai, iris\ngaram, kocok, buat dadar tipis 1 batang daun bawang, potong 1\n\n150 gram ayam cincang cm\n\n150 gram udang cincang 1 liter kaldu\n\n1 sat garam 1 sdt garam\n\nYe sdt merica bubuk 2 sdt merica bubuk\n\n1 sdm bawang goreng 1 biji pala, memarkan\n\n1 sdm tepung maizena 2 batang wortel, potong menurut\n\n1 putih telur selera\n\n250 gram kembang kol\n100 gram kacang polong\n1 batang seledri, iris halus\n\nCara membuat:\n\n1.\n\nRollade: Campur udang cincang, ayam cincang, garam, merica, bawang\ngoreng, tepung maizena, dan telur, aduk rata. Bagi menjadi 4 bagian.\nAmbil selembar dadar, isi dengan adonan daging, ratakan. Gulung,\nbungkus seperti lontong dengan aluminium foil, kukus selama\n\n15 menit. Angkat dan dinginkan. Potong menurut selera.\n\nKaldu: Panaskan margarin, tumis bawang bombai dan daun bawang\nhingga harum. Masukkan tumisan ke dalam kaldu, didihkan. Tambahkan\ngaram, merica, dan pala. Masukkan wortel, kembang kol, dan kacang\npolong.\n\nPenyajian: Siapkan mangkuk, tata rollade, tuangkan kuah dan bahan isi,\ntaburi dengan irisan seledri. Sajikan hangat.\n\nUntuk: 6 orang', '[-0.025208425, -0.0026978776, 0.013918337, -0.020731946, 0.07400627, -0.019920707, 0.010938015, 0.013376347, 0.04498489, 0.022949861, -0.020845523, 0.051095698, 0.06920677, -0.028488759, -0.019853203, -0.076913364, 0.024608413, -0.022136379, -0.039768957, 0.018049335, 0.0097418325, 0.015160367, 0.07856953, -0.03891033, -0.052335594, -0.05144449, 0.0046724146, 0.028505431, -0.036086153, -0.011902826, 0.055645805, 0.048607036, 0.020241065, -0.01705316, 0.0051504066, 0.007944354, -0.0038519625, -0.00038186085, -0.026620097, -0.06102613, -0.029171344, -0.013686189, 0.03443403, 0.042654276, -0.029609052, -0.022350434, -0.006828582, 0.0529523, -0.0049386104, -0.0054529877, 0.