(50, 'buku_sup_soto_sisca', 'Z. Sup Ayam Kuah', 20, 'Z. Sup Ayam Kuah\n\nBahan:\n\npotong sayap ayam\n\nsdm minyak goreng\n\nsdt minyak wijen\n\nsiung bawang putih, memarkan\ncm jahe, memarkan\n\nliter air, untuk kaldu\n\nsdm kecap asin\n\nsdt garam\n\nsdt merica bubuk\n\n100 gram biji teratai\n250 gram jamur shiitake segar\n\n1\n2\n\nbatang daun bawang, iris\nbatang daun ketumbar, iris\n\nCara membuat:\n\n1.\n2.\n\nCuci bersih sayap ayam dan tiriskan.\n\nPanaskan minyak goreng bersama minyak wijen, tumis bawang putih\ndan jahe hingga harum. Masukkan ke dalam air untuk membuat kaldu\ndan didihkan.\n\nMasukkan sayap ayam, kecap asin, garam, dan merica bubuk, masak\nhingga ayam lunak dan kuah menyusut.\n\nRendam biji teratai ke dalam air selama 30 menit, buang biji kecil\nberwarna hijau di tengahnya, dan rebus hingga lunak.\n\nSetelah ayam lunak, masukkan biji teratai dan jamur, masak sebentar\ndan angkat.\n\nSajikan hangat, beri irisan daun bawang dan daun ketumbar.\n\nUntuk: 5 orang', '[-0.014351777, -0.005519591, -0.004004882, -0.017434923, 0.039542284, -0.016682437, -0.023429563, 0.026394907, 0.035814334, 0.036730293, 0.013192977, 0.06028412, 0.08180418, -0.0392001, -0.026187008, -0.10059827, 0.02775501, 0.049878787, -0.03999695, 0.03469155, 0.015841836, 0.016917704, 0.042497467, -0.014204825, -0.06574365, -0.02645351, 0.010464527, 0.02376787, -0.030142644, -0.025944604, 0.029794127, 0.055917915, 0.045761894, 0.014658957, 0.01813755, 0.0110233035, -0.024716716, 0.03637576, -0.054355107, -0.081291206, -0.040504284, 0.03776001, 0.01722779, 0.049782127, -0.06362219, -0.007639946, -0.009208209, 0.05905259, 9.633413e-05, 0.00022099107, 0.023370221, -0.0008471097, -0.025301987, 0.027723126, -0.039658923, -0.030987749, 0.0097066425, 0.019873124, -0.040684804, 0.05262446, -0.017384157, 0.015100572, -0.069377035, -0.041055206, -0.004169752, -0.030021627, -0.041612837, -0.018569903, 0.022476498, 0.002306803, -0.019893557, 0.0007129533, -0.07306237, 0.043231007, 0.07692108, 