(51, 'buku_sup_soto_sisca', '3. Sup Krim Ayam', 21, '3. Sup Krim Ayam\n\nBahan: Pelengkap:\n\n2 sdm margarin Roti Garlic: 1 buah roti Prancis,\n\n1 buah bawang bombai, cincang — potong-potong tebal 1\n\n2 sdm tepung terigu, ayak cm\n\n1 litersusu cair Olesan: 3 sdm mentega campur\n\n250 mi kaldu ayam dengan 3 siung bawang putih\n\n1 sdt garam Cincang dan 1 sdt peterseli cincang.\nsdt merica bubuk Tambahkan 4 sdt garam dan Yz sdt\n\n1 kaleng jagung manis merica bubuk, aduk rata. Oleskan di\n\n50 gram jamur kancing kaleng, roti dan panggang hingga berwarna\niris, siap beli kecokelatan dan kering.\n\n1 dada ayam, rebus matang,\npotong dadu\n\n1 sdm peterseli cincang\n\nCara membuat:\n\n1. Panaskan margarin, tumis bawang bombai hingga harum.\n\n2. Masukkan tepung terigu, masak sebentar. Tambahkan susu cair, kaldu,\ngaram, dan merica, masak hingga mendidih.\n\n3. Masukkan jagung manis, jamur, dan ayam, masak sebentar hingga\nmengental, angkat.\n\n4. Sajikan hangat, taburi dengan peterseli dan lengkapi dengan roti Garlic.\n\nUntuk: 6 orang\n\n20', '[0.0013067136, -0.019538304, -0.0046703974, -0.026834317, 0.022326116, 0.0019436408, -0.02024084, 0.021133628, 0.03119708, 0.05419992, -0.014147654, 0.03853715, 0.065895684, -0.04548034, -0.013855845, -0.09442229, 0.034224216, -0.00030054848, -0.046302762, 0.011115496, 0.02345945, 0.009033782, 0.04840427, -0.04746177, -0.07467427, -0.03658126, 0.01562237, 0.030524936, -0.025899813, -0.021634255, 0.036956742, 0.074772224, -0.0015956323, -0.010969688, 0.03485938, 0.007294047, -0.04350692, 0.005162481, -0.0074671465, -0.052976534, -0.050765395, 0.0023936373, 0.0487575, 0.024063492, -0.05094652, -0.05372551, 0.004647489, 0.058573034, 0.013220635, 0.027922811, 0.026353443, 0.018728508, -0.035007548, 0.04564527, -0.047136236, -0.03442689, 0.0036994617, 0.0022362089, -0.05555576, 0.032328013, -0.022798749, 0.0074318186, -0.05728023, -0.03853983, 0.021834327, -0.0144018205, -0.023658143, 0.011995412, 0.022599839, -0.035355452, -0.03160