(52, 'buku_sup_soto_sisca', '4. Sup Ayam Makaroni', 22, '4. Sup Ayam Makaroni\n\n100 gram makaroni/pasta bentuk\nmenurut selera, rebus matang\n\n100 gram buncis, iris\n\n12 butir telur puyuh, rebus\n\n5 sdm kacang polong beku\n\n3 buah sosis sapi, potong\nmenurut selera\n\nTaburan:\nIrisan seledri secukupnya\n\nRebus ayam bersama daun bawang, wortel, dan seledri hingga lunak,\nangkat dan tiriskan, kemudian potong dadu.\nPanaskan margarin, tumis bawang bombai hingga harum. Masukkan ke\n\nMasukkan garam, merica, dan pala, setelah mendidih kembali, tambahkan\nwortel, buncis, sosis sapi, makaroni, telur puyuh, dan kacang polong,\n\nBahan:\n1 ekorayam, rebus dengan\n1 liter air\n1 batang daun bawang\n1 batang wortel\n1 batang seledri\n1 sdm margarin\n1 buah bawang bombai, iris\n1 liter air\n1 sdt garam\n2 sdt merica bubuk\nYe sdt pala, bakar\n2 batang wortel, potong\nCara membuat:\n1.\n2.\ndalam kaldu, tambahkan air, didihkan.\n3.\nmasak sebentar, angkat.\n4.\n\nSiapkan mangkuk, tuangkan kuah dan bahan isi, taburi irisan daun seledri.\n\nSajikan hangat.\n\nUntuk: 6 orang\n\n2', '[-0.016493335, 0.020389343, -0.009716268, -0.03277412, 0.03519916, -0.022587614, -0.0336075, 0.018228568, 0.0308603, 0.06592037, 0.007108635, 0.03628442, 0.104502276, -0.05162544, -0.0060569514, -0.10175914, 0.04862299, 0.022301985, -0.03996889, 0.04124072, 0.016808752, 0.019162154, 0.059150554, -0.011758411, -0.05413977, -0.010425827, 0.003032277, 0.007723485, -0.04155374, 0.017130345, 0.040898, 0.051145174, 0.032499395, -0.023234596, 0.006554066, 0.018329911, -0.0218457, -0.0074664066, 0.016393013, -0.06758755, -0.06313688, 0.015470487, 0.061500914, 0.03730554, -0.050050914, -0.034473594, 0.0049692104, 0.041960075, -0.0012868545, 0.03684791, 0.022162652, 0.03198534, -0.0014891855, 0.020313576, -0.017588558, -0.0075779664, -0.008106502, 0.009034053, -0.015802778, 0.06671499, -0.034409706, 0.012029499, -0.06410569, -0.006654679, 8.098669e-06, -0.026238516, -0.019204434, 0.007407044, 0.028815262, 