(53, 'buku_sup_soto_sisca', '5. Kamlo', 23, '5. Kamlo\n\nBahan:\n\nKaldu:\n\n2 liter air\n\n1 ekor ayam, potong 4 bagian\n1 batang daun bawang\n\n1 batang seledri\n\n1 buah wortel\n\nKuah\n\n2 sdm minyak goreng\n\n3 siung bawang putih, memarkan\n150 gram udang kecil, buang kulit\n2 cm jahe, memarkan\n\n2 sdt garam\n\n1 sdt merica bubuk\n\n2 sdm kecap manis\n\n3 batang wortel, kupas, iris\n\nCara membuat:\nKaldu: Rebus ayam dengan daun bawang, seledri, dan wortel, gunakan\napi sedang. Masak hingga ayam lunak dan matang, angkat ayam,\ntiriskan dan potong dadu kecil, saring kaldunya.\n\nKuah: Panaskan minyak goreng, tumis bawang putih hingga harum.\nMasukkan tumisan ke dalam kaldu, tambahkan jahe, udang, garam,\n\n1.\n\nmerica, dan kecap manis.\n\n150 gram bangkuang, potong\nbentuk korek api\n\n25 gram jamur kuping, rendam\ndalam air hingga mengembang\n\n15 lembar sedap malam kering,\nrendam dalam air hingga lunak\n\n50 gram soun, rendam dalam air\nhingga lunak\n\nPelengkap:\n\nIrisan bawang goreng dan sambal\nrebus: 2 buah cabai merah besar,\n7 buah cabai rawit merah, 2 siung\nbawang putih, rebus haluskan\nbersama 1 sdt garam, tambahkan\n1 sdt cuka masak\n\nMasukkan wortel, bangkuang, jamur kuping, dan sedap malam, masak\nsebentar. Masukkan potongan ayam, masak sebentar, angkat.\nPenyajian: Siapkan mangkuk beri soun secukupnya, tuangkan kuah dan\nisiannya, taburi dengan bawang goreng, lengkapi dengan sambal rebus\n\ndan sajikan hangat.\n\nUntuk: 6 orang', '[-0.0074558156, -0.0029444, 0.007926315, -0.035488885, 0.051774524, -0.0026794726, -0.03717063, 0.004103062, 0.034161534, 0.024648305, 0.008690802, 0.023115057, 0.09370403, -0.018372953, 0.0045958166, -0.10475015, 0.04131006, 0.01227875, -0.071032435, 0.013380777, 0.017957794, -0.0014116744, 0.045316495, -0.031478938, -0.02947161, -0.026619012, -0.010067835, 0.04398851, -0.043221988, 0.015041082, 0.06581276, 0.053296927, 0.017052835, 8.206875e-05, 0.00025804434, 0.0274154, -0.016919978, 0.00682557, -0.025701385, -0.