(54, 'buku_sup_soto_sisca', 'b. Soto Lamongan', 24, 'b. Soto Lamongan\n\nBahan:\n\n1 ekorayam, berat 900 gram,\nbelah dua bagian\n\nsdm air jeruk nipis\n\nsdt garam\n\nliter air\n\nlembar daun jeruk\nbatang serai, memarkan\ncm jahe, memarkan\nsdm minyak goreng,\nuntuk menumis\n\nWNN AAA Ha\n\nIsi:\n\n50 gram soun, rendam air dingin,\ntiriskan\n\n8 butir ayam, rebus matang\n\n2 lembar kol, iris halus\n\nCara membuat:\n\nBumbu yang dihaluskan:\n10 siung bawang putih\n5 butir kemiri, sangrai\n4 cm kunyit\n\n1 sdm garam\n\nYe sdt merica bubuk\n\nPelengkap:\n\nTaburan Kerupuk: 300 gram kerupuk\nudang goreng campur dengan 2 sdm\nbawang putih goreng, tumbuk halus.\nSambal Rebus: 3 buah cabai merah\nbesar, 10 buah cabai rawit merah, 2\nsiung bawang putih, rebus matang,\nhaluskan, tambahkan y2 sdt garam.\n\nTaburan:\nIrisan daun bawang dan bawang\ngoreng secukupnya.\n\n1. Cuci bersih ayam, lumuri dengan air jeruk nipis dan garam, diamkan\nsebentar, cuci bersih kembali dan tiriskan.\n\n2. Rebus ayam bersama daun jeruk, serai, dan jahe, gunakan api kecil,\nsetelah ayam matang, angkat, tiriskan dan suwir-suwir, saring kaldu.\n\n3. Panaskan minyak goreng, tumis bumbu halus hingga harum dan\nmasukkan ke dalam kaldu, didihkan kembali.\n\n4. Siapkan mangkuk, isi dengan soun, irisan kol, dan ayam suwir, tuangkan\nkuahnya, taburi dengan irisan daun bawang dan bawang goreng.\n\n5. Sajikan hangat, lengkapi dengan bubuk kerupuk udang dan sambal rebus.\n\nUntuk: 8 orang\n\n23', '[0.01232559, -0.012671813, -0.0021234816, -0.0050465264, 0.032956608, -0.02297162, -0.030819364, 0.009438316, 0.011332212, 0.020288188, 0.024443526, 0.052790616, 0.07687033, -0.011172121, -0.015193861, -0.094823815, 0.044119205, 0.014571035, -0.064195864, 0.00096420763, 0.032660518, 0.005073952, 0.05150775, -0.02342151, -0.03796404, -0.04045283, -0.013867207, 0.020552825, -0.039632652, -1.3070233e-05, 0.044803534, 0.06069884, 0.01993903, -0.02518232, 0.035413194, 0.039289597, -0.0005697731, 0.016179027, -0.006754