(55, 'buku_sup_soto_sisca', '7. Soto Banj Ar', 25, '7. Soto Banj Ar\n\nBahan: Pelengkap:\n1 ekor ayam, potong 4 bagian Telur rebus, bawang merah, bawang\n1 sdm air jeruk nipis putih goreng, irisan seledri dan daun\n1 sdt garam bawang, lontong atau ketupat\n1 liter air, untuk merebus\n100 gram soun, rendam air Perkedel Kentang:\nhingga lunak, tiriskan 3 buah kentang, kupas, goreng, dan\n4 sdm minyak goreng, haluskan, campur dengan 5 butir\nuntuk menumis bawang merah yang dihaluskan\n1 buah pala, memarkan bersama 2 sdt garam, Yz sdt merica\n4 cm kayu manis bubuk. Aduk rata, bentuk, celupkan\n4 lembar daun jeruk dalam 1 butir telur kocok dan goreng\n2 batang serai, memarkan hingga matang.\nBumbu yang dihaluskan: Sambal Soto:\n10 butir bawang merah 10 buah cabai rawit merah, 2 buah\n6 siung bawang putih cabai merah besar, haluskan bersama\n1 sdt jintan, sangrai 2 siung bawang putih, kemudian\n2 sdt garam goreng dengan minyak hingga matang,\n1 sdt merica bubuk tambahkan Y2 sdt garam. Aduk rata.\n\nCara membuat:\n\n1. Cuci bersih ayam, lumuri dengan 1 sdm air jeruk nipis dan 1 sdt garam,\ncuci bersih kembali dan tiriskan. Rebus ayam hingga lunak, angkat dan\ntiriskan, sisihkan kaldunya. Potong dadu kecil atau suwir-suwir ayam\nrebus.\n\n2. Panaskan minyak, tumis bumbu halus hingga harum dan masukkan ke\ndalam kaldu.\n\n3. Didihkan kaldu, masukkan pala, kayu manis, daun jeruk, dan serai.\n\n4. Siapkan mangkuk, tata soun, potongan ayam, telur rebus, dan perkedel,\ntuangkan kuah, taburi bawang goreng, bawang putih goreng, seledri,\ndan daun bawang. Sajikan hangat dan lengkapi dengan ketupat atau\nlontong dan sambal.\n\nUntuk: 6 orang\n\n24', '[-0.008893877, 0.0071357656, 0.024434084, -0.029526599, 0.023012226, 0.0019347373, -0.028230667, 0.015577696, 0.010582315, 0.006624816, 0.028410899, 0.03853496, 0.094633855, -0.013746544, -0.023531735, -0.08117997, 0.025593739, 0.013016715, -0.058481015, 0.0049966304, 0.031177472, 0.015889643, 0.07033753, -0.033854038, -0.05685433, -0.0