(56, 'buku_sup_soto_sisca', '5. Soto Kudus', 26, '5. Soto Kudus\n\nBahan:\n1 ekor ayam berat 900 gram\n2 liter air, untuk merebus\n\n4 cm jahe, memarkan\n\n2 batang serai, memarkan\n\n12 butir bawang merah, iris halus\n5 butir telur ayam, rebus\n\n100 gram taoge, seduh air panas\n6 sdm daun seledri iris\n\n2 sdm minyak goreng\n\n3 sdm kecap manis\n\nCara membuat:\n\nBumbu yang dihaluskan:\n10 siung bawang putih\n\n1 sdt jintan, sangrai\n\n1 sdt ketumbar, sangrai\n8 butir kemiri, sangrai\n2 cmkunyit, bakar\n\n1 sdt garam\n\n2 sdt merica bubuk\n\nPelengkap:\n\nSambal Kecap: 12 buah cabai rawit\nhijau, 3 siung bawang putih, tumis\nsebentar dan haluskan, campur\ndengan 100 mi kecap manis.\n\n1. Rebus ayam, masukkan jahe dan serai, masak hingga ayam lunak.\nAngkat, sisihkan kaldunya untuk kuah.\n\n2. Panaskan minyak goreng, tumis bawang merah iris dan bumbu yang\ndihaluskan hingga harum. Masukkan ke dalam kaldu, tambahkan kecap\n\nmanis dan didihkan kembali.\n\n3. Ayam setelah ditiriskan, suwir-suwir, dan sisihkan.\n\n4. Siapkan mangkuk, tata taoge, ayam, telur rebus, tuangkan kuah dalam\nmangkuk, taburi dengan irisan daun seledri.\n\n5. Sajikan hangat dengan sambal kecap manis.\n\nUntuk: 8 orang\n\n25', '[-0.011778683, -0.018781526, 0.018279232, 0.0026186495, 0.034599137, -0.007109822, -0.026979594, 0.016441792, 0.028737793, 0.017055305, 0.0153316725, 0.032693412, 0.108658716, 0.0015058344, -0.020477973, -0.10045406, 0.032235883, 0.0028290094, -0.06214073, -0.001746737, 0.017935237, 0.0064120404, 0.047207803, -0.0146754235, -0.05870604, -0.027465053, -0.01801512, 0.031886503, -0.030374093, 0.0066883173, 0.06950601, 0.076760545, 0.010706888, -0.029116785, 0.026114892, 0.029586976, -0.0041457494, 0.0108539, -0.029869944, -0.047308, -0.023942644, 0.029690662, 0.037950207, 0.0497094, -0.05387895, -0.03077217, 0.012846031, 0.036338307, 0.010529812, 0.01832382, 0.01499955, 0.008071441, -0.048169598, 0.009193615, -0.015732324, -0.022529045, 0.024571419, 0.007241613, -0.0060778