(57, 'buku_sup_soto_sisca', '7. Kuah Asam', 27, '26\n\n7. Kuah Asam\n\nBahan:\n\n2 ekor ikan kakap atau kerapu, 1 sdt merica bubuk\nberat @ 400 gram 5 buah cabai merah besar, iris\n\n2 sdm air jeruk nipis 3 buah cabai hijau besar, iris\n\n1 sdt garam 8 butir bawang merah, iris\n\n1 literair 3 siung bawang putih, iris\n\n3 batang serai, memarkan 6 buah tomat sayur,\n\n3 cm jahe, memarkan potong-potong\n\n3 cm lengkuas, memarkan 6 buah belimbing sayur\n\n5 lembar daun jeruk 5 sdm air jeruk nipis\n\n1 lembar daun pandan, 2 ikat kemangi, petik daunnya\npotong-potong\n\n2 sdt garam\n\nCara membuat:\n\n1.\n\nSiangi ikan kakap atau kerapu, potong menjadi 2 bagian, cuci bersih,\nlumuri dengan air jeruk nipis dan garam, diamkan selama 10 menit, cuci\nbersih kembali dan tiriskan.\n\nDidihkan air, masukkan serai, jahe, lengkuas, daun jeruk, daun pandan,\ngaram, dan merica.\n\nSetelah mendidih kembali masukkan ikan, bawang merah, dan bawang\nputih iris, masak hingga ikan lunak.\n\nMasukkan tomat sayur, belimbing sayur, air jeruk nipis, cabai merah,\nCabai hijau, dan kemangi, masak sebentar dan angkat.\n\nSajikan hangat.\n\nUntuk: 4 orang', '[-0.005728864, 0.0016641676, 0.012930309, -0.012113754, 0.023606827, -0.023380432, -0.03539263, 0.021516219, 0.044968955, 0.027012847, -0.00084113603, 0.053457785, 0.08436598, -0.001541763, -0.034168344, -0.118846044, 0.044379715, 0.023845835, -0.062023114, 0.008736107, 0.037876144, 0.0036362186, 0.0640741, -0.009809587, -0.05028983, 0.0006481572, -0.0125386575, 0.046091974, -0.0047756666, -0.00969741, 0.0711968, 0.04363107, 0.019057153, -0.02458636, 0.006572307, 3.369732e-05, -0.0109063275, -0.016302405, -0.013207569, -0.09323322, -0.062453162, 0.027712265, 0.04738298, 0.018225322, -0.06376775, -0.023422217, 0.025234831, 0.053641804, -0.0010622288, 0.014401415, 0.013611151, -0.00460947, -0.025303017, 0.015278601, -0.011097061, -0.014436036, 0.030316548, 0.018487273, -0.02123766, 0.05700291, -0.024933448, 0.005284629, -0.064993404, -0.070500