(58, 'buku_sup_soto_sisca', '70. Sup Marinara', 28, '70. Sup Marinara\n\nBahan:\n\nBola-bola ikan:\n\n500 gram ikan tenggiri\n2 sdm tepung sagu\n1 butir telur\n\n1 sdt garam\n\nYe sdt merica bubuk\n\nBumbu yang dihaluskan:\n\n4 buah cabai merah besar\n4 butir bawang merah\n\n4 siung bawang putih\n\n1 sdt terasi goreng\n\n1 sdt garam\n\nCara membuat:\n\nIsi:\n1,5\n250\n\n250\n\n&\nke)\n\nNANANAN-—\n\nliter air\n\ngram udang, ukuran sedang,\nbelah punggungnya\n\ngram cumi, potong\nmenurut selera\n\ngram jamur kancing, iris\nbatang serai, memarkan\nlembar daun jeruk\n\ncm jahe, memarkan\n\nsdm air jeruk nipis\n\nsdm saus ikan\n\nsdm irisan daun ketumbar\nsdm minyak goreng\n\n1. Bola-bola ikan: Campur ikan tenggiri yang telah dihaluskan dengan\ntepung sagu, telur, garam, dan merica, aduk rata, bentuk bola-bola,\n\nsisihkan.\n\n2. Panaskan minyak goreng, tumis bumbu yang dihaluskan bersama serai,\ndaun jeruk, dan jahe hingga harum, angkat.\n\n3. Didihkan air bersama bumbu yang telah ditumis, setelah mendidih\nmasukkan bola-bola tenggiri, udang, cumi, dan jamur, masak hingga\nmengapung dan matang. Tambahkan air jeruk nipis dan saus ikan, aduk\n\nrata dan angkat.\n\n4. Siapkan mangkuk, tuangkan kuah dan bahan isi, taburi dengan irisan daun\n\nketumbar, sajikan hangat.\n\nUntuk: 6 orang\n\n27', '[-0.018082352, 0.0034021698, 0.020289008, -0.004213285, 0.034357235, -0.025628852, -0.031716883, 0.04182867, 0.031385876, 0.034272287, -0.013958687, 0.05608541, 0.08037921, -0.027178882, -0.0014531179, -0.092281215, 0.053837564, 0.017444367, -0.011801108, 0.008179476, 0.010529682, 0.05153724, 0.044220828, -0.029785253, -0.055718366, -0.018925583, -0.013501191, 0.024576472, -0.029092051, -0.009064406, 0.038302746, 0.031838603, -0.01109337, -0.016346445, 0.0004157628, -0.01241041, -0.002234898, -0.0068069506, 0.04140325, -0.0927432, -0.025416555, -0.007065621, 0.057925195, 0.030221693, -0.028801259, -0.026369326, 0.03356794, 0.03924301, 0.013619443, 0.05181718, 0.00796929, 0.009106908