(59, 'buku_sup_soto_sisca', '11. Sup Kepiting', 29, '28\n\n11. Sup Kepiting\n\nBahan:\n\n2 sdm minyak goreng 200 gram jagung manis kalengan,\n\n1 sdm minyak wijen siap beli\n\n2 siung bawang putih, memarkan 150 gram asparagus kalengan,\n\n1 liter kaldu ayam potong-potong, siap beli\n\n2 cmjahe, kupasdanmemarkan 1 sdm tepung sagu, larutkan\n\n1 sdt garam dengan sedikit air\n\n2 sdt merica bubuk 3 butir telur, kocok lepas\n\n150 gram daging kepiting/ 1 batang daun bawang, iris halus\n\nrajungan rebus\n\nCara membuat:\n\n1. Panaskan minyak bersama minyak wijen, tumis bawang putih hingga\nharum. Masukkan kaldu dan jahe, didihkan.\n\n2. Masukkan garam dan merica bubuk, daging kepiting, jagung, dan\nasparagus, didihkan kembali.\n\n3. Kentalkan dengan larutkan tepung sagu, aduk rata, setelah mengental,\nmasukkan telur kocok perlahan-lahan sambil terus diaduk hingga\nmenyerupai serabut, angkat.\n\n4. Sajikan hangat, taburi dengan irisan daun bawang.\n\nUntuk: 4 orang', '[-0.013351385, -0.0027684006, -0.004571544, -0.018838836, 0.048994686, -0.015079446, -0.032936815, 0.027319694, 0.022365272, 0.028284885, -0.014123703, 0.055825643, 0.09470389, -0.016709594, -0.025137603, -0.08977654, 0.03724933, -0.00069310056, -0.060442645, 0.0033801103, 0.022437911, 0.004145829, 0.08207942, -0.022959001, -0.0532697, 0.005335731, -0.010257668, 0.02029292, -0.029066827, -0.008193567, 0.04490652, 0.044265583, -0.0072437734, -0.0046349755, 0.030660918, 0.023761526, -0.02140955, 0.03559541, -0.0015942538, -0.06993936, -0.054856703, 0.016304547, 0.041858923, 0.05511332, -0.058912013, -0.029123252, -0.005006788, 0.06421901, 0.024413584, 0.037443884, -0.014790236, -0.01775187, -0.02115985, 0.039176572, -0.026646843, 0.004343616, -0.008603257, 0.017130049, -0.055617888, 0.044968545, -0.004475809, 0.015775349, -0.076819554, -0.031326793, 6.064418e-05, -0.032856636, -0.04254159, -0.0067802947, 0.0048536584, -0.0008101661, -0.025979476, 0.022064218, -0.030324059, 0.072719514, 0.030324414, -0.00486600