(60, 'buku_sup_soto_sisca', '1Z. Sup Ikan Tahu Sutera', 30, '1Z. Sup Ikan Tahu Sutera\n\nBahan: Kuah:\n\n250 gram udang, cincang halus 1 sdm minyak goreng\n\n2 siung bawang putih, cincang 1 sdt minyak wijen\ndan tumis sebentar 3 siung bawang putih, memarkan\n\n1 putih telur 100 gram udang kupas\n\n1 sdt garam 2 cmjahe, memarkan\n\n2 sdt merica bubuk 1 liter air\n\n1 sdt gula pasir 1 sdt garam\n\n1 sdm irisan daun bawang Ye sdt merica bubuk\n\n1 sdm saus tiram\n\n2 sdm tepung sagu Pelengkap:\n\n2 bungkus egg tofu/tahu sutera, 50 gram soun rendam dalam air,\npotong 1cm tiriskan, irisan daun bawang, irisan\n\nseledri, dan saus sambal\n\nCara membuat:\n\n1.\n\nAdonan udang: Campur udang dengan tumisan bawang putih,\n\nputih telur, garam, merica, gula pasir, saus tiram, dan tepung sagu,\naduk rata. Masukkan irisan daun bawang, aduk rata.\n\nPotong-potong egg tofu 1 cm, buat lubang untuk isian adonan udang.\nHaluskan sisa kerukkan tofu dan campurkan pada adonan udang.\nAmbil satu potong egg tofu, isi dengan isian adonan udang, dan kukus\nhingga matang selama 20 menit, angkat dan sisihkan.\n\nKuah: Panaskan minyak goreng bersama minyak wijen, tumis bawang\nputih hingga harum. Masukkan udang, masak hingga berubah warna,\ntuangkan air, tambahkan jahe, garam, dan merica bubuk, didihkan.\nPenyajian: Siapkan mangkuk saji, beri soun secukupnya dan tahu isi.\nSiram dengan kuah, taburi dengan irisan daun bawang dan seledri.\nSajikan hangat dengan saus sambal.\n\nUntuk: 6 orang\n\n29', '[0.00040780185, 0.0111810835, -0.00041393726, 0.00050879753, 0.03903491, -0.029037362, -0.004907727, 0.011921683, 0.036512434, 0.021096364, -0.0072258217, 0.06466653, 0.106843054, -0.025254924, -0.03203098, -0.07856087, 0.02485353, 0.007738453, -0.0372248, 0.019639224, 0.03965417, 0.048570868, 0.066794254, -0.0030040324, -0.067769535, -0.008672019, -0.01791137, 0.030034916, -0.01887993, -0.008868532, 0.05177546, 0.03916429, -0.0057223924, -0.012910944, 0.0005109123, -0.020785293, 0.01289689, 0.00058