(61, 'buku_sup_soto_sisca', '13. Sup Ikan Kakap', 31, '30\n\n13. Sup Ikan Kakap\n\nBahan:\n1 ekor ikan kakap 3\nberat £ 500 gram 2\n\n1 sdm air jeruk nipis 200\n\n1 sdt garam\n\n2 sdm minyak goreng untuk 2\nmenumis bawang putih 100\n\n3 siung bawang putih, 1\ncincang, tumis 6\n\n1/2 liter air\n\n3 cmjahe, memarkan 1\n\n1 sdt garam\n\n2 sdt merica bubuk 25\n\nCara membuat:\n\nsdm minyak cabai\n\nsdm kecap ikan\n\ngram udang ukuran sedang,\nbelah punggungnya\n\nbatang wortel, iris serong\ngram jamur shiitake segar\nbuah egg tofu, potong-potong\nlembar sawi putih,\npotong-potong\n\nbatang daun bawang,\npotong-potong\n\ngram soun, rendam air sebentar\nhingga lunak\n\n1. Siangi ikan kakap, potong-potong, cuci bersih, lumuri dengan air jeruk\nnipis dan garam. Diamkan selama 10 menit, cuci bersih kembali, dan\n\ntiriskan.\n\n2. Didihkan air, masukkan bawang putih yang telah ditumis, jahe, garam,\n\nmerica, minyak cabai, dan kecap ikan.\n\n3. Setelah mendidih, masukkan ikan, udang, jamur, dan wortel. Setelah\nikan lunak, masukkan sawi putih, egg tofu, daun bawang, dan soun,\n\nmasak sebentar, angkat.\n4. Sajikan hangat.\n\nUntuk: 6 orang', '[-0.0077943876, 0.0075403024, -0.0052690823, -0.015897315, 0.03173294, -0.032329656, -0.007419299, 0.023614688, 0.052420206, 0.033942923, 0.017005282, 0.05292892, 0.08812783, -0.009924197, -0.032509517, -0.09595611, 0.0123687135, 0.015659949, -0.05075118, 0.024792558, 0.021450708, 0.00908816, 0.07318502, -0.014724936, -0.036518775, 0.017767798, -0.016510699, 0.031353835, -0.017048663, -0.010477417, 0.03619085, 0.04103726, 0.00039768984, -0.032530006, 0.011388432, -0.004286559, 0.0034237367, 0.016570946, -0.009408446, -0.093396485, -0.041776735, 0.008351463, 0.04078973, 0.037169054, -0.0681708, -0.012780531, -0.0013452157, 0.089538924, 0.008378501, 0.03443678, 0.028885888, -0.0025157682, -0.009875959, 0.020638317, -0.021391392, 0.012236341, 0.010888646, 0.024335317, -0.027381575, 0.05985244, -0.0046819784, 0.010005888, -0.07496192, -0.028