(62, 'buku_sup_soto_sisca', 'Sup & Soto Daging', 32, 'Sup & Soto Daging\n14. Soto Betawi\n\nBahan: Bumbu yang dihaluskan:\n\n500 gram daging sapi sandung lamur 4 buah cabai merah besar\n\n1 liter air, untuk merebus 10 butir bawang merah\n\n250 gram babat sapi, rebus matang 6 siung bawang putih\n\n250 gram paru, rebus matang 1 sdt garam\n\n500 mi santan kental dari 1 butir 1/2 sdt merica bubuk\n\nkelapa Pelengkap:\n\n2 batang serai, memarkan 4 buah tomat segar, potong\n\n4 lembar daun salam 2 sdm irisan daun bawang\n\n6 lembar daun jeruk 1 sdm irisan daun seledri\n\n8 biji cengkih 4 sdm bawang goreng\n\n1 biji pala, memarkan Emping, kecap manis, dan jeruk limau\n\n2 cm jahe, memarkan Sambal rebus (haluskan):\n\n4 cm batang kayu manis 10 buah cabai rawit merah\n\nMinyak goreng secukupnya 1 buah cabai merah besar\n2 siung bawang putih\n\n4\nCara membuat:\n\nsdt garam\n\n1. Rebus daging sapi bersama serai, daun salam, daun jeruk, cengkih, pala,\njahe, dan kayu manis hingga daging setengah matang. Angkat daging,\n\npotong dadu, sisihkan kaldunya.\n\n2. Panaskan 2 sdm minyak goreng, tumis bumbu yang dihaluskan hingga\n\nharum, angkat.\n\n3. Campur tumisan bumbu ke dalam kaldu dan masukkan kembali potongan\ndaging dan santan, masak hingga daging lunak dan bumbu meresap,\n\nangkat.\n\n4. Rebus babat dan paru secara terpisah hingga lunak. Angkat dan sisihkan.\nBila akan disajikan goreng dalam minyak panas sebentar dan potong\n\nbentuk dadu.\n\n5. Siapkan mangkuk, tata babat, paru, daging, dan potongan tomat, siram\ndengan kuah. Taburi irisan daun bawang, daun seledri, bawang goreng,\nemping, kecap manis, jeruk limau, dan sambal. Sajikan hangat.\n\nUntuk: 6 orang\n\n31', '[0.0070302957, 0.023667164, -0.017521352, -0.011490001, 0.046637196, 0.006571308, -0.015679652, 0.012532465, 0.026601335, 0.014836445, 0.01801523, 0.09135057, 0.080198325, -0.026768843, -0.033804264, -0.08165628, 0.03212467, 0.005197501, -0.081596576, 0.012874244, 0.02392726, 0.015455267, 0.08551699, -0.0467