(63, 'buku_sup_soto_sisca', '15. Soto Bandung', 33, '15. Soto Bandung\n\nBahan: Bumbu yang dihaluskan:\n\n1 kg daging sapi sandunglamur — 8 butir bawang merah\n\n2 liter air, untuk merebus 8 siung bawang putih\n\n2 cm jahe, memarkan 2 sdt garam\n\n3 batang serai, memarkan 1 sit merica butiran\n\n4 lembar daun jeruk\n\n5 sdm kecap manis Taburan:\n\n1 buah lobak, kupas, iris tipis 1 batang daun bawang, iris halus\n\n2 sdm minyak goreng, untuk 2 batang seledri, iris halus\nmenumis 4 sdm bawang goreng\n\n200 gram kacang kedelai, rendam\nhingga lunak, tiriskan, dan goreng\n\nCara membuat:\n\n1. Rebus daging dengan jahe, serai, dan daun jeruk hingga lunak. Angkat\ndaging, potong dadu dan masukkan kembali ke dalam kuah.\n\n2. Panaskan minyak goreng, tumis bumbu yang dihaluskan hingga harum.\nMasukkan ke dalam kaldu. Tambahkan kecap manis dan lobak, masak\n\nsebentar dan angkat.\n\n3. Siapkan mangkuk, tuangkan kuah, taburi dengan irisan daun bawang,\nseledri, bawang goreng, dan kedelai goreng. Sajikan hangat dengan\n\nsambal rebus.\n\nUntuk: 6 Orang', '[0.009182156, -0.0026129042, 0.00056549313, -0.0021488597, 0.04218813, -0.007967034, -0.014209842, 0.0003787899, 0.011705204, 0.011388843, 0.029157985, 0.06448086, 0.10334419, -0.018566273, -0.032650273, -0.10905777, 0.03461615, 0.015054909, -0.070990644, -0.004529274, 0.024064649, 0.029342476, 0.06700739, -0.047153797, -0.03852109, -0.029732808, -0.036474846, 0.022941701, -0.04836592, 0.004987089, 0.048912104, 0.06810341, 0.0181286, -0.014516104, 0.013541983, 0.030674856, 0.013544986, 0.021917092, 0.00073488837, -0.063689165, -0.029989945, 0.014459865, 0.0488402, 0.054112855, -0.06783179, -0.017761411, 0.0071277153, 0.032985713, 0.024884844, 0.021405697, 0.008014466, 0.015764615, -0.039471548, 0.025947046, -0.038874406, -0.0070759086, 0.033337224, 0.0006426218, -0.014396385, 0.060793266, -0.018112004, 0.002871572, -0.078937955, -0.0068100495, 0.021742078, -0.027077572, -0.036914073, 0.0050121373, 0.006259375, -0.03952052, -0