(64, 'buku_sup_soto_sisca', '1 Sup Celup-Celup', 34, '1 Sup Celup-Celup\n\nBahan: Kuah:\n300 gram daging sapisirloin, iristipis 1 liter kaldu\n\n12\n\n12\n\n50\n\nbuah udang sedang, cuci bersih 100 ml kecap asin Jepang\n\ndan tiriskan 50 mi mirin\n\nbuah bakso sapi, potong 20 misake\n\nbatang daun bawang, 6 sdm gula pasir\npotong serong 1 sdt garam\nbatang wortel, iris serong Ye sdt merica bubuk\n\nlembar sawi putih, potong-potong 2 cm jahe, memarkan\nbuah egg tofu/tahu telur dalam\n\nkemasan plastik kedap udara,\n\npotong 2 cm\n\ngram soun, rendam air dingin\n\ndan tiriskan\n\nCara membuat:\n\n1.\n\nDidihkan kaldu, masukkan kecap asin Jepang, mirin, sake, gula pasir,\ngaram, merica, dan jahe, angkat dan sisihkan.\n\nSiapkan panci atau stemboat untuk dimasak bersama di meja makan,\nmasukkan dan didihkan kembali kaldu dan masukkan secara bergantian\ndaging sapi, udang, dan bakso, masak hingga matang. Tambahkan sawi,\ndaun bawang, wortel, dan egg tofu.\n\nTerakhir masukkan soun, sajikan bersama saus sambal, atau irisan\ncabai rawit merah.\n\nUntuk: 6 orang', '[-0.0015000231, 0.027374301, 1.23410555e-05, -0.015751582, 0.060384475, 0.012382674, -0.019299807, 0.040329725, 0.037517577, 0.041728683, -0.022436962, 0.043103922, 0.07409431, -0.030357057, 0.0009897137, -0.09776132, 0.024040688, 0.0021723176, -0.039247986, 0.037045505, 0.032007605, 0.015254422, 0.08744845, -0.036383793, -0.060864165, 0.0056080986, -0.042833924, 0.04550847, -0.025958803, -0.014700372, 0.03928898, 0.03993307, -0.0047485195, -0.010936558, -0.0031206373, 0.02246079, 0.001650811, 0.04274898, -0.022199376, -0.09542317, -0.021131001, 0.008790126, 0.04020779, 0.020574939, -0.046734482, -0.032392085, -0.010002759, 0.12387095, -0.002175724, 0.012023732, -0.00074096123, 0.015549414, -0.009440093, 0.018698867, -0.01891974, -0.014667252, 0.012021808, 0.033694156, -0.032942962, 0.036747474, -0.013107202, 0.022875665, -0.056310356, -0.015578475, 0.013858412, -0.0361086, -0.034439564, -0.012753963, -0.00759043