(65, 'buku_sup_soto_sisca', 'Sup Daging Sayuran', 35, '34\n\n17.\n\nSup Daging Sayuran\n\nBahan:\n\n250 gram daging sandung lamur\n\n1 liter air\n\n1 batang daun bawang\n\n1 sdm margarin\n\n5 butir bawang merah, iris\n\n1 biji pala, memarkan\n\n2 sdt garam\n\n1 sdt merica bubuk\n\n3 buah kentang sedang,\npotong dadu\n\n2 batang wortel, iris\n\n200 gram buncis, iris\n\n3 lembar kol, iris\n\n1 buah tomat, iris\n\nTaburan:\n\nIrisan daun bawang dan batang seledri\n\nCara membuat:\n\n1.\n\nRebus daging sandung lamur dengan air dan daun bawang hingga\ndaging lunak dan matang, angkat daging dan potong-potong.\nPanaskan margarin, tumis bawang merah hingga harum, masukkan ke\ndalam kaldu.\n\nDidihkan kembali kaldu, masukkan pala, garam, dan merica. Masukkan\nkentang dan wortel, masak hingga setengah matang.\n\nTambahkan buncis dan kol, masak sayuran hingga matang, angkat,\ntambahkan irisan tomat.\n\nSajikan hangat, taburi dengan irisan daun bawang dan seledri.\n\nUntuk: 6 orang', '[0.003076109, -0.0163373, -0.002328322, -0.010820837, 0.04612741, -0.022021594, -0.027053243, -0.004859822, 0.032669373, 0.035933826, -0.002711419, 0.06198005, 0.09095513, -0.029898537, -0.02485381, -0.09381714, 0.051288817, 0.0011560696, -0.046550784, 0.022491613, 0.044699706, 0.024412837, 0.06515623, -0.06699691, -0.04866966, -0.048341822, -0.009409673, 0.010645153, -0.035552885, -0.02479873, 0.046544656, 0.072301015, 0.03250558, -0.0045509506, 0.007254719, 0.006976749, -0.0018033484, 0.023047464, -0.014342981, -0.09863486, -0.044187054, 0.0032631226, 0.056493867, 0.032095797, -0.053144872, -0.007707181, 0.010499321, 0.061135676, 0.024566522, 0.030657064, -0.02498581, 0.005381894, -0.027127514, 0.05044563, -0.04890641, 0.006178848, 0.020203976, 0.005875445, -0.048641603, 0.049306866, -0.0114306025, 0.013836775, -0.06429014, -0.042657707, -0.011384541, -0.031772647, -0.044532392, -0.02129391, 0.026698252, -0.042902146, -0.020655401, 0.025053617, -0.039688163, 0.08969396, 0.041289654, 0.016410599,