(66, 'buku_sup_soto_sisca', '18. Sup Kacang Merah', 36, '18. Sup Kacang Merah\n\nBahan:\n\n300\n\nkg buntut sapi, potong 1 cm\nliter air, untuk merebus\ngram kacang merah kering,\nrendam dalam air 3-4 jam\nsdm margarin\n\nbatang daun bawang,\npotong 1 cm\n\nbatang seledri, potong 1 cm\nsdt garam\n\nsdt merica bubuk\n\nbiji pala, memarkan\n\nbiji cengkih\n\nCara membuat:\nCuci bersih kacang merah tiriskan, rebus hingga lunak, angkat. Tiriskan.\nPanaskan margarin, tumis bumbu yang dihaluskan hingga harum.\n\nRebus buntut sapi hingga setengah matang, masukkan tumisan bumbu,\nkacang merah, daun bawang, seledri, garam, merica, pala, dan cengkih.\nMasak kembali hingga buntut dan kacang lunak, angkat, taburi dengan\n\n1.\n2.\n3.\n\n4\n\nirisan seledri.\nSajikan hangat.\n\nUntuk: 6 orang\n\nBumbu yang dihaluskan:\n10 butir bawang merah\n5 siung bawang putih\n\nTaburan:\nDaun seledri, iris halus\n\n35', '[0.017864266, 0.017974563, 0.010319178, -0.018845184, 0.039802212, -0.017398456, -0.013421456, 0.013025829, 0.05590873, 0.03228772, -0.0027126914, 0.08107664, 0.06576453, -0.014959356, -0.032670394, -0.11644706, 0.040460102, 0.027628878, -0.039024793, 0.015298654, 0.026798202, 0.013196496, 0.06939476, -0.010642966, -0.040293716, -0.0035223616, -0.018022988, 0.030629167, -0.01995232, -0.009032875, 0.06786033, 0.05135287, 0.0071207173, -0.019790461, 0.0072448896, 0.007832412, -0.025373066, 0.036272947, -0.00051973906, -0.092393205, -0.04742302, 0.047238972, 0.07698709, 0.040815372, -0.051671855, -0.029289337, 0.0099804895, 0.046415765, -0.0113898255, 0.03143878, 0.026852172, 0.009793834, -0.006740501, 0.03135975, -0.012525139, -0.018144596, 0.01615333, 0.007994174, -0.024084544, 0.06516404, 0.004437968, 0.012934844, -0.069115646, -0.047628812, 0.012261488, -0.033663392, -0.04478776, -0.004965571, 0.016813349, -0.029518163, -0.013368375, 0.034082398, -0.056306213, 0.0733229, 0.05372762, -0.007937335, -0.017506653, -0.06618239, -0.033435594, 0.030204985, -0.008411556, 0.00088334