(67, 'buku_sup_soto_sisca', '19. Sup Kacang tijan', 37, '36\n\n19. Sup Kacang tijan\n\nBahan:\n350 gram daging sapi, potong dadu\n150 gram kacang hijau\n\nANN WAH\n\nliter air\n\nsdm minyak goreng\nbuah bawang bombai,\ncincang kasar\n\nbiji pala, memarkan\ncm kayu manis\n\nbiji cengkih\n\ncm jahe, memarkan\nsdt garam\n\nsdt merica bubuk\n\nTaburan:\nIrisan daun bawang, seledri, dan\nbawang goreng\n\nCara membuat:\n\n1.\n\nRebus daging sapi dengan 1/4 liter air, tambahkan pala, kayu manis,\ncengkih, dan jahe, masak hingga daging lunak, angkat.\n\nRebus kacang hijau dengan 500 ml air hingga lunak, campurkan ke\ndalam rebusan daging sapi.\n\nPanaskan minyak, tumis bawang bombai hingga harum. Masukkan ke\ndalam kuah, masak sebentar. Tambahkan garam dan merica bubuk,\nsetelah bumbu merata, angkat.\n\nSajikan hangat, taburi dengan irisan daun bawang, seledri, dan bawang\ngoreng.\n\nUntuk: 6 orang', '[0.008749167, -0.00016089097, 0.015690817, -0.030364918, 0.04662304, -0.007305344, -0.008749975, 0.0008736152, 0.03039675, 0.029328823, -0.015013765, 0.043778125, 0.078358315, -0.0068292576, -0.046677705, -0.07618684, 0.025179714, 0.024978278, -0.03606682, -0.009977923, 0.0476122, 0.00985727, 0.06469304, -0.03246576, -0.042665415, 0.010997379, -0.024152707, 0.018692346, 0.00015970263, -0.018286211, 0.04825523, 0.04643471, 0.007977264, -0.009713675, 0.019235644, 0.033396043, -0.0025229908, 0.041592617, 0.0035055494, -0.089326195, -0.037765205, 0.01927934, 0.05315453, 0.03358219, -0.05967212, -0.036738735, 0.0071170363, 0.09203329, 0.005644348, 0.046111796, 0.008338886, 0.0006898637, -0.043632746, 0.018579222, -0.03044501, 0.009104462, 0.018149668, -0.0031602446, -0.040128123, 0.05132941, -0.017359957, 0.025244312, -0.072674185, -0.034902543, 0.01937759, -0.023129394, -0.058205735, -0.031168701, 0.027671311, -0.032593425, -0.050872095, 0.011385694, -0.06781032, 0.08013772, 0.042680994, 0.022234919, -0.018222047, -0.08965911, -0.0150982775, 0.030409733, -0.0063468167, -0.01412738