(68, 'buku_sup_soto_sisca', 'Z0. Sup Buntut Goreng', 38, 'Z0. Sup Buntut Goreng\n\nBahan:\n1 kgbuntut sapi, cuci bersih 2 buah tomat, potong\n80 gram tepung berbumbu, menurut selera\nSiap pakai Minyak secukupnya, untuk\n1 liter air, untuk merebus menggoreng\n1 biji pala, memarkan\n2 batang daun bawang Taburan\n1 buah bawang bombai, iris Bawang goreng dan irisan daun\n2 sdt garam bawang\nY2 sdt merica bubuk\n2 batang wortel, potong\nmenurut selera\n2 buah kentang, potong\n\nmenurut selera\n\nCara membuat:\n\n1.\n\nPotong-potong buntut sapi setebal 1 cm, rebus dengan air.\n\nMasukkan biji pala dan daun bawang, setelah daging lunak, angkat dan\npisahkan dari kuahnya.\n\nPanaskan sedikit minyak, tumis bawang bombai hingga harum dan\nmasukkan ke dalam kaldu, tambahkan garam dan merica, didihkan.\nMasukkan wortel, kentang, dan tomat, masak hingga sayuran matang,\nangkat.\n\nPanaskan minyak, lumuri buntut dengan tepung berbumbu hingga rata dan\ngoreng hingga berwarna kecokelatan, angkat, dan tiriskan.\n\nSiapkan mangkuk, tuangkan kuah, isinya, dan taburi bawang goreng serta\nirisan daun bawang. Letakan buntut goreng ke dalam piring dan sajikan\nhangat dengan nasi putih.\n\nUntuk: 6 orang\n\n37', '[-0.0058542974, 0.00940215, 0.03186915, -0.017785091, 0.06992035, -0.028542984, -0.043707114, 0.0004135185, 0.032345552, 0.010779654, -0.045504216, 0.048746083, 0.07392496, 0.006867412, -0.022777544, -0.10049483, 0.052660733, 0.02373625, -0.061127868, 0.022196166, 0.04378329, 0.0317505, 0.052249566, -0.04062625, -0.04563839, -0.013396127, -0.041943114, 0.01995726, -0.010380128, -0.028299643, 0.0487955, 0.036259614, -0.014876353, -0.00925208, 0.027355442, 0.003390857, -0.013859982, 0.01980548, 0.015280008, -0.08573904, -0.03522056, 0.007932865, 0.06129845, 0.08512621, -0.055332135, -0.017039914, 0.028015554, 0.033584513, 0.009964704, 0.016742432, -0.005357835, -0.0011258769, 0.0061071105, 0.051590566, -0.014729286, 0.013449235, 0.022070413, 0.026089339, -0.033452734, 0.078844815, -