(69, 'buku_sup_soto_sisca', 'LL. Sup Konro', 39, '38\n\nLL. Sup Konro\n\nBahan:\n\nkg iga sapi\n\nliter air, untuk merebus\nsdm kecap manis\n\nsdm air asam jawa\n\nbiji cengkih\n\nsdm minyak goreng, untuk\nmenumis\n\n4 lembar daun jeruk\n\nNO ANN\n\nBumbu yang dihaluskan:\n\n6 butir bawang merah\n\n1 sdm ketumbar, sangrai\n\n2 cm kunyit, bakar\n\n10 buah keluak, rendam air hangat,\ntiriskan\n\n1 sdm garam\n\nY2 sdt merica bubuk\n\nCara membuat:\n1. Rebus iga sapi hingga lunak.\n\nTaburan:\nBawang goreng, irisan seledri, dan\ndaun bawang\n\nPelengkap:\n\nSambal Rebus: 5 siung bawang\nputih, 10 buah cabai keriting, 5 buah\nCabai rawit merah, rebus sebentar,\nangkat, haluskan dan tumis dengan\n2 sdm minyak goreng hingga matang,\nhaluskan, tambahkan 742 sdt garam,\naduk rata.\n\n2. Panaskan minyak, tumis bumbu yang dihaluskan hingga harum.\nMasukkan ke dalam kaldu, tambahkan kecap manis, air asam, cengkih,\ndan daun jeruk, masak hingga bumbu meresap dan matang, angkat.\n\n3. Sajikan hangat, taburi dengan bawang goreng, irisan seledri, dan\ndaun bawang. Lengkapi dengan sambal rebus\n\nUntuk: 4 orang', '[-0.02103884, 0.012830341, -0.00986526, -0.034297444, 0.03743953, -0.028208982, 0.002528488, 0.043014713, 0.04634947, 0.036326613, -0.019815668, 0.047175836, 0.081870854, 0.008469794, -0.018808058, -0.08939829, 0.036481846, 0.03722638, -0.05449677, 0.020207355, 0.002619065, 0.04367487, 0.05947421, -0.02336075, -0.045076467, -0.0027371538, -0.02366793, 0.014864455, -0.043415338, -0.026965775, 0.04313717, 0.03881743, 0.0123097, -0.02633166, 0.0033260356, 0.005934905, -0.02318475, 0.034452293, -0.026502056, -0.07955554, -0.06281598, 0.02735016, 0.03505272, 0.042856745, -0.028463023, -0.018873032, 0.0061560157, 0.070479006, -0.008285524, 0.01599138, 0.0022813638, -0.01961838, -0.037681215, 0.027671598, -0.017336844, -0.0107829245, 0.0076967413, 0.0022193075, -0.02596629, 0.068484835, -0.030676223, 0.036705587, -0.07788879, -0.018567005, -0.0069754873, -0.058107283, -0.03091172