(70, 'buku_sup_soto_sisca', 'ZZ. Sup Kambing', 40, 'ZZ. Sup Kambing\n\nBahan:\n\n750\n\nN 3 www-—a\n\nWww AA\n\ngram daging kambing bagian\nyang bertulang, potong\nmenurut selera\n\nliter air, untuk merebus\n\ncm jahe, memarkan\n\nbiji cengkih\n\ncm kayu manis\n\nbiji pala, memarkan\n\nsdm minyak goreng,\n\nuntuk menumis\n\nbatang daun bawang,\npotong 1 cm\n\nsdm garam\n\nsdt merica bubuk\n\nbatang wortel, potong-potong\nbuah tomat, potong\n\nmenurut selera\n\nmembuat:\n\nTaburan:\nIrisan seledri dan bawang goreng\n\nPelengkap:\n\nEmping, kecap manis, jeruk limau,\nacar mentimun cabai, dan sambal\nrebus: 2 buah cabai merah besar, 10\nbuah cabai rawit merah, rebus matang,\nhaluskan, tambah 2 sdt garam.\n\nAduk rata.\n\nCuci bersih daging kambing dan tiriskan. Rebus daging bersama\n\njahe, cengkih, kayu manis, dan pala hingga daging kambing lunak, angkat.\nTambahkan air hingga kaldu tetap 1 liter.\n\nPanaskan minyak, tumis daun bawang hingga harum. Masukkan ke dalam\nkaldu, dan didihkan kembali. Masukkan wortel, garam, dan merica bubuk,\n\nmasak sebentar, angkat.\n\nSiapkan mangkuk, tuangkan kuah, tata irisan tomat, taburi seledri dan\nbawang goreng. Sajikan dengan emping, jeruk limau, kecap manis, sambal\nrebus, acar mentimun cabai, dan nasi putih.\n\nUntuk: 6 orang\n\n39', '[0.006453962, 0.02105186, 0.0028999294, -0.003789497, 0.040778365, 0.0105743455, -0.044958334, 0.009667398, 0.035205163, 0.010287003, -0.008168065, 0.06894109, 0.09076879, -0.04002476, -0.016021786, -0.10191652, 0.047862846, 0.017668186, -0.057227913, 0.024506075, 0.03557783, 0.029295951, 0.08824477, -0.039434236, -0.036090836, 0.0036587005, -0.021783017, 0.03906911, -0.026182322, -0.0033282442, 0.052472945, 0.03754181, 0.006509277, 0.004841143, 0.007021865, 0.005409966, -0.006950987, 0.02043757, 0.0009970181, -0.08546378, -0.06428419, 0.017598998, 0.06843159, 0.04266979, -0.05508655, -0.018473895, -0.0019987337, 0.0410563, -0.008964463, 0.02042789, 0.014913421, 0.0044415155, -0.015254951, 0.0138