(71, 'buku_sup_soto_sisca', 'Z3. Soto Tangkar', 41, 'Z3. Soto Tangkar\n\nBahan:\n\n500 gram iga sapi, potong-potong 5 butir kemiri, sangrai\n\n500 gram daging sandung lamur 1 sdt jintan, sangrai\n\n2 liter air, untuk merebus 1 sdm ketumbar, sangrai\n\n3 cm lengkuas, memarkan 1 sdm garam\n\n5  cmkayu manis 1 sdt merica bubuk\n\n5 lembar daun jeruk\n\n2 lembar daun salam Pelengkap:\n\n2 batang serai, memarkan Irisan daun bawang, bawang goreng,\n\n3 buah tomat, potong menurut kecap manis, jeruk limau, dan emping\n\nselera\n\n500 ml santan dari 1 butir kelapa Sambal Rebus:\n\n2 sdm minyak goreng, untuk 3 buah cabai merah besar, 12 buah\nmenumis Cabai rawit merah, 3 siung bawang\n\nputih rebus matang. Haluskan tambah\nBumbu yang dihaluskan: 1 sdt garam, aduk.\n\n9 butir bawang merah\n\n5 siung bawang putih\n\n5 buah cabai merah besar\n5 cm kunyit, bakar\n\nCara membuat:\n\n1. Rebus daging sapi bersama iga sapi hingga lunak, angkat daging dan\npotong-potong.\n\n2. Tumis bumbu yang dihaluskan hingga harum. Masukkan ke dalam\nkaldu, tambahkan lengkuas, daun jeruk, kayu manis, daun salam, dan\nserai, didihkan.\n\n3. Tuangkan santan, masak hingga mendidih kembali, angkat.\n\n4. Siapkan mangkuk, beri irisan tomat, tuangkan kuah dan isinya.\n\n5. Sajikan selagi hangat, taburi dengan daun bawang, bawang goreng,\nlengkapi dengan sambal rebus, kecap manis, emping, dan jeruk limau.\n\nUntuk: 6 orang', '[0.013271337, 0.024642983, -0.008468713, -0.0076350165, 0.040561076, 0.006946427, -0.0024294236, 0.014151724, 0.03264433, 0.02322074, 0.019754704, 0.06663902, 0.10461945, -0.004836953, -0.0393458, -0.067141786, 0.039479762, 0.031198926, -0.05585679, 0.00967512, 0.009229972, 0.014170805, 0.07039157, -0.02600622, -0.059665773, -0.01009265, -0.014014406, 0.017576193, -0.03971934, -0.0011182138, 0.037035443, 0.04061752, 0.003137839, -0.016139878, 0.01653345, 0.04454185, 0.009855105, 0.016602224, 0.001437253, -0.07781582, -0.015916325, 0.019727582, 0.057455014, 0.037756152, -0.040061347, 