(72, 'buku_sup_soto_sisca', 'Z4. Soto Sokaraja', 42, 'Z4. Soto Sokaraja\n\nBahan:\n\n500 gram daging sapi\n\n1 liter air\n\n50 gram soun, rendam air dingin\ndan tiriskan\n\n50 gram taoge pendek, cuci bersih\n\n150 gram kedelai goreng\n\n3 cm jahe, memarkan\n\nbatang serai, memarkan\n\ncm lengkuas, memarkan\n\nsdm kecap manis\n\nsdm, untuk menumis\n\nBumbu yang dihaluskan:\nbutir bawang merah\nsiung bawang putih\ncm kunyit, bakar\nbutir kemiri sangrai\nsdt garam\n\nS5 KW ON\n\nCara membuat:\n\nYe sdt merica bubuk\n\nPelengkap:\nIrisan daun bawang, irisan seledri,\nbawang goreng, dan kerupuk\n\nSambal Soto:\n150 gram kacang tanah, goreng,\ndan haluskan\n\nBumbu yang dihaluskan: 7 buah\ncabai rawit merah, 3 butir bawang\nmerah, 2 siung bawang putih,\n\n1 sdt garam, 1 sdm gula merah iris,\ndan 1 sdm air asam. Tumis semua\nbahan dengan 2 sdm minyak goreng,\ntambahkan air 200 ml hingga menjadi\nsambal yang kental, angkat.\n\n1. Rebus daging bersama air hingga setengah matang, bila air berkurang\ntambahkan air hangat hingga air tetap 1 liter.\n\n2. Panaskan minyak goreng, tumis bumbu halus hingga harum.\nMasukkan ke dalam kaldu, tambahkan jahe, serai, lengkuas, dan kecap\nmanis, masak hingga daging lunak dan bumbu meresap. Angkat\n\ndaging dan potong-potong.\n\n3. Penyajian: Siapkan mangkuk, isi dengan soun, taoge pendek, tuang\nkuahnya. Taburi dengan irisan daun bawang, seledri, bawang goreng,\nkedelai goreng, sambal soto, dan kerupuk.\n\n4. Sajikan hangat dengan lontong atau nasi\n\nUntuk: 4 orang\n\n4', '[0.01125194, 0.02723307, 0.020947339, -0.01014699, 0.028861005, -0.0022786364, -0.024808723, 0.021221083, 0.021100063, 0.024288408, 0.02654011, 0.08211813, 0.09073059, -0.018493874, -0.027245004, -0.091188304, 0.048037376, 0.022915918, -0.058905233, 0.016091758, 0.0060861, 0.011570637, 0.083585076, -0.05255095, -0.058027625, -0.027673725, -0.02047667, 0.02271686, -0.04530005, 0.0018017052, 0.07160591, 0.05753573, 0.013005004, 0.0040858383, 0.014227273, 0.035498515, -0.0