(73, 'buku_sup_soto_sisca', 'Z5. Soto Sulung', 43, '42\n\nZ5. Soto Sulung\n\nBahan:\n250 gramparu sapi,rebus matang — 5 cm kunyit, bakar\n250 gram hati sapi, rebus matang 2 sdt garam\n250 gram babat sapi, rebus matang 1 sdt merica bubuk\n500 gram daging sandung lamur\n2 literair Pelengkap:\n3 batang serai, memarkan Irisan daun bawang, seledri, bawang\n8 lembar daun jeruk goreng, sambal rebus, jeruk nipis, dan\n2 cm jahe, memarkan telur rebus\n3 sdm minyak goreng, untuk\n\nmenumis Sambal Rebus: 5 buah cabai merah\n\nbesar, 10 buah cabai rawit merah,\n\nBumbu yang dihaluskan: 3 siung bawang putih rebus, angkat\n10 butir bawang merah dan haluskan bersama /42 sdt garam.\n7 siung bawang putih Aduk rata.\n8 butir kemiri, sangrai\n\nCara membuat:\n\n1.\n\nRebus jerohan sapi, paru, hati, dan\n\nbabat secara terpisah hingga lunak. Angkat dan potong menurut selera.\nRebus sandung lamur dengan air hingga lunak. Angkat daging, potong-\npotong menurut selera.\n\nRebus kembali kaldu, bila air menyusut tambahkan air panas hingga\njumlah air tetap 2 liter. Masukkan serai, jahe, dan daun jeruk.\n\nPanaskan minyak goreng, tumis bumbu yang dihaluskan dan campurkan\nke dalam kaldu, masukkan potongan jerohan sapi dan daging, masak\nhingga bumbu meresap, angkat.\n\nSiapkan mangkuk, sajikan hangat taburi dengan irisan daun bawang,\nseledri, telur, bawang goreng, sambal rebus, dan perasan air jeruk nipis.\n\nUntuk: 6 orang', '[0.0037972515, 0.018703362, 0.015740182, -0.020181246, 0.045896485, 0.0013087669, -0.022411428, 0.015720885, 0.022123324, 0.0059639304, 0.009988082, 0.062418066, 0.10543662, -0.0066159233, -0.013806783, -0.08273663, 0.037137512, 0.013130449, -0.0746722, 0.00043792848, 0.02828484, 0.025691886, 0.06918818, -0.03801325, -0.06032169, 9.62151e-05, -0.046227638, 0.011156692, -0.030206772, 0.003514211, 0.06258901, 0.046307907, 0.01515045, -0.008355365, 0.014217168, 0.026010128, -0.004467039, 0.015796693, 0.0008283863, -0.07157357, -0.030059386, 0.006789144, 0.06890886, 0.048