(74, 'buku_sup_soto_sisca', 'Zb. Soto Makassar', 44, 'Zb. Soto Makassar\n\nBahan:\n300 grambabat sapi, rebus matang — 1 sdtjintan sangrai\n300 gram hati sapi, rebus matang 1 sdm garam\n\n200 gram jantung sapi, rebus matang 1 sdt merica butiran\n500 gram daging sapi sandung lamur\n\n2 liter air cucian beras/tajin Pelengkap:\n5 batang serai, memarkan Bawang goreng, irisan daun bawang,\n5 lembar daun salam dan irisan seledri\n250 gram kacang tanah, goreng,\nhaluskan Sambal Taoco (haluskan): 10 butir\n3 sdm minyak goreng, untuk bawang merah, 5 siung bawang putih,\nmenumis 10 buah cabai keriting rebus sebentar,\n5  cmjahe, memarkan 100 gram taoco tumis dengan 6\n1 ruas lengkuas, memarkan sdm minyak goreng hingga matang,\nhaluskan, tambahkan garam dan gula\nBumbu yang dihaluskan: merah secukupnya.\n\n10 siung bawang putih\n8 butir kemiri, sangrai\n1 sdm ketumbar, sangrai\n\nCara membuat:\n\n1. Rebus babat, hati, dan jantung sapi secara terpisah hingga lunak, angkat,\ntiriskan, potong dadu.\n\n2. Rebus daging sapi bersama air tajin, serai, lengkuas, jahe, dan daun\nsalam hingga matang. Angkat, tiriskan dan potong dadu.\n\n3. Panaskan minyak, tumis bumbu yang dihaluskan hingga harum. Masukkan\nke dalam kaldu, tambahkan kacang tanah goreng, didihkan.\n\n4. Penyajian: Siapkan mangkuk, isi dengan daging dan jerohan bersama\nkuahnya, taburi bawang goreng, irisan daun bawang, dan seledri.\nSajikan dengan buras dan sambal taoco.\n\n5. Sajikan hangat.\n\nUntuk: 6 orang\n\n43', '[-0.009153124, 0.03727344, 0.011885007, -0.028735297, 0.03518647, 0.015204287, -0.0335448, 0.013430891, 0.021506222, 0.018057344, 0.018095119, 0.06758121, 0.10573943, -0.004668813, -0.025656259, -0.063194714, 0.025942711, 0.043773714, -0.058223218, 0.0268366, 0.031068731, 0.030444568, 0.08306541, -0.044128258, -0.05006749, 0.009640581, -0.046341334, 0.014244877, -0.019792696, 0.004960914, 0.04400779, 0.0415248, 0.0041405265, -0.008316511, 0.0010300949, 0.029098064, -0.0093041565, 0.011841224, 0.006563813, -