(75, 'buku_sup_soto_sisca', 'ZT. Soto Padang', 45, 'ZT. Soto Padang\n\nBahan: Pelengkap:\n\n500 gram daging sapi 100 gram soun, rendam hingga\n\n1 potong tulang sengkel sapi lunak, tiriskan\n\n2 liter air Perkedel kentang, siap saji\n\n2 lembar daun salam Sambal rebus\n\n3 lembar daun jeruk Irisan seledri\n\n2 batang serai, memarkan Daun bawang\n\n3 sdm minyak goreng, untuk Bawang goreng\n\nmenumis Paru goreng kering\n\nKerupuk merah\n\nBumbu yang dihaluskan: Nasi putih\n\n8 butir bawang merah\n\n5 siung bawang putih\n\n1 sdt merica butiran\n\n2 sdt garam\n\n2 cmjahe\n\n2 cm lengkuas\n\n3 cmkunyit, bakar\n\nCara membuat:\n\n1. Rebus daging sapi dan tulang sengkel hingga lunak, angkat daging\ndan tiriskan.\n\n2. Panaskan minyak, tumis bumbu halus bersama daun salam, daun jeruk,\ndan serai hingga harum. Masukkan ke dalam kaldu, setelah mendidih,\nangkat.\n\n3. Goreng daging utuh hingga berwarna kecokelatan,\nangkat, potong dadu, sisihkan.\n\n4. Penyajian: Siapkan mangkuk, isi dengan soun, potongan daging, paru\ngoreng, dan perkedel. Tuangkan kuahnya, taburi dengan bawang\ngoreng, seledri, daun bawang, kerupuk merah, dan sambal rebus.\n\n5. Sajikan hangat.\n\nUntuk: 6 orang', '[1.2007077e-05, 0.0056091542, 0.015934566, -0.013980675, 0.03634402, 1.5704505e-05, -0.029775616, -0.00074124464, 0.027159909, 0.0069633573, 0.010933265, 0.045420807, 0.089623615, -0.02705765, -0.014956952, -0.087033115, 0.049777355, 0.014053126, -0.05914712, 0.010839503, 0.038029138, 0.016111886, 0.08845075, -0.04167494, -0.05718606, -0.003407815, -0.047019605, 0.004332718, -0.023829557, 0.0008090996, 0.050852705, 0.05442651, 0.007039921, 0.0015453115, -0.010332255, 0.03587986, -0.002115821, 0.01072728, -0.02058078, -0.05150127, -0.034504283, 0.0423646, 0.06490657, 0.062454294, -0.054586094, -0.04176172, -0.009152767, 0.04053476, -0.013876783, 0.019467104, 0.022044143, 0.0067753657, -0.012571901, 0.04545284, -0.036935054, -0.014626456, 0.024262186, -0.0028391206, -0.03725152, 0.0717398, -0.03781