(76, 'buku_sup_soto_sisca', 'Z5. Sup Tgn Kacang Merah', 46, 'Z5. Sup Tgn Kacang Merah\n\nBahan:\n250 gram kacang merah\n500 gram iga sapi atau buntut, potong-potong\n\nliter air\n\nsdm margarin\n\nbuah bawang bombai, iris\n\nbatang seledri\n\nbatang daun bawang\n\nbiji pala, memarkan\n\nsdt garam\n\nsdt merica bubuk\n\nbatang wortel, potong menurut selera\n\nCara membuat:\n\n1.\n\n4.\n\nRendam kacang merah dalam air selama 2 jam, cuci bersih dan tiriskan.\nRebus hingga setengah matang, angkat, tiriskan.\n\nRebus buntut/iga sapi dengan air hingga daging setengah matang,\nmasukkan kacang merah.\n\nPanaskan margarin, tumis bawang bombai hingga harum. Masukkan ke\ndalam kaldu, tambahkan wortel, seledri, daun bawang, pala, garam, dan\nmerica, masak hingga kacang merah dan daging empuk.\n\nAngkat, sajikan hangat.\n\nUntuk: 4 orang\n\n4', '[0.005039799, 0.03645832, 0.02664851, -0.007811542, 0.0303632, -0.02143161, -0.011202428, 0.030081242, 0.05606016, 0.01671147, -0.017310938, 0.06814313, 0.08009423, -0.025426723, -0.023941481, -0.10286565, 0.033389043, 0.02127723, -0.03131516, 0.022190442, 0.031190665, 0.0041095586, 0.0717924, -0.026019352, -0.030033298, 0.014318425, -0.013738045, 0.020761395, -0.04523626, -0.009783537, 0.049002334, 0.023675097, 0.0063840644, 0.0067859325, 0.017774466, 0.030920863, -0.03374898, 0.025613548, -0.006304162, -0.102153376, -0.028140401, 0.018650085, 0.07004202, 0.040228836, -0.03899412, -0.0348394, 0.0070081805, 0.05346993, -0.019048128, 0.01617965, 0.039081894, -0.015844202, 0.003655072, 0.03549994, -0.0036613026, -0.010742381, 0.012742504, 0.0056254864, -0.013780464, 0.049943104, 0.011068507, 0.002587815, -0.068180755, -0.045210727, 0.040076286, -0.042858783, -0.05985482, 0.01462036, 0.034123644, -0.029457912, -0.041994702, 0.035756197, -0.061328586, 0.07076036, 0.03561257, -0.016969202, -0.011931043, -0.070323996, -0.015870206, 0.038563557, -0.03451923, -0.017699633, 0.04778598, 0.063161254, -0.010793048, 0.0060825734, 0.060315955, -0.0358