(77, 'buku_sup_soto_sisca', 'NASI', 47, 'NASI\nNasi Bungkus Peda Panggang\n\nAmbil 2 lembar daun pisang, tata nasi putih, alasi dengan daun, tata\ntumis peda, daging iris manis, tumis buncis tempe, sambal terasi,\nlalap, dan telur pindang, bungkus.\n\nPanggang di atas bara api selama 10 menit, angkat. Sajikan.\n\nZI. Tumus Peda\n\nBahan:\n\nsdm minyak goreng\n\nbuah cabai merah besar, iris\n\nbuah cabai hijau besar, iris\n\nbutir bawang merah, iris\n\nsiung bawang putih, iris\n\nikan peda, goreng, ambil dagingnya, suwir\nlembar daun jeruk\n\nsdm kecap manis\n\nsdt garam\n\nsdt merica bubuk\n\nDaun kemangi secukupnya\n\nCara membuat:\n\n1.\n\nPanaskan minyak goreng, tumis cabai merah, cabai hijau, bawang\nmerah, dan bawang putih hingga layu.\n\nMasukkan peda, daun jeruk, kecap manis, garam, dan merica, aduk rata.\nMasak hingga bumbu merata, tambahkan daun kemangi, aduk rata,\nangkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi', '[-0.023006612, -0.004404164, 0.006937719, 0.0073906686, 0.027394298, -0.009836347, -0.015448189, 0.0027706225, 0.024181895, 0.010863499, -0.037031926, 0.04108956, 0.08249163, -0.017354121, -0.048438057, -0.13732912, 0.06640554, 0.005819739, -0.044122513, -0.009377663, 0.032352827, 0.033260286, 0.042217314, -0.025458332, -0.062260985, -0.016977496, -0.03152907, 0.03715562, -0.020363528, -0.0014115265, 0.07875717, 0.03733145, 0.0050776065, -0.018386472, 0.0017754758, 0.009444236, -0.013335731, 0.009596485, 3.262401e-05, -0.07909963, -0.03361684, 0.040461347, 0.07034841, 0.040511943, -0.024786294, -0.0056297584, 0.029996112, 0.039463125, -0.009722391, 0.018243011, 0.001305136, 0.0053620706, 0.008452942, 0.004513663, -0.033904936, 0.0016139718, 0.027712563, 0.022202808, -0.064305104, 0.061695807, -0.02550663, 0.013521543, -0.0671407, -0.024239102, 0.011530737, 0.0021425409, -0.067632526, -0.0076598306, 0.02670946, 0.025218576, -0.014526147, 0.026608815, -0.041569944, 0.05108475, 0.066073895, 0.0030505003, -0.0019233181, -0.08781