(78, 'buku_sup_soto_sisca', '30, Daging Iris Manis', 48, '30, Daging Iris Manis\n\nBahan:\n\n350 gram daging sapi has dalam\n\n3 lembar daun jeruk\n\n2 lembar daun salam\n\n2 batang serai, memarkan\n\n10 sdm kecap manis\n\n300 mi santan dari setengah butir kelapa\n2 sdm minyak goreng\n\nBumbu yang dihaluskan:\n5 butir bawang merah\n3 siung bawang putih\n1 sdt ketumbar\n\n4 sdt jintan, sangrai\n\n1 sdt gula merah\n\n1 sdt garam\n\n\"2 sdt merica bubuk\n\nCara membuat:\n\n1. Potong daging sapi has dalam, memotong serat setebal 1 cm.\n\n2. Panaskan minyak goreng, tumis bumbu halus bersama daun salam, serai,\ndan daun jeruk hingga layu.\n\n3. Masukkan daging, masak hingga berubah warna. Masukkan kecap manis,\naduk rata, tambahkan santan, aduk rata.\n\n4. Masak hingga daging lunak dan kuah menyusut, angkat.\n\n5. Sajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi\n\n4', '[-0.0044943206, -0.010016381, 0.0010742014, -0.0061256476, 0.012723321, 0.019633196, -0.03001939, 0.016130539, 0.027192697, 0.0272844, -0.020501075, 0.07730142, 0.08143327, -0.030882252, -0.054057628, -0.11543521, 0.05150891, 0.018224834, -0.04662559, 0.0056428486, 0.034463424, 0.021715265, 0.031017786, -0.03759343, -0.045483578, 0.01153716, -0.030570364, 0.048953775, -0.015795248, -0.023092417, 0.03852097, 0.050108884, 0.011630929, -0.031555638, -0.025470978, 0.0064839646, -0.00699675, 0.006919433, -0.019310346, -0.09271257, -0.054564063, 0.051354166, 0.056726713, 0.030683901, -0.052034035, -0.0064243465, 0.0371173, 0.03743634, -0.0059594894, 0.02598208, -0.019623794, -0.005734452, 0.007843609, 0.020753449, -0.0428267, -0.0042728907, 0.03759208, 0.027525347, -0.052016504, 0.06351112, -0.026790481, -0.0024736892, -0.061365534, -0.00808591, -0.0019609884, 0.00017682987, -0.012507498, -0.0063179587, 0.017387414, 0.02373397, -0.012996637, -0.000735233, -0.0043263347, 0.06859578, 0.04817747, 0.008029103, -0.014435302, -0.08478809, -0.012681452, 0.011790894, 0.022792602, 0.0059913844, 0.033142284, 0.05