(79, 'buku_sup_soto_sisca', '81.', 49, '81.\n\nTumas Buncis dan Tempe\n\nBahan:\n\n2 sdm minyak goreng\n\n3 buah cabai merah besar, potong 1 cm\n3 buah cabai hijau besar, potong 1 cm\n8 butir bawang merah, iris\n\n3 siung bawang putih, iris\n\n2 cm lengkuas, memarkan\n\n3 lembar daun salam\n\n300 gram buncis, iris\n\n150 gram tempe, potong dadu\n\n5 sdm kecap manis\n\n1 sdt garam\n\n\"2 sdt merica bubuk\n\nCara membuat:\n\n1.\n\nPanaskan minyak, tumis cabai merah, cabai hijau, bawang merah,\nbawang putih, lengkuas, dan daun salam hingga harum.\nMasukkan buncis, tempe, kecap manis, garam, dan merica bubuk,\nmasak sebentar hingga bumbu merata, angkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi', '[-0.022110518, -0.017725004, 0.03176722, -0.00806734, 0.035103973, -0.018148227, -0.02645822, 0.008585291, 0.0083067445, 0.032623067, -0.052188072, 0.039916825, 0.08716462, 0.006487956, -0.046906404, -0.13233295, 0.042821914, 0.03964957, -0.02474072, -0.03804109, 0.03710929, 0.034103636, 0.038741775, -0.05418245, -0.0630883, -0.015119428, -0.025236195, 0.035955276, -0.025654305, -0.023631627, 0.07609127, 0.038214512, -0.004503504, -0.028804325, 0.011684762, 0.010614693, -0.0014743104, 0.00083291804, 0.0051597324, -0.064064234, -0.039960403, 0.03983353, 0.07764124, 0.036497228, -0.025964784, -0.023896018, 0.026859814, 0.026658813, -0.01034034, 0.01656161, -0.03553165, 0.01695734, 0.016990773, 0.007827035, -0.039008178, 0.00064808235, 0.013083271, 0.025769895, -0.04424667, 0.057367142, -0.004996103, 0.022032415, -0.07099562, -0.018745527, -0.0015210225, -0.01175098, -0.040209923, -0.011998618, 0.024127448, 0.019330747, -0.051160812, 0.007987228, -0.040828105, 0.07427956, 0.07146038, -0.01773876, 0.011173982, -0.09553838, -0.015079529, 0.027601121, 0.011304974, 0.003146895, 0.015093704, 0.077341564, 0.018590337, -0.039819133, 0.02733245, -0.033732962, -0.05212517, 0.052945156, 0.075904205, 0.02196529, -0.08215749, -0.07083266, 0.07777737, -0.03207881, -0.114556