(80, 'buku_sup_soto_sisca', '3Z. Sampat Terasi Goreng', 50, '3Z. Sampat Terasi Goreng\n\nBahan:\n\n8 buah cabai merah besar\n10 buah cabai rawit merah\n5 butir bawang merah\n\n1 buah tomat merah\n\n1 sdm terasi matang\n\n1 sdt gula merah iris\n\n1 sdt garam\n\nMinyak secukupnya, untuk menggoreng\n\nPelengkap:\nLalap mentimun dan daun selada\n\nCara membuat:\n\n1.\n\nPanaskan minyak, tumis cabai merah, cabai rawit, bawang merah, dan\ntomat hingga layu, angkat.\n\nHaluskan tumisan cabai dengan terasi, gula, dan garam hingga halus.\nSajikan sebagai pelengkap nasi rames, tambahkan lalap, dan telur\npindang.\n\nUntuk: 4-6 porsi\n\n49', '[0.009330553, 0.02040613, 0.023536723, -0.011881629, 0.03217951, 0.0025014493, -0.018724477, 0.013856603, 0.030703517, 0.020881422, -0.029327996, 0.056346554, 0.08316685, -0.028689083, -0.033163175, -0.09806264, 0.035738252, 0.03214759, -0.055022154, -0.003332909, 0.016451363, 0.015985698, 0.055136018, -0.043474108, -0.07960786, 0.025903666, -0.027899608, 0.041467067, -0.028976658, -0.023773424, 0.056306835, 0.027762858, 0.014100493, -0.010635989, -0.00075760245, 0.022832692, -0.022003638, -0.0007885212, -0.009109855, -0.072345786, -0.034024693, 0.03160058, 0.077617735, 0.052517407, -0.0676736, -0.0363941, 0.023899082, 0.045519587, -0.021202039, 0.012232127, 0.016709961, 0.014314696, 0.02813625, 0.02135184, -0.030859802, -0.005279197, 0.015607731, 0.018218663, -0.02298712, 0.06327374, -0.011168359, 0.011081706, -0.06463131, 0.009576145, 0.029967094, -0.025435435, -0.014742514, 0.0039470256, -0.0039138063, -0.008799749, -0.055739585, -0.009860854, -0.0069436273, 0.054330222, 0.06328543, -0.015017121, -0.0114556085, -0.11667232, -0.0008584938, 0.026635436, 0.0016710967, -0.008032238, 0.023939647, 0.058037985, -0.012584395, -0.017146919, 0.03229345, -0.041799143, -0.039313283, 0.026713364, 0.050865173, -0.015074648, -0.06263301, -0.04075633, 0.07573948, -0.038715936, -0.15524599, -0.1194521, 0.029005887, 0.012901064, 0.025297992, -0.03465793