(81, 'buku_sup_soto_sisca', '50', 51, '50\n\nNasi Bungkus Kencur\n\nAmbil 2 lembar daun pisang, isi dengan nasi kencur, taburi bawang goreng,\nalasi daun, tata ayam goreng, pepes, sambal oncom, dan tambahkan\nkering tempe bila ada, bungkus. Sajikan.\n\n33. Nasi Kencur\n\nBahan:\n\n5 sdm minyak goreng\n\n6 butir bawang merah, cincang\n200 gram oncom, remas-remas\n100 gram kencur, parut\n\n3 piring nasi putih\n\n4 sdt garam\n\n\"2 sdt merica bubuk\n\nTaburan:\nBawang goreng\n\nPelengkap:\nSambal terasi matang\n\nCara membuat:\n\n1. Panaskan minyak goreng, tumis bawang merah hingga layu. Masukkan\noncom dan kencur, masak hingga matang.\n\n2. Masukkan nasi putih, garam, dan merica bubuk, aduk rata, masak\nhingga bumbu merata. Angkat.\n\n3. Sajikan hangat sebagai pelengkap nasi rames, taburi dengan bawang\ngoreng dan sambal terasi.\n\nUntuk: 4-6 porsi', '[-0.025262184, 0.008749477, 0.03493259, -0.011485383, 0.03259837, -0.021573624, -0.0140512865, -0.0034274908, -0.0027964022, 0.023529574, -0.012121258, 0.03280723, 0.09916859, -0.036471985, -0.046741888, -0.1294434, 0.09222489, -0.032960925, -0.044757683, 0.01679692, 0.008009307, 0.0266003, 0.03947083, -0.020359328, -0.05301688, -0.023978105, -0.0101791, 0.015248977, -0.03451435, -0.005376743, 0.056878254, 0.0702618, -0.028339004, -0.01642523, 0.029684123, 0.014708937, -0.020434517, -0.010778004, 0.0042909835, -0.063852884, -0.04155194, 0.024386756, 0.05113272, 0.046743695, -0.044406593, -0.02979632, 0.054981865, 0.024629178, -0.01246295, 0.009909801, 0.017824944, -0.0041711912, -0.013564195, 0.019641304, -0.038618304, -0.006350349, 0.015741868, 0.0010055448, -0.07282998, 0.074102916, -0.04204343, 0.0254109, -0.0644833, -0.02057492, -0.0010206648, -0.0169484, -0.029415369, -0.0074408758, 0.026744101, 0.022259878, -0.031329963, 0.016294135, -0.020386377, 0.06050179, 0.046382736, 0.0014115424, 0.00018923148, -0.072668836, 0.0048428965, 0.03639531, 0.003704509, -0.0033387255, 0.028231146, 0.05974831, 0.017165942, 0.00588600