(82, 'buku_sup_soto_sisca', '54. Ayam Goreng Kemari', 52, '54. Ayam Goreng Kemari\n\nBahan:\n\n4\n\nekor ayam, potong menjadi 20 bagian\n\n2 batang serai\n\n3 lembar daun jeruk\n2 lembar daun salam\n300 miair\n\nBumbu yang dihaluskan:\n\n8\n10\n4\n4\n\n50\n\nbutir bawang merah\nbutir kemiri, sangrai\nsdm ketumbar\n\nsdt jintan\n\nsdr garam\n\nsdt merica bubuk\ngram lengkuas parut\n\nMinyak secukupnya untuk menggoreng\n\nCara membuat:\n\n1.\n2.\n3.\n\nCuci bersih ayam dan tiriskan.\n\nLumuri ayam dengan bumbu halus, aduk rata, diamkan selama 15 menit.\nMasak ayam bersama serai, daun salam, dan daun jeruk, diamkan\nhingga berubah warna dan air dari ayam mulai mengering. Tambahkan air\ndan masak kembali hingga mengering, angkat.\n\nPanaskan minyak, goreng ayam hingga matang. Angkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi\n\nS1', '[0.0077404054, -0.0149925575, 0.023415448, -0.00426783, 0.017376991, -0.011913028, -0.048590463, -0.010089365, 0.0038262277, 0.06307448, -0.01380683, 0.039515123, 0.086723484, -0.053778104, -0.022407105, -0.11891159, 0.0558424, -0.030883057, -0.021469047, 0.004747394, 0.015059139, 0.0020189534, 0.025708826, -0.015138943, -0.08513497, -0.010077748, 0.016081907, 0.02790475, -0.034392174, 0.012207416, 0.046998117, 0.080901064, -0.00082845136, -0.020015735, 0.044087354, 0.028830819, -0.009962157, -0.016914764, -0.015476104, -0.034327023, -0.061415736, 0.027751468, 0.061369065, 0.054387074, -0.07565032, -0.064066, 0.028488992, 0.0376114, -0.023259781, 0.0042796195, 0.004504284, 0.016199393, -0.01301244, 0.021827137, -0.041181717, -0.015624316, 0.010788813, 0.02879239, -0.053973056, 0.07042965, -0.015699241, 0.013705034, -0.069657885, -0.009429643, 0.023574496, -0.026492845, -0.013737654, 0.0034090206, 0.012035221, -0.0060843825, -0.0038765946, 0.0018824465, -0.027950665, 0.04811238, 0.0884186, -0.018048754, -0.008918263, -0.089599326, 0.040610638, -0.0010737894, -0.009515418, -0.028837962, 0.037428666, 0.045188464, 0.004542451