(83, 'buku_sup_soto_sisca', '52', 53, '52\n\n33. Pepes Spesial\n\nBahan:\n\n6 butir telur bebek asin\n\n125 ml santan kental dari Yz butir kelapa\n1 butir telur ayam\n\n1 buah tahu putih besar, cincang kasar\n100 gram jamur merang, iris\n\n4 sdt garam\n\n\"Aa sdt merica bubuk\n\n1 sdt gula pasir\n\n6 butir bawang merah, iris\n\n3 siung bawang putih, iris\n\n2 buah cabai merah besar, iris\n\n2 lembar daun jeruk, iris\n\n1 buah tomat, potong dadu kecil\n\n12 buah cabai rawit merah\nPelengkap:\n\nDaun secukupnya, untuk membungkus.\n\nCara membuat:\n\n1.\n2.\n\nPisahkan telur bebek asin dari kuning dan putihnya.\n\nCampur santan kental dengan telur, garam, merica, dan gula pasir,\naduk rata.\n\nMasukkan tahu, irisan jamur, bawang merah, bawang putih, cabai\nmerah, daun jeruk, dan tomat, aduk rata.\n\nAmbil daun, tuangkan adonan, beri cabai rawit dan kuning telur asin\nbungkus, dan\n\nbentuk tum. Kukus selama 20 menit hingga matang. Angkat.\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi', '[-0.0053749597, 0.00017967621, 0.0077567813, -0.006155958, 0.033882733, -0.01994462, -0.026936825, -0.0014740984, 0.024292065, 0.018362427, -0.024230527, 0.062898226, 0.08865329, -0.02338902, -0.02816702, -0.10407047, 0.047496364, 0.033081047, -0.050096337, -0.0072285817, 0.040695045, 0.014872251, 0.06941416, -0.028721383, -0.08519403, -0.00225194, -0.0143327275, 0.01626299, -0.03224176, -0.012582651, 0.06591875, 0.07100107, -0.0038224787, -0.036171976, 0.03161914, 0.020088458, -0.011985106, 0.00019061378, 0.0015134206, -0.042575784, -0.033445146, 0.04750771, 0.05515456, 0.027041623, -0.028038524, -0.0174761, 0.025250196, 0.05932252, -0.014391456, 0.008396017, -0.0039342, -0.01565226, 0.0039456827, 0.0010073368, -0.020992102, -0.0109215025, -0.019456612, 0.024429668, -0.04461866, 0.05742941, -0.0151568055, 0.021408949, -0.07118671, -0.011637347, -0.03386342, 0.0014209092, -0.040058006, -0.0033566004, -0.010592158, 0.012382983, -0.030347735, 0.022793315, -0.049000464, 0.0206