(84, 'buku_sup_soto_sisca', '8.', 54, '8.\n\nSambal Oncom\n\nBahan:\n\n250 gram oncom, remas-remas\n\n100 gram leunca\n\n5 sdm minyak goreng\n\n2 buah cabai merah besar, iris\n\n10 buah cabai rawit merah, iris\n\n3 siung bawang putih, iris\n\n3 butir bawang merah, iris\n\n3 lembar daun jeruk\n\n1 batang serai, memarkan\n\n1 sdt garam\n\n2 sdt merica bubuk\n\n1 sdt gula pasir\n\n1 ikat kemangi, siangi, cuci bersih\n\nCara membuat:\n\n1. Panaskan minyak goreng, tumis cabai merah, cabai rawit, bawang putih,\nbawang merah daun jeruk, dan serai hingga layu.\n\n2. Masukkan oncom, garam, merica, dan gula pasir, aduk rata. Setelah\nOncom matang, masukkan leunca, aduk rata, masak sebentar. Tambahkan\nkemangi aduk rata, angkat.\n\n3. Sajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi\n\n53', '[-0.023962166, 0.029708909, 0.021997355, -0.016943727, 0.005671346, 0.0065496326, 0.007138548, 0.04755983, 0.0045822402, -0.0024429795, 0.0034266463, 0.058523025, 0.08688862, -0.03009061, -0.047235835, -0.111235864, 0.057828132, -0.0046333424, -0.071467675, 0.012214904, 0.009896761, 0.03741284, 0.009640643, -0.029577289, -0.042162176, 0.021996487, 0.022386754, 0.051011726, -0.07000943, -0.03887082, 0.06338529, 0.08197971, 0.014604245, -0.007296501, 0.01994094, 0.031022074, -0.028758511, 0.00484357, -0.0118018715, -0.04003077, -0.042706996, 0.013831239, 0.03836725, 0.005549763, -0.03084163, -0.041479394, 0.058780782, 0.071199566, -0.02361819, 0.012163049, -0.0029112361, -0.0346299, -0.017813096, 0.025165638, -0.044387773, -0.0269992, -0.006726788, -0.016829414, -0.050460175, 0.0466526, -0.057727396, 0.00047245368, -0.061778232, -0.010141952, 0.019941552, -0.018443545, -0.011588339, 0.0050430074, -0.004739088, 0.0030840517, -0.065442376, -0.015515178, -0.03787481, 0.04413035, 0.049788576, -0.0028245617, -0.03625776, -0.09389211, 0.00091662724, 0.031782456, 0.025952619, -0.005969902, 0.029248016, 0.062250003, 0.038607027, -0.019327184, 0.006801065, -0.02845712, -0.029513473, 0.047365