(85, 'buku_sup_soto_sisca', '54', 55, '54\n\nNasi Bungkus Kukus\n\n37.\n\nSiapkan daun pisang, tata nasi putih secukupnya, alasi dengan\ndaun, tata ayam masak santan, telur pindang, tumis ati ampela\nayam, kering kentang teri asin, dan lalapan, bungkus.\n\nKukus selama 10 menit. Sajikan.\n\nAyam Masak Santan\n\nBahan: Bumbu yang dihaluskan:\n\n1 ekor ayam, potong 4 bagian 10 butir bawang merah\n\n1 sdm air jeruk nipis 8 siung bawang putih\n\n1 sdt garam 1 sdm ketumbar, sangrai\n3 lembar daun salam 6 butir kemiri, sangrai\n\n2 batang serai, memarkan 1 sdm gula merah, sisir\n5 cm lengkuas, memarkan 1 sdt garam\n\n2 cm jahe, memarkan 2 sdt merica bubuk\n\n3 sdm minyak goreng\n\nmi santan kental dari\n1 butir kelapa\n\nmembuat:\n\nLumuri ayam dengan air jeruk nipis dan garam, diamkan sebentar, cuci\nbersih kembali dan tiriskan.\n\nRebus ayam hingga lunak, angkat dan suwir kasar.\n\nPanaskan minyak goreng, tumis bumbu halus bersama daun salam,\nserai, lengkuas, dan jahe hingga harum. Masukkan santan dan masak\nhingga mendidih, masukkan ayam suwir dan masak hingga kuah\nmengering, angkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi', '[-0.007128508, -0.003982722, 0.04076987, 0.003533546, 0.022394309, -0.011057258, -0.025634212, -0.01228667, 0.0052322624, 0.028320096, -0.023852399, 0.035252072, 0.09945615, -0.057056747, -0.04786451, -0.102551475, 0.0573942, -0.001140273, -0.05447015, -0.0016492516, 0.022538075, 0.015389664, 0.028528728, -0.033631865, -0.06521461, -0.017018126, -0.026121473, 0.0123075405, -0.016792554, -0.0051838076, 0.05826276, 0.052006293, -0.006659407, -0.050850015, 0.031396247, -2.8002967e-05, -0.004035344, -0.005090721, -0.010192842, -0.06928539, -0.043798164, 0.03648809, 0.033498295, 0.047175106, -0.03701325, -0.01902554, 0.035875555, 0.026670553, -0.0009340461, -0.000716774, 0.025486989, 0.0062428312, 0.002899401, 3.1345215e-05, -0.058285505, -0.035973128, 0.019832436, 0.03412686, -0.05441953, 0.06417584, -0.056785654, 0.015092334, -