(86, 'buku_sup_soto_sisca', '35. Telur Pindang', 56, '35. Telur Pindang\n\nBahan:\n6 butir telur ayam kampung\n1 liter air\n\n250 gram kulit bawang merah\n8 lembar daun jambu biji\n\n5 lembar daun salam\n\n2 batang serai, memarkan\n\n2 cm lengkuas, memarkan\n\n2 sdt garam\n\nCara membuat:\n\n1. Cuci bersih telur.\n\n2. Masak telur bersama air, kulit bawang merah, daun jambu biji, daun salam,\nserai, lengkuas, dan garam, gunakan api sedang. Setelah 20 menit dari\nsaat air mendidih, angkat telur dan pukul-pukul hingga retak,\nrebus kembali hingga air menyusut dan telur berwarna cokelat gelap,\nangkat.\n\n3. Sajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi\n\n55', '[-0.009674409, -0.00358228, 0.0147798285, -0.026558964, 0.03382452, -0.010307293, -0.015880466, -0.044918306, 0.012769975, 0.02234167, -0.012074548, 0.05463585, 0.08619319, -0.030106314, -0.025850277, -0.109689265, 0.06859625, 0.00041796052, -0.046247635, 0.012705251, 0.0269009, 0.018665802, 0.05730784, -0.008934548, -0.056552928, 0.0015011883, -0.0127578825, 0.025697613, -0.044612166, 0.0059300293, 0.049702942, 0.06923039, -0.0021846225, -0.044383474, 0.026553301, 0.031982273, -0.016834922, -0.005299518, -0.024541575, -0.040106572, -0.042673443, 0.049351815, 0.044056185, 0.03178395, -0.038968828, -0.03358197, 0.0025496432, 0.048388086, -0.025724927, -0.007225161, 6.4200605e-05, 0.013163883, -0.017796949, 0.006040823, -0.054908678, -0.02999141, 0.006057644, 0.013181108, -0.03876563, 0.030154116, -0.015619782, 0.016043011, -0.082193755, -0.01170604, -0.0088437395, 0.0049406146, -0.035597555, -0.024293216, 0.001350022, -0.00069241563, -0.033077553, 0.04127141, -0.057543468, 0.042531107, 0.07153404, 0.006574009, -0.002749391, -0.06975145, 0.01719241, 0.010478035, 0.0018006486, -0.008215487, 0.024663461, 0.07899217, -0.007467181, -0.008600735, 0.013219463, -0.028728496, -0.029586503, 0.055308677, 0.076743625, -0.0041816104, -0.04257327, -0.015845949, 0.09056081, -0.0676541, -0.1323214, -0.09881171, 0.03