(87, 'buku_sup_soto_sisca', '39. Tumis Hati Ampela Ayam', 57, '39. Tumis Hati Ampela Ayam\n\nBahan:\n\npotong hati ayam\n\npotong ampela ayam\n\nbuahr jeruk nipis, ambil airnya\nlembar daun jeruk\n\nlembar daun salam\n\ncm lengkuas, memarkan\n\ncm jahe, memarkan\n\nsdm minyak goreng\n\nbutir bawang merah\n\nsiung bawang putih\n\nbuah cabai merah besar, iris\nbuah cabai hijau besar, iris\nsdm kecap manis\n\nsdt garam\n\nsdt merica bubuk\n\nbuah cabai rawit merah\n\nCara membuat:\n\n1.\n\nLumuri hati dan ampela ayam dengan air jeruk nipis, diamkan sebentar,\ncuci bersih kembali dan rebus hingga matang. Angkat, potong-potong.\nPanaskan minyak goreng, tumis bawang merah, bawang putih, cabai\nmerah, cabai hijau, daun jeruk, daun salam, lengkuas, dan jahe\n\nhingga layu.\n\nMasukkan hati ampela, kecap manis, garam, dan merica, aduk rata,\nmasak hingga bumbu merata, tambahkan cabai rawit, angkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi', '[-0.022111978, 0.006482359, 0.017448409, -0.020014634, 0.026771177, -0.0014549469, -0.030277463, -0.009764783, 0.050746918, 0.042507473, -0.016855568, 0.0622605, 0.07468152, -0.030310167, -0.030276963, -0.12789111, 0.040303096, 0.036905643, -0.05366844, 0.034603845, 0.041568194, 0.046431925, 0.026332524, 0.0014159761, -0.050999925, 0.0018998216, -0.013838411, 0.037125986, -0.019270146, -0.0018853325, 0.052760813, 0.07083221, 0.021937113, -0.055456676, 0.021687513, 0.023191253, -0.032995936, -0.006798606, -0.03013431, -0.030495847, -0.0578772, 0.043387175, 0.05676922, 0.023723654, -0.054028954, -0.0020168722, 0.019475376, 0.015253092, -0.019708233, -0.00025888724, 0.024997203, 0.021793362, -0.0016207364, 0.0051637613, -0.07535321, -0.0016743571, 0.003924863, -0.0028578732, -0.06444383, 0.06731935, -0.036565825, 0.024641953, -0.055896156, -0.021947827, -0.00022564823, 0.036798973, -0.0059994063, -0.016361155, 0.031892464, -0.00069677783, -0.041439682, -0.01885078, -0.035620593, 0.030525774, 0.07608309, 0.011947378, -0.0