(88, 'buku_sup_soto_sisca', '40. Kering Kentang Teri Asin', 58, '40. Kering Kentang Teri Asin\n\nBahan:\n\n500 gram kentang\n\n50 gram teri asin goreng\n\nMinyak secukupnya, untuk menggoreng\n1 sdm cuka masak\n\n50 mlair\n\n2 lembar daun jeruk\n\nBumbu yang dihaluskan:\n\n5 buah cabai merah besar\n3 butir bawang merah\n\n3 siung bawang putih\n\n3 butir kemiri, sangrai\n\n50 gram gula pasir\n\n1 sdt garam\n\nCara membuat:\n\n1. Kupas kentang, cuci bersih, tiriskan serut pipih halus, dan rendam\ndalam air.\n\n2. Panaskan minyak, goreng kentang hingga kering, angkat dan tiriskan.\n\n3. Siapkan wajan, taruh bumbu halus, daun jeruk, air, dan cuka masak, aduk\nrata. Masak hingga bumbu harum dan gula menjadi karamel, masukkan\nkentang goreng, aduk rata. Tambahkan teri goreng, aduk rata.\n\n4. Simpan dalam stoples kedap udara.\n\nUntuk: 175 gram\n\n57', '[0.0025724298, 0.008456255, 0.024441767, -0.048040748, 0.037147425, -0.017412884, -0.02136263, 0.00011332562, 0.035619136, 0.041593615, -0.0041137207, 0.040570986, 0.061530363, -0.04314433, -0.020019345, -0.123477, 0.070055336, 0.010109344, -0.04069134, -0.0072065135, 0.0341686, 0.0006230224, 0.050228056, -0.009255934, -0.0711968, 0.019301789, -0.02398576, 0.02659325, -0.026593009, -0.023861289, 0.06228684, 0.051604748, -0.0098757595, -0.003596312, 0.0073802453, 0.0014979026, -0.025733521, 0.01424341, -0.024941837, -0.06083637, -0.045965247, 0.04121837, 0.04513662, 0.057548724, -0.07024257, -0.04038787, 0.026279293, 0.032542255, -0.027017558, 0.0016247348, 0.041369982, 0.0065312213, -0.016770558, 0.037140146, -0.01937713, -0.021672873, 0.011676219, 0.010530967, -0.040285915, 0.038042933, 0.023992682, 0.03459049, -0.09001035, -0.0421951, 0.0021090857, -0.008430851, -0.020840053, -0.001114821, 0.015536326, -0.0008816, -0.029956186, 0.0025650782, -0.017356586, 0.04094, 0.068843655, -0.011230236, -0.01836113, -0.0875095, -0.007874057, 0.020906132, 0.026268426, 0.004651924, 0.023280716, 0.08061352, -0.0060042622, -0.020599598, 0