(89, 'buku_sup_soto_sisca', '58', 59, '58\n\nNasi Rames Serundeng\n\nAmbil daun pisang, tata nasi putih, alasi daun, tata daging ungkep,\nserundeng manis, serundeng pedas, serundeng kunyit, sambal terasi dan\nbila ada lengkapi dengan paru goreng, bungkus. Sajikan.\n\n4. Daging Uungkep Suwir\n\nBahan:\n\n500 gram daging gandik/paha sapi\n250 mi santan dari 1 butir kelapa\n2 batang serai, memarkan\n\n2 cm lengkuas, memarkan\n\n3 lembar daun salam\n\n3 lembar daun jeruk\n\n250 mi santan dari 1 butir kelapa\n2  sdmairasam jawa\n\n2 sdm gula merah, serut\n\nBumbu yang dihaluskan:\n\nAA AA wWAa\n\nbutir bawang merah\nsiung bawang putih\nsdm ketumbar, sangrai\nsdt jintan, sangrai\n\nsdt garam\n\nsdt merica butiran\n\nCara membuat:\n\n1.\n2.\n\nRebus daging sapi hingga matang, suwir-suwir.\n\nMasak santan bersama bumbu halus, serai, lengkuas, daun salam, dan\ndaun jeruk, setelah mendidih, masukkan daging suwir, air asam jawa,\ndan gula merah, masak hingga mengering, angkat.\n\nHilangkan uap panasnya dan simpan dalam wadah bertutup.\n\nUntuk: 4-6 porsi', '[-0.0021871158, -0.0006855741, 0.037405692, -0.013477342, 0.011367346, -0.0069362377, -0.010190969, -0.0091886185, 0.025875125, 0.030880097, -0.026868207, 0.06188169, 0.0926138, -0.035505235, -0.035136398, -0.11195846, 0.059891235, -0.021221098, -0.05520063, 0.0019123974, 0.039687004, 0.026336512, 0.06443617, -0.04388138, -0.07275651, 0.0016456991, -0.031098587, 0.015385995, -0.017113755, -0.0059041795, 0.065589525, 0.055187445, 0.004741802, -0.020263167, -0.010830133, 0.0015117753, 0.0093103, -0.006834483, -0.008095098, -0.080695584, -0.046061136, 0.023570392, 0.0613184, 0.038354006, -0.03447839, -0.028511012, -0.0013374916, 0.055717357, -0.015418894, 0.01399054, 0.004858749, 0.009729157, 0.020829063, 0.020843772, -0.032902937, -0.03228758, 0.027148481, 0.033728763, -0.056360364, 0.069045536, -0.045617666, 0.020156303, -0.08199077, -0.014162763, -0.007141684, -0.03199676, -0.022419173, -0.0035932548, 0.022679264, -0.016364