(90, 'buku_sup_soto_sisca', '4Z. Serundeng Manis', 60, '4Z. Serundeng Manis\n\nBahan:\n\nbutir kelapa setengah tua\nlembar daun salam\nlembar daun jeruk\n\ncm jahe, memarkan\n\ncm lengkuas, memarkan\nsdm minyak goreng\n\nsdm air asam jawa\n\nBumbu yang dihaluskan:\n\nbutir bawang merah\nsiung bawang putih\nsdm ketumbar, sangrai\nsdt jintan, sangrai\nsdm gula merah\n\nsdt garam\n\nCara membuat:\n\n1.\n2.\n3.\n\nKupas kelapa setengah tua, cuci bersih, tiriskan dan parut memanjang.\nSangrai kelapa parut hingga berwarna kuning kecokelatan, angkat.\nTumis bumbu yang dihaluskan hingga harum. Masukkan daun salam,\ndaun jeruk, jahe, dan lengkuas, aduk rata. Masukkan air asam jawa,\ntambahkan kelapa sangrai, aduk rata bersama bumbu,\n\nmasak sebentar, angkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk : 4-6 porsi\n\n59', '[0.011930488, -0.0034151566, 0.044789042, -0.011742409, 0.008663875, -0.0038658509, -0.030797426, 0.009022214, 0.025671633, 0.04355391, -0.017336996, 0.0674669, 0.09712729, -0.03694951, -0.032166433, -0.12038226, 0.036027834, 0.00076736603, -0.064657405, -0.005775537, 0.035744857, 0.026627632, 0.034395397, -0.044525765, -0.06357059, 0.0028551365, -0.022725267, 0.033853803, -0.044034496, 0.008659539, 0.0838874, 0.048437495, 0.00022158993, -0.045626737, 0.021564627, 0.010889433, -0.014427197, 0.0019195745, -0.010704219, -0.0679783, -0.048489343, 0.026223376, 0.048545297, 0.035239726, -0.045077793, -0.030330796, 0.025421996, 0.028410874, -0.029116785, 0.019957619, -0.00043933722, -0.012272714, 0.023539817, 0.04994392, -0.025385711, -0.013421972, 0.020495158, 0.026946804, -0.034177553, 0.06914134, -0.030126322, 0.0068678437, -0.07868411, -0.0107501345, 0.010874072, -0.018193778, -0.018577432, -0.01056315, 0.0019007846, -0.0018589934, -0.0282468, 0.028939225, -0.014694727, 0.03873063, 0.0543124, -0.023259774, -0.020564703, -0.08269584, -0.007792055, 0.014988758, 0.028895928, 0.015361982, 0.024439735, 0.046599194, 0.021960761, -0.0058049345, 0.008923239, -