(91, 'buku_sup_soto_sisca', '43, Serundeng Pedas', 61, '43, Serundeng Pedas\n\nBahan:\n\nbutir kelapa setengah tua\nlembar daun salam\nlembar daun jeruk\n\ncm jahe, memarkan\n\ncm lengkuas, memarkan\n\nBumbu yang dihaluskan:\n\nAAA Kw\n\nbutir bawang merah\nsiung bawang putih\nsdt terasi matang\nsdt jintan, sangrai\nsdm gula pasir\n\nsdt garam\n\nCara membuat:\n\n1.\n2.\n3.\n\nKupas kelapa setengah tua, cuci bersih, tiriskan, dan parut memanjang.\nCampur kelapa dengan bumbu halus hingga bumbu merata.\n\nMasak kelapa bersama daun salam, daun jeruk, jahe, dan lengkuas hingga\nharum, mengering, dan bumbu meresap. Angkat, masukkan kelapa\nsangrai, aduk rata.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi', '[0.013829419, 0.01235017, 0.0122893695, -0.019600237, 0.027178572, -0.026141385, -0.027443403, -0.01931858, 0.020805452, 0.044854905, -0.015344629, 0.059444204, 0.09480366, -0.024195231, -0.033138398, -0.11554858, 0.043878652, -0.00077170954, -0.07286866, 0.0076505304, 0.030912407, 0.010372987, 0.067758344, -0.03554043, -0.07122521, 0.004398007, -0.031821877, 0.008576895, -0.03485297, 0.0075550172, 0.095975034, 0.060876757, 0.0032978759, -0.036016084, -0.00074867875, 0.00769882, -0.012344625, 0.009206902, -0.006356309, -0.06360567, -0.051548004, 0.04221126, 0.058547016, 0.05331819, -0.051277842, -0.045427766, 0.008049602, 0.037404556, -0.024933489, 0.0063240207, 0.005033811, -0.0004516757, 0.005546786, 0.039932325, -0.033647407, -0.013950329, 0.015433019, 0.030201543, -0.053046882, 0.07500604, -0.029975858, 0.01621333, -0.08210024, -0.029241553, 0.0104483785, -0.022879925, -0.030105092, -0.023326043, -0.0010780618, -0.0030125938, -0.02604168, 0.031932056, -0.03914682, 0.041703627, 0.05423361, -0.020330181, -0.002489469, -0.07067464, -0.004384015, 0.022998972, 0.014256053, -0.0013335585, 0.03696063, 0.045497347, 0.0019871807, 0.004007491, 0.0174612, -0.03103675, -0.029087149, 0.048724093, 0.0769037, 0.006217909, -0.081091546, -0.031760592, 0.07217698, -0