(93, 'buku_sup_soto_sisca', '47. Serundeng Kuning', 63, '47. Serundeng Kuning\n\nBahan:\n\nbutir kelapa setengah tua\nlembar daun salam\nlembar daun jeruk\n\ncm jahe, memarkan\n\ncm lengkuas, memarkan\n\nBumbu yang dihaluskan:\n\nbutir bawang merah\nsiung bawang putih\ncm kunyit\n\nsdm ketumbar, sangrai\nsdt jintan, sangrai\nsdm gula pasir\n\nsdt garam\n\nCara membuat:\n\n1.\n2.\n3.\n\nKupas kelapa setengah tua, cuci bersih, tiriskan, dan parut memanjang.\nCampur kelapa dengan bumbu yang dihaluskan hingga rata.\n\nMasak bersama daun salam, daun jeruk, jahe, dan lengkuas, aduk rata.\nMasak hingga mengering dan bumbu meresap, angkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi', '[-0.0053265505, 0.00575066, 0.03726776, -0.020301595, 0.025054058, -0.021401957, -0.019057177, -0.013715534, 0.022961736, 0.04664743, -0.01705972, 0.059817187, 0.093036346, -0.03975359, -0.03597094, -0.12624961, 0.036440056, -0.0074956636, -0.062465616, 0.009848874, 0.04237396, 0.01439181, 0.06510373, -0.04386406, -0.051577445, 0.011874976, -0.022395931, 0.008640667, -0.024787502, 0.00678733, 0.095579155, 0.06418191, 0.028348286, -0.03744303, -0.0050087697, 0.011420919, 0.007808413, -0.0013167225, -0.011350962, -0.051342286, -0.0468543, 0.03293816, 0.05170578, 0.0537409, -0.046896797, -0.033986874, 0.019334365, 0.036711078, -0.016105479, 0.009215238, 0.018903783, -0.0051763873, 0.008608876, 0.03442678, -0.031417333, -0.014383557, 0.0077996003, 0.035581168, -0.04380307, 0.085721634, -0.030203946, 0.0036498448, -0.09707445, -0.03227808, 0.010769955, -0.027727861, -0.012668035, -0.021866987, 0.007362334, -0.01300791, -0.028541712, 0.037401162, -0.03459096, 0.05497408, 0.056585066, -0.02005058, -0.01092293, -0.07161522, -0.012902773, 0.017446443, 0.0086796945, 0.009135967, 0.030774564, 0.050979625, 0.007347801, 5.7265737e-05, 0.017961849, -0.03559246, -0.0290662, 0.051545966, 0.082325764, 0.014137598, -0.09199058, -0.0383416, 0.07315943, -0.042182926, -0.12523864, -0.11396463, 0.