(94, 'buku_sup_soto_sisca', 'Nasi Kunyit Rames', 64, 'Nasi Kunyit Rames\n\nAmbil daun pisang, tata nasi alasi dengan daun pisang, tata sambal\npindang tongkol suwir, kering ubi, daging ungkep bumbu manis, dan irisan\nmentimun, bila ada tambahkan abon. Bungkus. Sajikan.\n\n4. 3ambal Pindang Tongkol Suwir\n\nBahan:\n\n2 batang serai, memarkan\n\n6 lembar daun jeruk\n\n2 cmjahe, memarkan\n\n50 lembar daun kemangi\n\n5 sdm minyak goreng\n\n250 gram daging ikan pindang tongkol, suwir\n3 buah cabai merah besar, iris halus\n\n10 buah cabai rawit merah, iris\n\nBumbu yang dihaluskan:\n5 buah cabai hijau besar\n20 buah cabai rawit hijau\n7 butir bawang merah\n\n4 cm jahe\n\n1 sdt garam\n\nCara membuat:\n\n1. Panaskan minyak goreng, tumis bumbu yang dihaluskan bersama serai,\ndaun jeruk, dan jahe hingga harum. Masukkan ikan tongkol suwir, aduk\nrata, tambahkan daun kemangi, cabai merah, dan cabai rawit, aduk rata\ndan angkat.\n\n2. Sajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi\n\n63', '[-0.023549294, 0.016718194, 0.020785406, -0.02043014, 0.016105048, -0.028820394, -0.020617533, 0.0063829697, 0.017944794, 0.017432123, -0.010923935, 0.04023637, 0.0985793, -0.03945483, -0.031183576, -0.11113691, 0.051686525, -0.010230535, -0.062398147, -0.01535565, 0.026910855, 0.03626506, 0.05955701, -0.013864696, -0.03560629, -0.0035539316, -0.025017241, 0.022330081, -0.012111386, -0.014804776, 0.04445215, 0.040737715, -0.011471564, -0.054713547, -0.011294113, -0.008086547, 0.007291215, -0.01564006, 0.0043606344, -0.06893209, -0.021606138, 0.032790452, 0.04779685, 0.04774976, -0.039247707, -0.021163786, 0.016881587, 0.06595773, -0.012502869, -0.009157948, 0.007157014, -0.01656406, 0.006238358, 0.008997338, -0.048207168, -0.015349838, 0.041506574, 0.03928121, -0.03406357, 0.030636275, -0.044457532, 0.0017676732, -0.10129854, -0.03363449, 0.013383723, -0.011558735, -0.03084564, 0.019066092, 0.025064018, 0.0152562065, -0.024759365, 0.021110559, -0.03431545, 0.03393619, 0.057923507, -