(95, 'buku_sup_soto_sisca', '47. Kering ubi', 65, '47. Kering ubi\n\nBahan:\n500 gram ubi merah, potong bentuk korek api\nMinyak goreng secukupnya\n\nbuah cabai merah besar, buang isinya, iris tipis serong\nlembar daun salam\n\ncm lengkuas, memarkan\n\nml air\n\nsdm irisan gula merah\n\nsdm air asam jawa\n\nsdt garam\n\nsdm bawang goreng\n\nsdm bawang putih goreng\n\nCara membuat:\n\n1.\n\nPanaskan minyak goreng, goreng ubi hingga kering, angkat dan\nsisihkan.\n\nPanaskan 2 sdm minyak sisa menggoreng, tumis cabai merah hingga\nlayu, angkat.\n\nTumis daun salam dan lengkuas sebentar, masukkan air, gula merah,\nair asam, dan garam. Setelah mendidih, masukkan ubi goreng, tumisan\nCabai merah, bawang goreng, dan bawang putih goreng, aduk rata,\nangkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 6 porsi', '[-0.015557142, 0.012989833, 0.012647936, -0.015923485, 0.013337224, -0.014419624, -0.018353248, 0.016039781, 0.03056719, 0.037385482, -0.0060062925, 0.037968818, 0.07158653, -0.039771155, -0.035388567, -0.12331678, 0.05476273, 0.0031941696, -0.055313252, -0.020582564, 0.02655957, 0.039432023, 0.06525702, 0.0030130951, -0.06293398, 0.022075133, -0.01788678, 0.055765763, -0.024857087, -0.018598976, 0.040826224, 0.0625321, 0.015311422, -0.018307652, -0.0009180066, 0.0014678071, -0.024327941, -0.0037194705, -0.02696781, -0.07454744, -0.071652986, 0.033204652, 0.04471031, 0.055918235, -0.04797211, -0.03585697, 0.020898681, 0.05739767, -0.010573643, 0.020239376, 0.009980833, -0.018364271, 0.006802106, 0.035046197, -0.055864364, -0.0032029827, 0.012179724, 0.022742001, -0.047573086, 0.051745787, -0.00867311, 0.013656583, -0.10353699, -0.009158722, 0.039075125, -0.023663733, -0.02570753, 0.018207422, -0.0039521856, 0.024837581, -0.025349176, 0.001193426, 0.012552985, 0.06866847, 0.055827543, -0.013519143, -0.013503458, -0.088702716, -0.0064883064, 0.024377344, 0.0028551507, 0.0024780289, 0.048925895, 0.08937739, 0.0060815327, -0.03380492, 0.035715792, -0.034083366, -0.