(96, 'buku_sup_soto_sisca', '48. Daging Ungkep Manis', 66, '48. Daging Ungkep Manis\n\nBahan:\n\n350 gram daging sapi has dalam, iris bentuk korek api\n3 lembar daun salam\n\n2 lembar daun jeruk\n\n10 sdm kecap manis\n\n250 miair\n\n3 sdm minyak goreng\n\nBumbu yang dihaluskan:\n\nbutir bawang merah\nsiung bawang putih\nsdm ketumbar, sangrai\nsdt jintan, sangrai\n\nsdt garam\n\nsdt merica bubuk\n\nCara membuat:\n\n1.\n2.\n3.\n\n4.\n\nIris daging sapi memotong serat 1 cm.\n\nLumuri daging dengan bumbu yang dihaluskan, diamkan selama 15 menit.\nPanaskan minyak goreng, masukkan daging bersama rendamannya, daun\nsalam, dan daun jeruk, masak hingga berubah warna.\n\nMasukkan kecap manis dan air, masak hingga daging lunak, kuah\nmenyusut, dan mengering, angkat.\n\nSajikan sebagai pelengkap nasi rames.\n\nUntuk: 4-6 porsi\n\n65', '[-0.010590903, -0.0035244713, 0.009358466, -0.009522363, -0.004428197, 0.026510395, -0.014435686, 0.020651484, 0.03547127, 0.04511981, -0.009452415, 0.07062598, 0.078063145, -0.0309523, -0.04212388, -0.12603791, 0.035987042, 0.006313797, -0.039760843, 0.0021810378, 0.040775083, 0.02350594, 0.05376975, -0.02717441, -0.059652004, 0.012590033, -0.019009197, 0.05451796, -0.008585552, -0.01173187, 0.048459087, 0.05663498, 0.011260154, -0.008830959, -0.009128727, 0.0017323891, -0.0103096245, 0.00149102, -0.032187343, -0.08683721, -0.052277397, 0.044490606, 0.045095727, 0.037065297, -0.060545523, -0.012572413, 0.035661235, 0.042390622, -0.0037281732, 0.04372443, -0.016484944, 0.0062121754, 0.017403554, 0.046916336, -0.03567519, -0.008370181, 0.02255208, 0.02807127, -0.055575572, 0.052747447, -0.023667192, 0.0012515659, -0.061340716, -0.017290331, 0.009864141, -0.0029383206, -0.017713556, -0.011265536, 0.029804686, 0.013245416, -0.0040230746, -0.001617252, 0.0052694613, 0.0689625, 0.032280024, 0.005289787, -0.008618047, -0.09924682, -0.011400691, 0.010355957, 0.027074987, 0.006513431, 0.043797776, 0.071420334, -0.0099563375, -0.007975101, 0.023512408, -0