(97, 'buku_sup_soto_sisca', '49. Nasi Kunyit', 67, '49. Nasi Kunyit\n\nBahan:\n\n500\n8\n1\n\ngram beras putih, cuci bersih\ncm kunyit parut\n\nsdm air jeruk nipis\n\nAir secukupnya untuk merendam\nsdt garam\n\nsdm minyak goreng\n\nmlair\n\nlembar daun pandan, simpulkan\ncm jahe, memarkan\n\nbatang serai, memarkan\n\nlembar daun jeruk\n\nlembar daun salam\n\nCara membuat:\n\n1.\n\nRendam beras bersama kunyit parut, air jeruk nipis, dan air, diamkan\nhingga berwarna kuning terang, cuci bersih kembali, tiriskan.\n\nMasak air bersama garam, minyak goreng, daun pandan, jahe, serai,\ndaun jeruk, dan daun salam, setelah mendidih masukkan beras kuning,\nmasak hingga menjadi nasi aron, angkat.\n\nKukus selama 30 menit atau hingga matang, angkat.\n\nUntuk: 4-6 porsi', '[-0.022949778, 0.0026304652, 0.02731549, -0.037063845, 0.01137504, -0.036187198, -0.042409167, 0.010163091, 0.0055469344, 0.041138273, -0.021927219, 0.027236298, 0.089252025, -0.060896907, -0.014434193, -0.12055272, 0.063751265, -0.017190658, -0.07854129, 0.004404662, 0.054475915, 0.024081035, 0.07391088, -0.015220923, -0.047537893, 0.0036008433, -0.012649907, 0.012082954, -0.01807607, -0.0006325969, 0.061149187, 0.03666085, -0.0069585396, -0.01985245, 0.026852312, 0.016637731, -0.007907747, 0.00425313, -0.009970285, -0.0589586, -0.05853397, 0.048791032, 0.027436528, 0.04510447, -0.047877476, -0.007841421, 0.025988935, 0.04444155, -0.0238549, 0.0047950163, 0.027990593, -0.028850963, -0.01121068, 0.03760044, -0.061955567, -0.0047884593, 0.025557, -0.0030588338, -0.034514703, 0.036183674, -0.046507366, 0.008933009, -0.08421339, -0.03862906, 0.011586437, -0.015719973, -0.008675935, 8.099902e-05, 0.030391704, 0.00084059406, -0.0213761, 0.012568828, -0.035045914, 0.030354373, 0.028699903, 0.008916878, -0.021593947, -0.07863427, 0.02178621, 0.055265382, -0.0015685675, -0.013999786, 0.05539557, 0.06318797, 0.015567054, -0.012600379, 0.013117848, -0.024141818, -0.0518619, 0.026698112, 0.07473048, -0.014499958, -0.0605