(98, 'buku_sup_soto_sisca', '50. Nasi Daging Manis', 68, '50. Nasi Daging Manis\n\nBahan:\n\n2 mangkuk nasi\n\n200 gram sapi sirloin, iris tipis\n2 lembar sawi putih, iris\n\n1 batang wortel, iris\n\n1 batang daun bawang\n\n2 butir telur, kocok lepas\nKuah:\n\n1 sdm minyak goreng\n\n14 buah bawang bombai, iris\n100 mi kaldu\n\n5 sdm kecap manis\n\n2 sdm kecap asin jepang\n\n1 sdm gula pasir\n\n1 sdt garam\n\n2 sdt merica bubuk\n\nCara membuat:\n\n1.\n\nPanaskan minyak goreng, tumis bawang bombai hingga layu. Masukkan\nkaldu, kecap manis, kecap asin jepang, garam, merica, dan gula pasir,\n\ndidihkan.\n\nSetelah mendidih, masukkan irisan daging, wortel, dan daun bawang,\nsetelah daging matang, masukkan telur, masak sebentar hingga telur\nsetengah matang, dan airnya habis, angkat.\n\nTaruh nasi dalam mangkuk, tuangkan daging dan isiannya.\n\nSajikan hangat.\n\nUntuk: 2 orang\n\n67', '[0.006311582, -0.0036171281, 0.038473614, 0.0034399661, 0.013428911, 0.017399969, -0.035158135, -0.0019775154, 0.0117009245, 0.042488113, 0.0059755025, 0.041074492, 0.10372423, -0.042007003, -0.045446616, -0.122394115, 0.058260746, -0.007623699, -0.019756753, 0.015567483, 0.016076867, 0.03808189, 0.053904574, 0.005717241, -0.053948216, -0.0038903174, -0.049268752, 0.04989767, -0.021539656, -0.009455191, 0.03184852, 0.052741084, 0.002895164, 0.010477425, -0.0021657352, 0.013073551, -0.022808278, 0.00356816, -0.014285839, -0.10294359, -0.040735845, 0.005465805, 0.048301414, 0.038146034, -0.07797898, -0.012595777, 0.04755654, 0.033372376, 0.0098147, 0.044497687, 0.006174614, 0.010438476, 0.0029001723, 0.027721277, -0.03961023, -0.005242096, 0.013335439, -0.0019360812, -0.038638942, 0.040518656, -0.02630771, 0.010207556, -0.059781864, -0.018081745, 0.032789953, -0.009538444, -0.011935208, -0.018401943, 0.043348376, 0.013323053, -0.01875722, -0.021689638, 0.008645508, 0.07424409, 0.029730996, 0.015413887, -0.017569385, -0.07627028, -0.0050599533, 0.03160732, 0.040006295, -0.021959437, 0.0526128