(99, 'buku_sup_soto_sisca', '68', 69, '68\n\nF1. Nasi Ayam Rebus\n\nBahan:\n2 mangkuk nasi\n\n3 sdm minyak goreng\n\n1 sdm minyak wijen\n\n3 siung bawang putih, memarkan\n\n1 cm jahe, memarkan\n\n1 liter air\n\n1 sdt garam\n\n\"2 sdt merica bubuk\n\n1 ekor ayam berat 900 gram,\nbelah 2 bagian putus\n\n1 atang daun bawang,\npotong-potong\n\nSaus:\n\n2 sdm minyak goreng\n\n1 siung bawang putih, memarkan\n1 cm jahe\n\nCara membuat:\n\n150 ml kaldu\n\n3 sdmkecap asin pekat\n1 sdm kecap manis\n\n4 sdt garam\n\n4 sdt merica bubuk\n\nPelengkap:\nKaldu\nMentimun\n\nSaus sambal atau sambal rebus:\n3 buah cabai merah, 7 buah cabai\nrawit merah, 2 siung bawang putih,\nrebus, angkat, haluskan. Tambahkan\n1 sdt garam, 1 sdm jahe parut, dan\nkecap asin, aduk rata dan campur\ndengan minyak wijen secukupnya.\n\n1. Ayam: Panaskan minyak goreng bersama minyak wijen. Tumis bawang\nputih, masukkan jahe, air, garam, merica, ayam, dan daun bawang. Masak\nhingga ayam lunak, angkat, tiriskan ayamnya.\n\n2. Saus: Panaskan minyak goreng, tumis bawang putih dan jahe hingga\nharum. Masukkan kaldu, kecap asin, kecap manis, garam, dan merica\n\nbubuk, didihkan, angkat.\n\n3. Siapkan mangkuk, tata nasi, ayam, dan mentimun, tuangkan saus\n\ndi atas ayam.\n\n4. Sajikan hangat dengan kaldunya.\n\nUntuk: 4 orang', '[-0.022485543, -0.022786127, 0.009277243, -0.025872186, 0.024962857, -0.008810386, -0.040687405, 0.016494138, 0.0037347006, 0.015839553, -0.018906066, 0.017091032, 0.11702349, -0.04809046, -0.023718426, -0.08230974, 0.049738, -0.0007994757, -0.07436878, 0.0035450514, -0.0029212772, 0.027461484, 0.030653922, -0.0052865283, -0.07954752, -0.015590849, -0.013801222, 0.032445934, -0.029664025, 0.0177955, 0.03441347, 0.059808783, 0.0026403188, -0.007127128, 0.037332598, 0.02707935, -0.026535753, -0.0052713905, -0.0151082715, -0.064537674, -0.06223248, 0.01860205, 0.042289834, 0.031914435, -0.0440884, -0.04113915, 0.01625156, 0.054858346, 0.0023757922, 0.0028132696, 0.01943512, -0.010613932, -0.0