(100, 'buku_sup_soto_sisca', '5Z. Nasi Daging Snpi Bumbu Bawang', 70, '5Z. Nasi Daging Snpi Bumbu Bawang\n\nBahan:\n\nmangkuk nasi putih\n\ngram daging sapi has dalam, iris memotong serat\nsiung bawang putih, haluskan\ncm jahe, parut\n\nbatang serai, memarkan\n\nsdm kecap asin jepang\n\nsdm kecap manis\n\nsdt gula pasir\n\nsdt garam\n\nsdt merica bubuk\n\nsdm tepung sagu\n\nml air\n\nsdm minyak goreng\n\nsdm minyak wijen\n\nbuah bawang bombai, iris\n\nPelengkap: Daun selada\n\nCara membuat:\n\n1.\n\n2\n\nCampur bawang putih, jahe, serai, kecap asin jepang, kecap manis, gula\npasir, garam, merica, dan tepung sagu, aduk rata. Masukkan irisan daging\nsapi, aduk rata dan diamkan selama 10 menit.\n\nPanaskan minyak goreng bersama dengan minyak wijen. Masukkan\ndaging sapi dan rendamannya, tambahkan air dan masak hingga daging\nsapi lunak dan kuah menyusut.\n\nMasukkan bawang bombai, aduk rata, masak sebentar, angkat.\n\nTaruh nasi dalam mangkuk, tuangkan daging sapi.\n\nSajikan hangat.\n\nUntuk: 2 orang\n\n69', '[-0.0030490207, 0.020587415, 0.032583147, 0.0018185248, 0.02579749, 0.014797534, -0.03906892, 0.014052511, 0.01815436, 0.023378346, -0.018885314, 0.054029975, 0.084011994, 0.0017838005, -0.067065164, -0.13704701, 0.05706789, 0.011461264, -0.054707937, 0.0096787, 0.015246614, 0.032861795, 0.049635686, -0.03142988, -0.06724937, 0.009200693, -0.06053066, 0.012475696, -0.023798577, -0.023154523, 0.029193794, 0.05024495, 0.008075345, 0.011651738, -0.012110927, 0.018843247, -0.017696736, 0.004612542, -0.0011585465, -0.089060344, -0.03423512, -0.00135585, 0.04628589, 0.0640951, -0.064180724, -0.0075424067, 0.011090899, 0.060655937, -0.009825048, 0.036788777, 0.025382852, -0.021538818, -0.0035312767, 0.04546463, -0.046873547, -0.027158385, 0.025212698, 0.0037050939, -0.068065695, 0.064362794, -0.043025613, 0.013462235, -0.08036508, -0.008194499, 0.023927134, -0.0131866075, -0.020950284, -0.01679725, 0.01884742, -0.0028122962, -0.022613827, 0.024219751, -0.034832202, 0.05