(101, 'buku_sup_soto_sisca', '70', 71, '70\n\n28. Nasi Ayam Sans Lemon\n\nBahan:\n\n2 daging dada ayam, potong dua bagian\n1 sdm air jeruk nipis dan\n\n1 sdt garam\n\nPanir:\n\n1 putih telur, kocok lepas\n\n150 gram tepung roti kasar\n\nMinyak secukupnya, untuk menggoreng\n\nSaus Lemon:\n\n2 buah jeruk lemon, peras airnya\n150 mlair\n\n2 sdm madu\n\n2 sdm gula pasir\n\n2 cmjahe, memarkan\n\n1 sdm tepung maizena\n\n4 sdt garam\n\nCara membuat:\n\n1. Cuci bersih daging dada ayam, lumuri dengan garam dan air jeruk nipis,\ndiamkan selama 15 menit, cuci kembali, dan tiriskan.\n\n2.  Panir: Celupkan ayam ke dalam putih telur dan lumuri dengan tepung\nroti hingga seluruh bagian ayam tertutup. Goreng hingga matang\nberwarna kecokelatan, angkat.\n\n3. Saus Lemon: Campur air jeruk lemon bersama air, madu, gula pasir,\ngaram, dan jahe, aduk rata dan didihkan, setelah mendidih, kentalkan\ndengan larutan maizena.\n\n4. Taruh nasi dalam mangkuk, tata ayam, tuangkan saus lemon.\n\n5. Sajikan hangat.\n\nUntuk: 2 orang', '[-0.0050237337, -0.022503367, 0.008445852, -0.023624122, 0.018153444, -0.019876448, -0.041371927, 0.012797417, 0.02689771, 0.042260088, -0.010783643, 0.04185634, 0.11234449, -0.07386248, -0.010024226, -0.08398578, 0.04158513, 0.013650708, -0.057341468, 0.015147628, 0.019775128, 0.037968747, 0.04767073, -0.00661264, -0.04971264, -0.021215009, -0.016434565, 0.019902889, -0.023213191, 0.008281264, 0.04081851, 0.036983833, -0.003371928, -0.021254042, 0.046377458, 0.023946077, -0.025752256, -0.02038939, -0.021817287, -0.030456452, -0.059537493, 0.018976396, 0.035385992, 0.014434075, -0.055915773, -0.03353524, 0.06941623, 0.062376156, 0.026156992, 0.030381015, 0.03295542, 0.018345973, -0.0015986302, 0.0199982, -0.04156797, -0.03945724, 0.014462744, -0.0158592, -0.018466676, 0.071449175, -0.060898792, -0.0066242022, -0.06553661, -0.027754394, -0.004214426, -0.021817515, 0.004027085, -0.034140173, 0.038704187, 0.0068378816, -0.017375907, -0.006841748, -0.010951943, 0.06269