(102, 'buku_sup_soto_sisca', '54. Nasi Siram Sayu ran', 72, '54. Nasi Siram Sayu ran\n\nBahan:\n\n2 mangkuk nasi\n\n2 sdm minyak goreng\n\n3 siung bawang putih, cincang\n\n100 gram daging ayam, iris bentuk korek api\n\n100 gram udang kupas\n\n4 buah bakso ikan, potong-potong\n\n100 ml kaldu ayam\n\n1 sdt garam dan\n\n2 sdt merica bubuk\n\n1 sdt tepung maizena, larutkan dengan sedikit air\n1 batang wortel, potong serong\n\n1 batang daun bawang, potong 2 cm\n\n100 gram kembang kol, siangi, potong menurut kuntum\n50 gram jamur kancing, iris\n\n100 gram jagung kecil/putren\n\n50 gram kapri\n\n1 lembar sawi hijau\n\nPelengkap:\n\nAcar mentimun cabai rawit\n\nCara membuat:\n\n1.\n\nPanaskan minyak, tumis bawang putih hingga harum. Masukkan ayam,\nudang, dan bakso, masak hingga ayam matang.\n\nMasukkan kaldu, garam, dan merica bubuk, didihkan dan kentalkan\ndengan larutan tepung maizena.\n\nMasukkan wortel, daun bawang, kembang kol, jamur, jagung, kapri, dan\nsawi hijau, masak hingga sayuran matang, angkat.\n\nTaruh nasi dalam mangkuk, tuangkan tumisan, lengkapi dengan acar.\nSajikan hangat.\n\nUntuk: 2 orang\n\n7', '[0.015039636, 0.016064726, 0.03522925, -0.021102658, 0.023483867, -0.013030497, -0.030544538, -0.00097608916, 0.03340486, 0.016138824, -0.0026387249, 0.044479243, 0.10374902, -0.045690704, -0.041066963, -0.09231209, 0.048704423, -0.012799222, -0.04602618, 0.018539596, 0.03149037, 0.030486444, 0.045443315, 0.00039961893, -0.07537534, -0.029032674, -0.021569243, 0.05447999, -0.028755896, -0.0040493137, 0.043110225, 0.061863456, 0.014883931, -0.029316207, 0.03265686, 0.0048437556, -0.0133306775, -0.0303949, -0.0058803326, -0.04803167, -0.07428794, 0.01869896, 0.059491698, 0.039394185, -0.053617403, -0.026758034, 0.04078095, 0.04560937, -0.005992556, 0.0029199591, 0.016713148, -0.03167952, -0.0203369, 0.0127178235, -0.061804485, -0.019687193, 0.027131742, 0.0071203243, -0.021146005, 0.051021013, -0.033732623, 0.020480575, -0.08546789, -0.013748927, 0.023908054, -0