(103, 'buku_sup_soto_sisca', '72', 73, '72\n\n55. Nasi Telur Asam Manis\n\nBahan:\n\n2 mangkuk nasi putih 3 sdm kacang polong beku\n\n4 butir telur 4x buah nanas, potong\n\n4 sdt garam bentuk kipas\n\n\"Aa sdt merica bubuk\n\n1 sdm tepung sagu Saus:\n\n100 gram udang kupas 250 mi sari jeruk\n\n100 gram daging kepiting/ 1 cm jahe, memarkan\nrajungan 1 sdm saus tomat\n\n1 batang wortel, serut 1 sdt cuka masak\n\n1 lembar kol, iris 1 sdm gula pasir\n\n1 batang daun bawang iris 1 sdm tepung maizena, larutkan\n\nMinyak secukupnya, untuk dengan sedikit air\n\nmenggoreng\n\nCara membuat:\n\n1.\n\nKocok telur sebenetar, masukkan garam dan merica, aduk rata.\nTambahkan\n\ntepung sagu, aduk rata.\n\nMasukkan udang, kepiting, wortel, kol, dan daun bawang,\n\naduk rata.\n\nPanaskan minyak dalam wajan kecil, tuangkan adonan telur dan goreng\nhingga kecokelatan, angkat.\n\nSaus: Campur jadi satu sari jeruk, jahe, saus tomat, cuka masak, dan\ngula pasir, aduk rata. Masak hingga mendidih, kentalkan dengan\nlarutan maizena, angkat.\n\nSetelah saus mengental, masukkan kacang polong dan nanas, masak\nsebentar, angkat.\n\nTaruh nasi dalam mangkuk, tata telur dan tuangkan saus dan isiannya.\nSajikan hangat.\n\nUntuk: 2 orang', '[-0.003192982, 0.008239228, 0.039692413, -0.01875548, 0.02308316, -0.0009857641, -0.038553026, 0.015409291, 0.02400651, 0.0053960476, -0.01855708, 0.048243117, 0.09625842, -0.034746397, -0.034710184, -0.10650108, 0.0655039, -0.010828671, -0.05311764, 0.010262113, 0.03016724, 0.034727287, 0.040813852, 0.0074199503, -0.064079, -0.019204384, -0.031476986, 0.037605897, -0.013961239, 0.0074902526, 0.06734985, 0.03394427, -0.013199804, 0.011787834, 0.028243583, 0.0049917144, -0.027737217, -0.01656646, -0.005422698, -0.083936855, -0.051889677, 0.032352515, 0.043898854, 0.010652858, -0.05520894, -0.029175835, 0.053642884, 0.05840561, -0.016381793, 0.007755915, 0.020800726, 0.0042175003, -0.0006412283, 0.01814821, -0.029468786, -0.02458516, 0.017348263, -0.017141264, -0.0