(104, 'buku_sup_soto_sisca', '2.', 74, '2.\n\nNasi Kare Ikan\n\nBahan:\n\nKare ikan:\n\n2 sdm minyak goreng\n\n2 sdm bawang bombai cincang\n\n3 siung bawang putih, cincang\n\n1 sdm tepung terigu\n\n250 mi santan dari /z butir kelapa\n\n50 gram bumbu kare basah\n\n300 gram daging ikan kakap, potong-potong\n1 sdt garam\n\n14 sdt merica bubuk\n\n4 sdm kacang polong beku\n\n1 buah cabai merah besar, iris serong\n2 mangkuk nasi putih\n\nCara membuat:\n\n1.\n\nKare ikan: Panaskan minyak goreng, tumis bawang bombai bersama\nbawang putih hingga harum. Masukkan tepung terigu, aduk rata.\nMasukkan santan, bumbu kare, kakap, garam, dan merica, masak\nhingga daging matang. Tambahkan kacang polong dan cabai merah iris,\nmasak sebentar, angkat.\n\nSiapkan mangkuk, tata nasi, tuangkan kare ikan di atasnya.\n\nSajikan hangat.\n\nUntuk: 2 orang\n\n73', '[0.020519396, 0.009212817, 0.037521277, -0.007934906, 0.014174205, -0.002722442, -0.02561253, 0.00794787, 0.030956628, 0.0018816184, -0.004678283, 0.038047764, 0.102197856, -0.043701075, -0.028344251, -0.12737668, 0.03942411, -0.012436632, -0.045638572, -0.015425116, 0.00768477, 0.0077446382, 0.059974093, -0.012134579, -0.056250636, 0.011492643, -0.0073400205, 0.042515412, -0.021604616, -0.022755407, 0.027397715, 0.0491359, -0.0097782295, -0.02040567, -0.0038151033, 0.0072860974, 0.0011871317, -0.022744028, 0.0053822487, -0.071981266, -0.056190725, -0.012021157, 0.07151169, 0.043320965, -0.08119652, -0.03116911, 0.022761209, 0.065725036, -0.0050066384, 0.026552022, 0.01780001, 0.0070150215, -0.004392087, 0.011899206, -0.037438378, -0.0142185325, 0.010204464, 0.018568547, -0.03826886, 0.03679898, -0.013455881, 0.014775623, -0.07198889, -0.019812148, 0.015581319, -0.009773576, -0.017388808, 0.011319677, 0.03766557, -0.017801601, -0.034275256, -0.00912493, -0.044951238, 0.062478594, 0.046324633, -0.01232205, -0.005359652, -0.08100143, 0.014431266, 0.045150675, 0.0073655685, -0.014504248, 0.04119006, 0.08908456, -0.0064970884, -0.0128837