(105, 'buku_sup_soto_sisca', '37. Nasi Ayam Kacang Mete', 75, '37. Nasi Ayam Kacang Mete\n\nBahan:\n\n2 mangkuk nasi putih\n\n1 dada ayam dengan tulang,\npotong dadu\n\nMinyak secukupnya, untuk\n\nmenggoreng\n\n3 siung bawang putih, memarkan\n\n1 buah bawang bombai, iris\n\n2 cm jahe, memarkan\n\n1 sdm saus tiram\n\n5 sdm kecap manis\n\n1 sdm saus sambal\n\n1 sdm madu\n\n1 sdt garam\n\n\"2 sdt merica bubuk\n\nCara membuat:\n\n100 mlair\n\n1 sdm tepung maizena, larutkan\ndengan sedikit air\n\n1 batang wortel, potong\nmenurut selera\n\n1 batang daun bawang,\npotong-potong\n\n50 gram kacang mete goreng\n\nTaburan:\n1 sdm wijen putih sangrai\n\n1. Potong ayam bentuk dadu, cuci bersih, tiriskan, dan goreng hingga\n\nsetengah matang.\n\n2. Panaskan minyak, tumis bawang putih, bawang bombai, dan jahe hingga\nharum. Masukkan saus tiram, kecap manis, saus sambal, madu, garam,\n\nmerica bubuk, dan air, didihkan.\n\n3. Kentalkan dengan larutan maizena, masukkan wortel, dan daun\nbawang, masak hingga sayuran matang, angkat.\n4. Taruh nasi dalam mangkuk, tuangkan ayam, taburi kacang mete\n\ndan wijen.\n5. Sajikan hangat.\n\nUntuk: 2 orang\n\n74', '[0.018234566, 0.023498502, 0.052096978, 0.0014038611, 0.009912512, -0.0031560245, -0.03535011, 0.016060788, 0.02654073, 0.007627956, 0.00082705123, 0.03695044, 0.08395342, -0.0397289, -0.016217142, -0.12425166, 0.03598228, 0.004702861, -0.032620877, -0.0058087767, 0.026058177, 0.0093909325, 0.040137507, 0.0032852746, -0.044913843, -0.018992586, -0.02010088, 0.043800507, -0.020152364, 0.021643257, 0.054984014, 0.05979966, -0.0025484774, -0.009245731, 0.06174929, 0.024509707, -0.027477218, 0.01581844, -0.0144348405, -0.0437578, -0.045126546, 0.020563627, 0.0794224, 0.05305328, -0.05006567, -0.03178545, 0.059250176, 0.027469203, 0.005238356, 0.010965191, 0.06356796, 0.022010295, -0.015519895, 0.0140993, -0.034742195, -0.036633752, -0.0056552947, -0.0042314045, -0.013031502, 0.06709251, -0.0058045685, 0.029083194, -0.05080337, -0.008867713