(106, 'buku_sup_soto_sisca', '28.', 76, '28.\n\nNasi udang Kapri\n\nBahan:\n\nmangkuk nasi putih\n\ngram udang sedang\n\nsdm minyak goreng\n\nsdm bawang bombai cincang\nbatang daun bawang, iris\nsdm kaldu\n\nsdm kecap manis\n\nsdm air asam jawa\n\nsdm saus sambal pedas manis\nsdt garam\n\ngram kapri\n\nbuah jamur shiitake segar, iris\n\nCara membuat:\n\n1.\n2.\n\nBuang kulit udang, sisakan ekor, dan belah punggungnya, cuci bersih.\nPanaskan minyak goreng, tumis bawang bombai hingga harum. Masukkan\ndaun bawang dan kaldu, didihkan.\n\nMasukkan kecap manis, air asam jawa, saus sambal, garam, dan udang,\nmasak hingga udang matang, tambahkan kapri dan jamur shiitake, masak\nsebentar, angkat.\n\nTaruh nasi dalam mangkuk, tuangkan udang dan sausnya.\n\nSajikan hangat.\n\nUntuk: 2 orang\n\n75', '[-0.009006866, -0.0033767526, -0.013254633, -0.033218317, 0.0029738152, 0.00207346, -0.0070552602, 0.03491067, 0.029496023, 0.027232025, 0.015014146, 0.033819154, 0.079083115, -0.008472839, -0.043400347, -0.14010392, 0.054925397, -0.0041729533, -0.018187242, -0.0032094927, 0.02373677, -0.0024774584, 0.03162237, -0.0011049852, -0.02649078, 0.0047812248, 0.0038140062, 0.043571122, -0.02173917, -0.008609528, 0.06411957, 0.06705274, 0.018324591, 0.008371602, -0.018462151, 0.021413561, 0.006896578, 0.024137465, -0.019311516, -0.07763543, -0.062753685, 0.041365467, 0.052763887, 0.04041892, -0.083075315, -0.035478994, 0.005717868, 0.09904285, 0.0021993404, 0.017755957, 0.055627003, -0.0054781158, -0.016953057, 0.017284075, -0.03276459, -0.013859868, 0.0029639574, 0.009486103, -0.030328441, 0.062118888, -0.013149711, -0.023638206, -0.07549997, -0.021136293, 0.04567825, -0.018209344, -0.019212378, -0.0062730704, 0.018418996, 0.028337458, -0.010959343, 0.012755561, -0.026471196, 0.094595775, 0.041719418, 0.02068066, 0.0008722233, -0.07604622, 0.0022546288, 0.048403904, 0.021862028, -0.0333161, 0.07706453, 0.07319458, 0.005335802, -0.0073430557, 0.026230516, -0.05048285, -0.043748755, 0.01665