(107, 'buku_sup_soto_sisca', '76', 77, '76\n\n59. Nasi Ikan Taoco\n\nBahan:\n1 ekorikan gurame berat \"4 sdt merica bubuk\n600 gram, siangi, 1 batang wortel\npotong 4 bagian 1 batang daun bawang, iris\n5 cm jahe, ambil airnya 1 sdm tepung maizena, larutkan\n2  sdmkecapasin dalam sedikit air\nMinyak secukupnya, untuk 3 buah tomat sayur, iris\nmenggoreng\n3 siung bawang putih, memarkan Bumbu yang dihaluskan:\n1 buah bawang bombai, 3 buah cabai merah besar\npotong-potong 1 sdm gula pasir\n2 cmjahe, memarkan 5 sdmtaoco\n200 mi kaldu ayam\n1 sdt garam\n\nCara membuat:\n\n1.\n\nSiangi ikan gurame, cuci bersih, lumuri dengan campuran air jahe dan\nkecap asin, diamkan selama 15 menit dan goreng hingga matang dan\nkering, sisihkan.\n\nPanaskan 2 sdm minyak sisa menggoreng, tumis bumbu halus bersama\nbawang putih dan bawang bombai hingga harum. Masukkan jahe, kaldu,\ngaram, merica, didihkan dan kentalkan dengan larutan maizena.\nMasukkan wortel dan daun bawang, aduk rata. Masak hingga matang,\ntambahkan tomat sayur, aduk rata, angkat.\n\nTaruh nasi dalam mangkuk, letakan ikan goreng lalu tuangkan sausnya.\nSajikan hangat.\n\nUntuk: 2 orang', '[-0.00529733, 0.028632564, 0.029650146, -0.0055009346, 0.029359555, -0.005513795, -0.0014347833, 0.003214949, 0.015138334, 0.020809323, 0.00012373563, 0.057672594, 0.06995854, -0.026524315, -0.03362214, -0.11240426, 0.058641367, -0.027258862, -0.055804215, 0.03134442, 0.020693786, 0.010758571, 0.06831502, -0.0051550553, -0.065763414, -0.009360491, -0.02242193, 0.032855045, -0.016222175, -0.02576017, 0.04937418, 0.04744132, 0.0023087633, -0.0151612535, 0.014073143, 0.01491267, 2.8627084e-05, -0.036427334, 0.001199974, -0.060513094, -0.015896972, -0.0051492834, 0.062277637, 0.05801918, -0.049303975, -0.0538027, 0.03680614, 0.060881224, -0.00065377133, 0.026647665, 0.03908138, 0.0074542006, 0.004000194, -0.010312824, -0.016651228, -0.002439639, 0.047102418, 0.008898629, -0.004366142, 0.065705426, 0.0058108466, 0.029044934, -0.08086982, -0.0