(108, 'buku_sup_soto_sisca', '0. Nasi Iga Bumbu Kecap', 78, '0. Nasi Iga Bumbu Kecap\n\nBahan:\n\n2\n\nmangkuk nasi putih\n\n500 gram iga sapi, potong-potong\nAir secukupnya, untuk merebus iga\n\n3\n5\n3\n50\n\nsdm minyak goreng\n\nbutir bawang merah, haluskan\nsiung bawang putih, haluskan\ngram jahe, parut\n\nsdt garam\n\nsdt merica bubuk\n\nbiji pala, memarkan\n\nlembar daun salam\n\nlembar daun jeruk\n\nCara membuat:\nRebus iga sapi hingga lunak, angkat, tiriskan.\n\nPanaskan minyak goreng, tumis bawang merah halus dan bawang putih\nhalus hingga layu. Masukkan iga sapi, jahe, garam, merica, pala, daun\nsalam, daun jeruk, serai, kecap manis, cengkih, kayu manis, dan gula\nmerah, masak hingga bumbu merata.\n\nMasukkan kentang dan, wortel, tambahkan kaldu. Masak hingga\n\n1.\n2.\n\nbumbu merata, angkat.\n\nbatang serai, memarkan\n\nsdm kecap manis\n\nbutir cengkih\n\ncm kayu manis\n\nsdm gula merah iris\n\nbuah kentang rendang\nbatang wortel\n\n250 mi kaldu sisa merebus\nBawang goreng secukupnya, untuk\ntaburan\n\nND Www JanN\n\nTaruh nasi dalam mangkuk, tuangkan iga dan isinya, taburi\n\nbawang goreng.\nSajikan hangat.\n\nUntuk: 2 orang\n\n7', '[-0.03420607, -0.011253444, 0.025305549, -0.0030426276, 0.029276477, -0.0010885064, -0.035202995, 0.021520529, 0.022097448, 0.010522548, -0.020804072, 0.026899697, 0.09823602, 0.01619291, -0.06316348, -0.1002468, 0.04383878, 0.0015770842, -0.04795103, 0.0045384094, 0.0065419907, 0.032730814, 0.036830578, 0.009878476, -0.073121086, 0.0011514201, -0.04284042, 0.034982845, -0.02869928, -0.027456274, 0.047019403, 0.048500516, -0.0060902336, -0.020634247, 0.02302232, 0.010022215, -0.03046777, 0.005886871, 0.0051211016, -0.11378814, -0.06090009, 0.0018347749, 0.06469845, 0.03773805, -0.04484531, -0.017720377, 0.04611986, 0.04014898, 0.001017619, 0.024415536, -0.009626767, 0.0008393869, -0.013048722, 0.02894699, -0.041070677, 0.0014916741, 0.016818691, 0.008651573, -0.05648769, 0.11451095, -0.01624979, 0.030270545, -0.07288132, -0.