(109, 'buku_sup_soto_sisca', '78', 79, '78\n\nt1. Nasi Ayam Panggang\n\nBahan:\n2 mangkuk nasi putih 1 sdm saus tomat\n2 sdm kecap manis\nAyam Panggang: 14 sdt garam\n1 ekor ayam, potong YA sdt merica bubuk\ndua bagian putus 1 sdm gula pasir\n5 siung bawang putih 200 mliair\n1 sdt garam 1 sdm tepung maizena, larutkan\n\"4 sdt merica bubuk dengan sedikit air\n1 sdt kecap asin\n1 sdm kecap manis Pelengkap:\nDaun selada dan irisan mentimun\nSaus:\n\n2 siung bawang putih, haluskan\n\n3 buah cabai rawit merah,\nhaluskan\n\n3 sdmtaoco\n\nCara membuat:\n\n1. Cuci bersih ayam, tiriskan, lumuri dengan campuran bawang putih,\ngaram, merica, kecap asin, dan kecap manis, diamkan selama 15 menit,\npanggang dalam oven hingga matang dan berwarna kecokelatan,\nangkat.\n\n2. Saus: Campur bawang putih dan cabai yang dihaluskan dengan taoco,\nsaus tomat, kecap manis, garam, merica, gula pasir, dan air, didihkan,\nkentalkan dengan larutan maizena, angkat.\n\n3. Taruh nasi dalam mangkuk, taruh potongan ayam, tuangkan sausnya,\nlengkapi dengan daun selada dan irisan mentimun.\n\n4. Sajikan hangat.\n\nUntuk: 2 orang', '[-0.018821938, -0.012340138, 0.021709353, -0.0069512017, 0.014256285, -0.012005122, -0.032929648, 0.004670575, 0.022949466, 0.032525025, -0.0061012683, 0.03161026, 0.10438919, -0.0463502, -0.023324259, -0.11475276, 0.061696175, -0.012373083, -0.047487635, 0.01151091, 0.03622062, 0.040622413, 0.033257023, -0.004288557, -0.07198648, -0.01985808, -0.026217565, 0.022801273, -0.027797852, -0.006172863, 0.0537355, 0.051431406, 0.009323126, -0.013059797, 0.015781576, 0.0084419325, -0.02616597, -0.010629851, -0.014803392, -0.059912354, -0.04216793, 0.029772623, 0.048324503, 0.041640982, -0.059588153, -0.035912022, 0.03002557, 0.037250143, 0.004655412, 0.028702684, 0.03884026, 0.019085536, -0.012404152, 0.010239113, -0.045217395, -0.031443395, 0.0039860993, -0.022220526, -0.052748516, 0.059121784, -0.0292247, 0.010699879, -0.056499384, -0.02776364, 0.0067325803, -0.0125237405, -0.02