(110, 'buku_sup_soto_sisca', 'LZ. Nasi Buntut Bakar', 80, 'LZ. Nasi Buntut Bakar\n\nBahan:\n\n2 mangkuk nasi putih\n500 gram buntut sapi\n\n6 sdm kecap manis\n\n2 sdm madu\n\n2 lembar daun jeruk\n\n1 cmjahe\n\n2 batang serai, memarkan\n\n1 liter air\n\n3 sdm minyak, untuk menumis\n\nBumbu yang dihaluskan:\n2 sdm minyak goreng\n\n5 butir bawang merah\n3 siung bawang putih\n\n1 sdt ketumbar, sangrai\n4 sdt jintan, sangrai\n\n30 gram gula merah sisir\n1 sdt garam\n\n2 sdt merica bubuk\n\nCara membuat:\n\n1. Panaskan minyak goreng, tumis bumbu halus hingga harum. Masukkan\nbuntut sapi, kecap manis, madu, daun jeruk, jahe, serai, dan air, aduk rata.\n\n2. Masak hingga buntut lunak dan kuah menyusut.\n\nPanggang buntut hingga mengering, angkat.\n\n4. Taruh nasi dalam mangkuk, tata buntut, tambahkan kuah bumbu merebus.\nSajikan hangat.\n\n»\n\nUntuk: 2 orang\n\n79', '[0.008565039, -0.002555621, 0.040313672, -0.028657956, 0.037909534, -0.03255749, -0.05283244, -0.00020576546, 0.012706858, 0.017086405, -0.01587894, 0.031326246, 0.0897521, -0.0077919564, -0.03283224, -0.10849676, 0.030439649, 0.020498328, -0.059426017, -0.004399962, 0.029267663, 0.04502425, 0.05625372, -0.021188825, -0.053333927, -0.0072221467, -0.050449982, 0.015987828, -0.027457673, -0.012310078, 0.050229955, 0.04175134, -0.013454784, -0.033424906, 0.052086443, -0.00097656157, -0.029581852, -0.002480895, 0.0048535666, -0.07377672, -0.04254137, 0.016176198, 0.07502625, 0.06973936, -0.048745602, -0.018140132, 0.03456637, 0.018823048, 0.0084833, 0.017981136, 0.016013991, 0.0071890047, -0.0076888213, 0.04378796, -0.041206207, -0.0058383318, 0.022768207, 0.014582757, -0.043407343, 0.06214357, -0.041448012, 0.004586857, -0.07505611, -0.026918126, 0.006807586, -0.011439624, -0.010741237, -0.029961342, 0.015901005, 0.006307213, -0.037828814, 0.01647269, -0.037129786, 0.044263337, 0.02476681, -0.034636445, -0.023064563, -0.06687974, -0.0020824252, 0.04436142, 0.0043238793, -0.020037888, 0.026151719, 0.060002446, 0.0