(111, 'buku_sup_soto_sisca', '80', 81, '80\n\n-3. Nasi Tahu Jamur\n\nBahan:\n\n2 mangkuk nasi putih 3 sdm saus tiram\n\n200 gram brokoli, cuci bersih, 1 sdm kecap manis\n\ntiriskan 4 sdt garam\n\n1 buah tahu telur, potong 8 bagian 4 sdt merica bubuk\n\n50 gram tepung maizena 100 mlair\n\nMinyak secukupnya, untuk 4 buahjamur Shiitake segar, iris\n\nmenggoreng 2 batang daun bawang, iris\nmenurut selera\n\nSaus: 1 sdm tepung sagu, larutkan\n\n2 sdm minyak goreng dengan sedikit air\n\n1\n1\n\nsdt minyak wijen\n\nbuah bawang bombai,\npotong-potong\n\nsiung bawang putih, memarkan\ncm jahe, memarkan\n\nCara membuat:\n\n1.\n2.\n\nCuci bersih brokoli, rebus hingga setengah matang, angkat, tiriskan.\nTahu setelah dipotong 8 bagian, lumuri dengan tepung maizena dan\ngoreng hingga matang kecokelatan, angkat.\n\nPanaskan 2 sdm minyak sisa menggoreng, tambahkan minyak wijen,\ntumis bawang bombai, bawang putih, dan jahe hingga layu. Masukkan\nsaus tiram, kecap manis, garam, merica, dan air.\n\nSetelah mendidih, masukkan jamur dan brokoli. Masak hingga matang\ndan kentalkan dengan larutan tepung sagu hingga mengental, angkat.\nTaruh nasi dalam mangkuk, tata tahu goreng, tuangkan saus\n\ndan isiannya.\n\nUntuk: 2 orang', '[0.0068355426, -0.0002298336, 0.014861568, -0.027546711, 0.018894576, -0.010158115, -0.005275225, 0.011664549, 0.027816946, 0.018274384, -0.0160465, 0.055662103, 0.08313203, -0.02603301, -0.05235165, -0.121841244, 0.06732592, 0.005219301, -0.03670025, 0.019481594, 0.010164416, 0.048182122, 0.05492902, 0.0058840504, -0.071549796, -0.023213154, -0.02598861, 0.014021508, -0.04825275, -0.012714278, 0.05531241, 0.044453796, 0.029441766, -0.00785289, 0.016055249, 0.018781465, -0.022655176, 0.00089907926, -0.006558776, -0.06868699, -0.038164083, 0.010519752, 0.041730206, 0.043560516, -0.057130907, -0.04178078, 0.032773405, 0.05346171, 0.0008906784, 0.0059791845, 0.023998821, 0.010688268, -0.027477358, 0.012625315, -0.03660524, -0.019948311, 0.025802635, -0.020386826, -0.0