(112, 'buku_sup_soto_sisca', '44. Nasi Daging Sosis Sapi', 82, '44. Nasi Daging Sosis Sapi\n\nBahan: 3 sdm kecap manis\n2 mangkuk nasi putih 1 sdm madu\n2 buah sosis sapi 3 lembar daun salam\n200 gram daging sapi cincang, 1 sdt garam\nbentuk bola-bola \"2 sdt merica bubuk\n2 sdm minyak goreng 1 batang wortel, potong serong\n1 buah bawang bombai, 3 sdm kacang polong beku\npotong-potong 1 buah paprika hijau, potong-\n5 siung bawang putih, cincang potong\n1 sdm tepung terigu\n6 sdm saus tomat\n200 mi kaldu\n\nsdt kecap asin\n\nCara membuat:\n\n1.\n\nPanaskan miyak goreng, tumis bawang bombai dan bawang putih hingga\nlayu. Masukkan daging, masak hingga berubah warna, masukkan tepung\nterigu, aduk rata.\n\nMasukkan saus tomat, kaldu, kecap asin, kecap manis, madu, daun salam,\ngaram, dan merica bubuk, masak hingga daging matang, kuah mengental.\nMasukkan wortel, sosis sapi, kacang polong, dan paprika hijau, masak\nsebentar, angkat.\n\nTaruh nasi dalam mangkuk, tuangkan daging dan isiannya.\n\nSajikan hangat.\n\nUntuk: 2 orang', '[-0.0058830827, 0.013979523, 0.023134785, -0.0086761685, 0.019941587, 0.015902761, -0.05552236, 0.00356111, 0.01341303, 0.03479271, -0.016707346, 0.06622818, 0.10063244, -0.02540246, -0.05356139, -0.10343447, 0.034787886, 0.010167639, -0.029798724, 0.009550433, 0.012824097, 0.03771908, 0.058694836, -0.04740838, -0.0610428, -0.002069523, -0.03163505, 0.02478348, -0.002991101, 0.011022513, 0.029698659, 0.06489754, -0.01943196, 0.009565246, -0.001807599, 0.02038289, -0.009097593, 0.014483723, -0.010689481, -0.059741154, -0.03204635, 0.025624767, 0.045723677, 0.03528614, -0.07638535, -0.026345, 0.027696103, 0.06575075, -0.0065539316, 0.030285299, 0.036134012, -0.00948184, -0.026844038, 0.035771787, -0.021773359, -0.013556364, 0.038848918, 0.0022779196, -0.047794916, 0.06699467, -0.032827847, 0.011126952, -0.044256635, -0.012789135, 0.0113679115, -0.017342547, -0.0031084076, -0.0066601024, 0.035893805, -0.0031503902, -0.02114322, -0.0036797551, -0.028