(113, 'buku_sup_soto_sisca', '82', 83, '82\n\nL5. Nasi Bakar Cumi\n\nBahan:\n\nNasi:\n\n3\n1\n\npiring nasi putih\nsdm margarin\n\nGaram secukupnya\nMerica bubuk secukupnya\n\nCumi:\n\n2\n2\n2\n5\n2\n2\n\nsdm minyak goreng\nbuah cabai merah, iris\nbuah cabai hijau, iris\nbutir bawang merah, iris\nsiung bawang putih, iris\nlembar daun salam\n\nCara membuat:\nNasi: Campur nasi dengan margarin, garam, dan merica, aduk rata,\n\n1.\n\npanaskan sebentar, angkat.\n\n3 lembar daun jeruk\n\n2 cm lengkuas, memarkan\n300 gram cumi segar, iris\nGaram, merica bubuk, dan\ngula pasir secukupnya\n\nPelengkap:\nDaun pisang, tempe goreng, perkedel\n\nCumi: Panaskan minyak goreng, tumis cabai merah, cabai hijau, bawang\nmerah, bawang putih, daun salam, daun jeruk, dan lengkuas hingga layu.\nMasukkan cumi, garam, merica, dan gula, masak hingga cumi matang,\n\nangkat.\n\nAmbil 2 lembar daun, tata nasi, cumi, tempe goreng, dan perkedel,\nbungkus, dan panggang hingga daun mengering, angkat.\n\nSajikan hangat.\n\nUntuk: 4 orang', '[-0.0062372307, 0.03679302, 0.018888492, -0.01561494, 0.021878237, -0.013173, -0.04234414, 0.012367581, 0.017504366, 0.032345574, -0.039346874, 0.055935543, 0.08777826, -0.026736127, -0.052980524, -0.120761454, 0.051486704, 0.031547368, -0.063305505, 0.0074329916, 0.009659343, 0.05729097, 0.049258143, -0.035498705, -0.047629144, -0.016514134, -0.025935434, 0.046131983, -0.041781373, -0.014642794, 0.041832108, 0.05817026, -0.005108859, -0.012355104, 0.008214249, 0.006558714, -0.04148045, -0.016422339, 0.004791528, -0.07732368, -0.034756765, 0.0066693006, 0.060371242, 0.042807493, -0.058130912, -0.04032608, 0.05459967, 0.0520567, -0.030246835, 0.024281919, 0.0341754, 0.015573254, -0.0052715847, 0.028005708, -0.051154546, -0.010149162, 0.028817797, 0.0077069798, -0.062356777, 0.06696269, -0.037408594, -0.0018619654, -0.07504019, -0.037802443, 0.026073009, -0.032073572, -0.026804777, -0.0058699073, 0.023540575, -0.015825259, -0.03223582, -0.0026779019, -0.033313215, 