(114, 'buku_sup_soto_sisca', 'bb.', 84, 'bb.\n\nNasi Brongkos Kukus\n\nBahan: Bumbu yang dihaluskan:\n\n100 gram kacang tolo 8 buah keluwek\n\n100 gram daging sapi, potong dadu — 2 buah cabai merah besar\n\n500 mlair 5 butir bawang merah\n\n3 lembar daun salam 3 siung bawang putih\n\n5 lembar daun jeruk 3 emkunyit\n\n2 cmjahe, memarkan 1 sdt ketumbar, sangrai\n\n500 mi santan dari 1 butir kelapa 4 sdt jintan, sangrai\n\n6 buah tahu putih ukuran 6x6 cm 1 sdt merica butiran\n\n12 buah cabai rawit merah 2 sdt garam\n\n2 sdm minyak goreng 1 sdt gula pasir\nPelengkap:\n\nDaun pisang, 4 piring nasi putih, empal\ndaging sapi, telur asin, sambal terasi\n\nCara membuat:\n\n1.\n\nRendam kacang tolo selama 1 jam, rebus setengah matang, angkat,\ntiriskan.\n\nPilih keluak yang tidak pahit, ambil dagingnya, rendam air panas selama\n10 menit, tiriskan.\n\nPanaskan minyak goreng, tumis bumbu halus hingga harum. Masukkan\ndaging sapi, masak hingga berubah warna. Masukkan daun salam, daun\njeruk, jahe, dan air, didihkan.\n\nSetelah mendidih, masukkan kacang tolo, tahu, dan santan, masak hingga\nmatang. Tambahkan cabai rawit, masak sebentar, angkat.\n\nAmbil 2 lembar daun pisang, tata nasi, brongkos, empal, telur asin, dan\nsambal terasi, bungkus dan kukus selama 15 menit.\n\nSajikan hangat.\n\nUntuk: 6 orang\n\n83', '[-0.0108868005, -3.075192e-05, 0.026292022, -0.02147852, 0.021817613, -0.02118136, -0.0360273, -0.019761799, 0.028194882, 0.016760372, -0.014206026, 0.035906617, 0.08911795, -0.046415288, -0.029906642, -0.1319296, 0.06717153, -0.0066051497, -0.038500097, -0.017775206, 0.008582666, 0.027969956, 0.07650746, -0.033591103, -0.0515907, -0.00261621, -0.029390529, 0.015191296, -0.017156303, -0.030951709, 0.08052802, 0.016849797, -0.011976112, -0.019601187, 0.024464339, 0.021117015, -0.03692332, 0.00610891, 0.0052589215, -0.06467014, -0.04856545, 0.028257623, 0.05987715, 0.06967791, -0.034461286, -0.040011372, 0.04735005, 0.037398666, 0.022096084, 0.030756176, 0.05558151, 0.0233