(115, 'buku_sup_soto_sisca', '67. Nasi Bakar Ayam Pedas', 85, '67. Nasi Bakar Ayam Pedas\n\n1 cm kunyit, bakar\n1 sdt terasi matang\n1 sdt garam\n\n4 sdt merica bubuk\n1 sdm gula pasir\n\nBahan\n\nAyam Pedas:\n\n1 ekor ayam, potong 40 bagian\n3 lembar daun jeruk\n\n2 batang serai, memarkan\n\n2 lembar daun salam\n\n2 cm lengkuas, memarkan\n500 mi santan dari 1 butir kelapa\n2  sdmair asam jawa\n\n2 sdm minyak goreng\n\nBumbu yang dihaluskan:\n\nPelengkap:\n\nKering tempe, oseng kacang panjang,\ntelur pindang\n\nDaun pisang, nasi mentega (campur\nnasi panas dengan mentega dan\n\n1 sdt garam)\n\n5 butir bawang merah\n\n3 siung bawang putih\n\n6 buah cabai merah besar\n12 buah cabai rawit merah\n\nCara membuat:\n\n1. Panaskan minyak, tumis bumbu yang dihaluskan hingga harum.\nMasukkan daun jeruk, serai, daun salam, dan lengkuas. Tambahkan ayam,\naduk rata, masak hingga ayam berubah warna.\n\n2. Masukkan santan dan air asam jawa, masak hingga kuah mengering,\nangkat.\n\n3. Ambil 2 lembar daun pisang, tata nasi, ayam pedas, kering tempe, oseng\nkacang panjang.dan telur pindang, bungkus dan panggang di atas bara api\nhingga daun mengering. Sajikan hangat.\n\nUntuk: 8 orang', '[0.0007291581, 0.0054076323, 0.0032094128, -0.023493, 0.023274153, -0.021099748, -0.05366478, -0.012045763, 0.023912903, 0.024963183, 0.0017820535, 0.02707807, 0.0974699, -0.04955932, -0.036829997, -0.105120294, 0.054965213, 0.021188125, -0.04543049, -0.018534245, 0.014688127, 0.032084677, 0.06731075, -0.009387097, -0.08065922, 0.00011529593, -0.02011426, 0.0262317, -0.026642622, 0.016500292, 0.057295647, 0.052381128, -0.005682155, -0.0089430325, 0.034686662, -0.00010038344, -0.039678827, -0.01584235, -0.011644408, -0.06781688, -0.03855529, 0.04681496, 0.059661966, 0.040641323, -0.07907416, -0.025537422, 0.02180464, 0.014682205, 0.0046593496, 0.02593268, 0.036567196, 0.027510503, 0.003873546, 0.0107253, -0.058912516, -0.027406609, -0.008955341, -0.0031208575, -0.07206058, 0.05297017, -0.019474324, 0.