(116, 'buku_sup_soto_sisca', 'L8. Nasi Gurih Bumbu Laksa', 86, 'L8. Nasi Gurih Bumbu Laksa\n\nBumbu yang dihaluskan:\n10 butir bawang merah\n\nBahan\n\nNasi:\n\n300 gram beras putih\n\n500 ml santan dari /z butir kelapa\n2 lembar daun pandan\n\nAyam Bumbu Laksa:\n\n1 ekor ayam, potong 20 bagian\n3 lembar daun jeruk\n\n2 batang serai, memarkan\n\n3 cmjahe, memarkan\n\n3 cm lengkuas, memarkan\n\n500 mi santan dari 1 butir kelapa\n2 sdt garam\n\n\"2 sdt merica bubuk\n\n2 sdm minyak goreng\n\nCara membuat:\n\n5 siung bawang putih\n\n5 butir kemiri, sangrai\n5 cm kunyit, bakar\n\n1 sdt ketumbar, sangrai\nPelengkap:\n\nDaun pisang, taoge, irisan daun\nbawang, bawang goreng, dan\ndaun kemangi, dan sambal terasi\nsecukupnya\n\n1. Nasi: Rebus santan bersama daun pandan hingga mendidih. Masukkan\nberas, masak hingga menjadi nasi aron, angkat.\n\n2. Panaskan minyak, tumis bumbu halus hingga harum. Masukkan ayam,\ndaun jeruk, serai, jahe, dan lengkuas. Masak hingga ayam berubah warna,\ntambahkan santan, garam, dan merica masak hingga ayam lunak. Angkat,\n\nsuwir-suwir ayam.\n\n3. Ambil 2 lembar daun, tata nasi, taoge, dan ayam suwir. Taburi irisan daun\nbawang, kemangi, dan sambal terasi, bungkus, kukus selama 30 menit.\n4. Sajikan hangat, taburi bawang goreng.\n\nUntuk: 8 orang\n\n85', '[0.013241071, 0.011582157, 0.009794196, -0.014652522, 0.037909865, -0.022867166, -0.053254798, 0.0018955133, 0.028385846, 0.031622857, -0.0098338695, 0.02541865, 0.07818095, -0.03303829, -0.04751359, -0.118149854, 0.055354513, 0.0016357242, -0.052606218, 0.006380947, 0.008007348, 0.02537102, 0.04487116, -0.029755674, -0.06622305, -0.009498602, -0.034533158, 0.010588179, -0.015516235, -0.019838767, 0.04520386, 0.052270003, -0.003404702, -0.025164716, 0.049734455, -0.015122585, -0.04361941, 0.0018900039, -0.024602918, -0.06766575, -0.058776613, 0.0018470916, 0.051710382, 0.056335345, -0.031382937, -0.036809873, 0.03194588, 0.011842104, 0.012172227, 0.019093556, 0.014341415, 0.011537771, -0.005235