(117, 'buku_sup_soto_sisca', '86', 87, '86\n\n49. Nasi Bakar Opor Daging\n\nBahan:\n\n500 gram daging sapi has dalam, iris 2 butir kemiri, sangrai\n\n3 lembar daun salam 2 sdm gula pasir\n\n2 batang serai, memarkan 1 sdt garam\n\n2 cm jahe, memarkan 1 sdt merica\n\n5 lembar daun jeruk\n\n500 mi santan dari 1 butir kelapa Nasi:\n\n1 sdm air asam jawa 4 piring nasi panas, 2 sdm margarin,\n2 sdm minyak goreng 1 sdt garam, aduk rata\n\nBumbu yang dihaluskan: Pelengkap:\n\n5 butir bawang merah Daun pisang, oseng buncis, kering\n3 siung bawang putih tempe, dan telur pindang\n\n1 sdm ketumbar, sangrai\n\nCara membuat:\n\n1. Panaskan minyak goreng, tumis bumbu yang dihaluskan hingga harum.\nMasukkan daging, daun salam, serai, jahe, dan daun jeruk, masak\nhingga daging berubah warna. Masukkan santan dan air asam jawa,\nmasak hingga daging lunak, angkat.\n\n2. Ambil dua lembar daun, tata nasi, daging, oseng buncis, kering tempe,\ndan telur pindang, bungkus bentuk lontong. Panggang di atas bara api\natau oven hingga daun mengering, angkat.\n\n3. Sajikan hangat.\n\nUntuk: 6 orang', '[0.01946635, 0.008113848, 0.01871811, -0.028771568, 0.002793675, 0.013468763, -0.048649173, -0.022904305, 0.008166806, 0.0371432, -0.009656335, 0.05234137, 0.09897001, -0.023958756, -0.040970366, -0.12928952, 0.07462012, 0.02053913, -0.033788472, 0.011431213, 0.028584855, 0.026427126, 0.07970331, -0.06277787, -0.051194828, 0.006199871, -0.03990032, 0.019212848, -0.037091136, -0.02120598, 0.04199935, 0.054315127, 0.017375607, 0.016674006, 0.005414655, 0.010978298, -0.030731525, -0.0038855313, -0.01170269, -0.07805082, -0.032349654, 0.015621188, 0.058904245, 0.042105038, -0.07689079, -0.036673352, 0.031738725, 0.04427001, 0.01224022, 0.043004032, 0.017377704, 0.021171585, -0.01934386, 0.03972433, -0.048957266, -0.023159312, 0.025493909, 0.007058825, -0.067449644, 0.054622337, -0.03236261, -0.015286568, -0.06824145, -0.028570285, 0.0083156945, -0.020562511, -0.008190801, -0.016707152, 0.04517688, -0.00