(118, 'buku_sup_soto_sisca', '70. Nasi Bakar Ayam Jamur', 88, '70. Nasi Bakar Ayam Jamur\n\nBahan:\n\n1 ekor ayam, potong 40 bagian\n2 sdm minyak goreng\n\n5 siung bawang putih, haluskan\n8 butir bawang merah, haluskan\n5  cmjahe, memarkan\n\n3 lembar daun jeruk\n\n3 cm jahe\n\n500 ml santan\n\n2 sdt garam\n\n1 sdt merica bubuk\n\n2 sdt gula pasir\n\n200 gram jamur kancing, iris\n\n20 butir telur puyuh,\n\nrebus matang kupas\n\nCara membuat:\nAyam: Panaskan minyak goreng, tumis bawang putih dan bawang\n\nmerah halus hingga harum. Masukkan jahe, daun jeruk, potongan ayam,\ndan jahe, masak hingga berubah warna. Masukkan santan, garam, merica,\ndan gula pasir, masak hingga ayam matang. Masukkan jamur dan telur,\n\n1.\n\nmasak sebentar, angkat.\n\nNasi:\n\n3 sdm mentega/margarin\n\n4 piring nasi\n\nGaram dan merica bubuk secukupnya\n\nPelengkap:\nDaun pisang, daun singkong rebus,\ndan sambal terasi\n\nNasi: Panaskan mentega/margarin, masukkan nasi, garam, dan\nmerica, aduk rata, masak sebentar, angkat.\n\nAmbil 2 lembar daun pisang, tata nasi, daun singkong, dan ayam di\natasnya, beri sambal terasi, panggang di atas bara api atau dalam oven\nhingga daun mengering. Sajikan hangat.\n\nHasil: 10 bungkus\n\n87', '[0.002449678, -0.02580688, 0.03304733, -0.015725613, 0.017816529, -0.0054638223, -0.04705309, 0.0076291547, 0.003909812, 0.028047, 0.007638157, 0.03554595, 0.10046675, -0.057813264, -0.036234073, -0.12012661, 0.05451727, 0.0011329346, -0.04197639, 0.0025525703, 0.0354182, 0.038422864, 0.052057996, -0.00113879, -0.07988423, -0.015244023, -0.03747827, 0.017340876, -0.023349078, 0.007032317, 0.028078495, 0.06307491, 0.006041062, -0.027723404, 0.04649289, 0.017235432, -0.034480605, -0.028179135, -0.0053650346, -0.052239962, -0.051605772, 0.012974863, 0.053157646, 0.045698058, -0.06008627, -0.038220685, 0.026558861, 0.005939847, 0.00805748, 0.025275735, 0.032999106, 0.026671497, -0.016269367, -0.012997673, -0.06674252, -0.025406443, -0.0013676377, -0.008427866, -0.06658