(119, 'buku_sup_soto_sisca', '88', 89, '88\n\n71. Nasi Bakar Telur Asin\n\nBahan:\n6 butir telur asin matang\n\nDaging Bumbu Kecap:\n\n2 sdm minyak goreng\n\n3 buah cabai merah besar, iris\n6 butir bawang merah, iris\n\n3 siung bawang putih, iris\n\n300 gram daging sapi has, iris korek api\n2 batang serai, memarkan\n\n3 lembar daun jeruk\n\n2 cmjahe, memarkan\n\n8 sdm kecap manis\n\n150 mlair\n\n1 sdt garam\n\n\"2 sdt merica bubuk\n\nPelengkap:\nDaun pisang, 4 porsi nasi putih, tempe tahu bacem, daun singkong rebus, dan\nsambal terasi matang\n\nCara membuat:\n\n1. Panaskan minyak goreng, tumis irisan bumbu hingga layu. Masukkan\ndaging sapi, serai, daun jeruk, dan jahe, masak hingga daging berubah\nwarna. Masukkan kecap manis, air, garam, dan merica, masak hingga\nair menyusut dan daging lunak, angkat.\n\n2. Ambil 2 lembar daun, tata nasi, daun singkong, daging kecap, tahu\ntempe bacem, telur asin, dan sambal. Bungkus, panggang di atas bara\napi atau dalam oven hingga daun mengering. Sajikan.\n\nUntuk: 6 orang', '[0.0072069247, -0.0029762203, 0.035537973, -0.042785637, 0.040024158, 0.0030124513, -0.04181312, -0.010633578, 0.010476392, 0.018965676, -0.026339741, 0.033764057, 0.1029816, -0.021645898, -0.047335144, -0.11439499, 0.036831517, 0.027148692, -0.031555116, -0.006297594, 0.026317181, 0.036819607, 0.07227024, -0.021241834, -0.067714445, 0.008719529, -0.04149409, 0.038932372, -0.032429677, -0.008934285, 0.033553347, 0.03561568, -0.0060971966, 0.008881688, 0.018661028, 0.022896336, -0.038452294, -0.014546935, 0.010849327, -0.07530697, -0.039188515, 0.051709086, 0.05497392, 0.040072802, -0.060995497, -0.024012437, 0.032689605, 0.042651817, -0.01922413, 0.0299787, 0.0043785935, 0.0005164009, -0.017189654, 0.004590976, -0.044811163, -0.034991466, 0.01274654, -0.004269383, -0.05060076, 0.047041006, -0.0078013004, 0.009490117, -0.07353945, -0.0055117416, 0.0064123184, -0.019319998, -0.024117652, -0.013906104, 0.042211514, 0.01946816, -0.035503186, 0.003156105, -0.035