(120, 'buku_sup_soto_sisca', '7Z. Nasi Kare Kukus', 90, '7Z. Nasi Kare Kukus\n\nBahan:\n\n300 gram beras putih\n\n500 mi santan dari \'4 butir kelapa\n2 lembar daun pandan\n\nAyam Kare:\nekor ayam, potong kecil\n5 lembar daun jeruk\n2 batang serai, memarkan\n2 cm jahe, memarkan\n5 butir cengkih\n4 cm kayu manis\n500 mi santan dari 1 butir kelapa\n2 sdm minyak goreng\n\nBumbu yang dihaluskan:\n\n3 buah cabai merah besar\n8 butir bawang merah\n\nCara membuat:\n\nsiung bawang putih\n\ncm kunyit, bakar\n\nsdm ketumbar, sangrai\nsdt jintan\n\nbiji kapulaga\n\nbiji adas manis, sangrai\nsdt garam\n\nsdt merica\n\nsdt gula pasir\n\nNANYWWJA AJ\n\nPelengkap:\n\nDaun pisang, daun singkong rebus,\ntelur puyuh rebus matang, cabai rawit,\ndan bawang goreng\n\n1. Nasi: Masak santan bersama daun pandan hingga mendidih, masukkan\nberas, masak hingga menjadi nasi aron, angkat.\n\n2. Panaskan minyak goreng, tumis bumbu yang dihaluskan hingga harum.\nMasukkan ayam, daun jeruk, serai, jahe, cengkih, dan kayu manis, masak\nhingga ayam berubah warna. Masukkan santan, masak hingga ayam\n\nlunak.\n\n3. Campur nasi dengan ayam, aduk rata, ambil 2 lembar daun, tata nasi,\ndaun singkong, cabai rawit, dan telur puyuh, lalu bungkus dan kukus\n\nselama 30 menit, angkat.\n\n4. Sajikan hangat ditaburi bawang goreng.\n\nUntuk: 8 orang\n\n89', '[0.024398223, 0.0036017539, 0.056528576, -0.008928871, -0.0022364378, 0.0025113332, -0.03287769, -0.002059434, 0.040047087, 0.034807168, -0.01283521, 0.0077071264, 0.08564544, -0.055775635, -0.02086825, -0.10503732, 0.056884777, 0.0015690039, -0.051572446, -0.03085701, 0.027965508, 0.010292731, 0.06703779, -0.018054303, -0.060225964, 0.013432825, -0.012762994, 0.02476877, -0.011751499, -0.013170163, 0.058640905, 0.042145826, 0.0041388464, -0.028255386, 0.035474185, 0.004968411, -0.010130041, -9.386685e-05, -0.025052467, -0.06576494, -0.076076776, 0.02618105, 0.039497707, 0.050382074, -0.051150758, -0.034775004, 0.04262642, 0.049460646, -0.0064094933, 0.004362