(121, 'buku_sup_soto_sisca', '73. Nasi Bakar udang', 91, '73. Nasi Bakar udang\n\nBahan:\n\n300 gram beras putih\n\n500 mi santan dari \'4 butir kelapa\n2 lembar daun pandan\n\nUdang:\n\n500 gram udang sedang, buang kulit, sisakan ekor\nlembar daun jeruk\n\ncm jahe, memarkan\n\nbatang serai, memarkan\n\nsdm minyak goreng\n\nsdm margarin\n\n-N ANA\n\nBumbu yang dihaluskan:\n\n5 butir kemiri, sangrai\n\n8 siung bawang putih\n\n5 cm kunyit, bakar\n\nGaram dan merica secukupnya\n\nPelengkap:\nDaun pisang, oseng buncis, dan telur pindang\n\nCara membuat:\n\n1. Nasi: Masak santan bersama daun pandan, setelah mendidih masukkan\nberas, masak hingga menjadi nasi aron, angkat. Kukus selama 30 menit,\nhingga matang, angkat.\n\n2. Udang: Panaskan minyak goreng bersama margarin, tumis bumbu halus\nbersama daun jeruk, jahe, dan serai hingga harum. Masukkan udang,\nmasak hingga udang matang, angkat.\n\n3. Ambil 2 lembar daun, tata nasi, oseng buncis, udang, dan\ntelur pindang, bungkus, panggang hingga daun mengering, angkat.\nSajikan hangat.\n\nUntuk: 6 orang', '[0.01019936, 0.010842743, 0.023822933, -0.010926017, 0.011753618, -0.024730347, -0.017856093, 0.0053447797, 0.016330272, 0.033083048, -0.0022161617, 0.024191586, 0.11086562, -0.03678521, -0.051364537, -0.116476335, 0.04834974, -0.011280313, -0.04504972, -0.027970094, 0.02737381, 0.03290095, 0.069115914, -0.011974987, -0.0703168, 0.0019315854, -0.029578395, 0.040673364, -0.011532352, -0.0011778366, 0.059107944, 0.0521206, -0.011599508, -0.0056575853, 0.022772424, -0.00810061, -0.01578277, -0.008541226, 0.0035645165, -0.072200276, -0.05018477, 0.021426989, 0.04449756, 0.06213622, -0.07055661, -0.016772205, 0.01654653, 0.04159581, 0.001351584, 0.02140934, 0.0149321025, 0.018485844, -0.0060843215, 0.009499991, -0.050616406, -0.026500318, 0.008681573, 0.019865798, -0.0623183, 0.05165191, -0.047269817, 0.007297142, -0.09836606, -0.04012003, 0.009732303, -0.037071045, -0.016310018, -0.01723123, 0.03226036, -0.018505517, -0.041263