(122, 'buku_sup_soto_sisca', '74. Nasi Bakar Jambal', 92, '74. Nasi Bakar Jambal\n\nBahan:\n\n2 sdm minyak goreng\n\n5 buah cabai merah besar, iris\n3 buah cabai hijau besar, iris\n5 butir bawang merah, iris\n\n3 siung bawang putih, iris\n\n300 gram ikan asin jambal, iris, goreng\n3 lembar daun jeruk\n\n1 sdm kecap manis\n\n4 sdt garam\n\n2 sdt merica bubuk\n\nNasi:\n\n1 sdm margarin, 4 piring nasi putih, garam\n\nPelengkap:\nDaun pisang, kering tempe, oseng kacang panjang, sambal terasi, daun\nkemangi\n\nCara membuat:\n\n1.\n\n4\n\nPanaskan minyak goreng, tumis cabai merah, cabai hijau, bawang merah,\ndan bawang putih hingga layu. Masukkan daun jeruk, kecap manis, garam,\nmerica, dan jambal goreng, masak sebentar, angkat.\n\nNasi: Panaskan margarin, masukkan nasi dan garam, aduk rata, angkat.\nAmbil dua lembar daun, tata nasi, kering tempe, oseng kacang panjang,\njambal, sambal terasi, dan kemangi, bungkus dan panggang hingga daun\nmengering.\n\nSajikan hangat.\n\nUntuk: 6 orang\n\nN', '[0.008388858, -0.001303461, 0.010241154, -0.028445581, 0.036001462, 0.00282525, -0.043176267, 0.021022044, 0.014122803, 0.0052139717, -0.010182938, 0.042818736, 0.10030893, -0.028139351, -0.035906717, -0.1394864, 0.037515722, 0.026999077, -0.039155617, 0.00017962021, 0.015183619, 0.04600113, 0.06342738, -0.013562861, -0.029359302, 0.0037772558, -0.044112723, 0.05420705, -0.033324804, 5.319786e-05, 0.011146723, 0.04317815, 0.0054260106, -0.026388314, 0.0045434735, 0.011540875, -0.039856017, -0.036655217, 0.014921535, -0.055798214, -0.071879245, 0.0071164, 0.06262076, 0.024789365, -0.061977193, -0.015277168, 0.035512347, 0.0015124559, -0.015329413, 0.03263883, 0.004920893, 0.0068950914, -0.022163745, 0.0067087626, -0.05242229, 0.0047201887, 0.006782649, 0.0025299995, -0.06578389, 0.06857494, -0.02757733, -0.016146952, -0.08075274, -0.007738375, 0.023027211, 0.0071196533, 0.0030882356, -0.024793731, 0.029091801, -0.0020158682, -0.042371124, 0.021959627, -0.018303521, 0.08036329, 0.0382