(123, 'buku_sup_soto_sisca', '92', 93, '92\n\nTA.\n\nNasi Bakar Lapis Daging\n\nBahan: Nasi:\n\nLapis Daging: 1 sdm margarin, 3 piring nasi putih,\n2 sdm minyak goreng dan garam secukupnya\n\n300 gram daging sapi has dalam, iris\n\n2 lembar daun salam Pelengkap:\n\n3 lembar daun jeruk Daun pisang, perkedel, oseng kacang\n1 batang serai, memarkan panjang, sambal terasi, dan daun\n2 cm jahe, memarkan kemangi\n\n1 sdm kecap manis\n\n100 mlair\n\n2 butir telur, kocok\n\nBumbu yang dihaluskan:\n\n5\n3\n2\n\nbutir bawang merah\nsiung bawang putih\nbutir kemiri\n\nGaram dan merica bubuk secukupnya\n\nCara membuat:\n\n1.\n\nLapis Daging: Panaskan minyak goreng, tumis bumbu halus bersama\ndaun salam, daun jeruk, serai, dan jahe hingga harum. Masukkan daging\nsapi, masak hingga berubah warna. Masukkan kecap manis dan air,\nmasak hingga daging lunak dan kuah menyusut, masukkan telur kocok,\naduk rata, masak sebentar, angkat.\n\nNasi: Panaskan margarin, masukkan nasi dan garam, aduk rata, angkat.\nAmbil 2 lembar daun pisang, tata nasi, perkedel, oseng\n\nkacang panjang, lapis daging, sambal terasi, dan kemangi, bungkus,\npanggang hingga daun mengering, angkat.\n\nSajikan hangat.\n\nUntuk: 4 orang', '[0.007994468, 0.010188859, 0.007129405, -0.022964666, 0.009104181, -0.005152366, -0.04989125, -0.0116055515, 0.021679355, 0.04000022, -0.009111434, 0.049300645, 0.09051239, -0.041505143, -0.03615266, -0.110757254, 0.048189167, 0.034300495, -0.046321157, 0.013346766, 0.02622647, 0.022680432, 0.061428837, -0.055421885, -0.05261436, 0.011768701, -0.025673697, 0.013495392, -0.03353134, -0.018323818, 0.032949362, 0.0479766, -0.008992095, 0.00025044577, -0.0013346316, 0.0129478155, -0.031697936, 0.012751665, 0.00295149, -0.07171836, -0.03869746, 0.025495306, 0.072576374, 0.061602976, -0.072078146, -0.015652776, 0.019226233, 0.051416077, 0.005296936, 0.043901972, 0.02294956, 0.009390234, -0.02653367, 0.02890922, -0.051920854, -0.0008671369, 0.018225117, 0.01604258, -0.076007806, 0.07138686