(124, 'buku_sup_soto_sisca', '7.', 94, '7.\n\nNasi Bakar Lidah Kecap\n\nBahan:\nLidah kecap: Nasi:\n\n500\n\nN OMA Aa ANO\n\nlidah sapi, bersihkan dan rebus 1 sdm margarin, 5 piring nasi, dan\nmatang garam secukupnya\n\nsdm margarin\n\nbuah bawang bombai, iris Pelengkap:\n\nmlair Daun pisang dan setup wortel buncis\nsdm kecap manis\n\nsdm saus tomat\n\nsdt garam\n\nsdt merica bubuk\n\nbiji pala, memarkan\n\ncm kayu manis\n\nbutir cengkih\n\nbuah tomat, potong menurut\n\nselera\n\nCara membuat:\n\n1.\n\nSetelah dicuci bersih, rebus lidah sapi hingga lunak, angkat dan kerok\nkulitnya.\n\nPanaskan margarin, tumis bawang bombai hingga layu, angkat,\nmasukkan lidah utuh, tambahkan kecap manis, saus tomat, garam, merica,\npala, kayu manis, dan cengkih, aduk rata. Masukkan air, dan tomat,\nmasak hingga\n\nbumbu meresap, lunak, dan kuah mengental, angkat, iris lidah.\n\nNasi: Panaskan margarin, masukkan nasi dan garam, aduk rata, angkat.\nAmbil 2 lembar daun, tata nasi, setup sayuran, dan lidah. Panggang\nhingga daun mengering, angkat.\n\nSajikan hangat.\n\nUntuk: 4 orang\n\n93', '[-0.017426025, -0.013861508, 0.026838545, -0.03483588, 0.008896331, -0.0055375886, -0.046490066, 0.0145152975, 0.030663135, 0.033380542, -0.005475115, 0.027936136, 0.07763108, -0.015586388, -0.051447324, -0.12813286, 0.03252675, 0.018441534, -0.078475714, 0.027207531, 0.034909114, 0.029100627, 0.058803912, -0.028719215, -0.049566004, 0.0056439526, -0.02700074, 0.050281357, -0.032189857, -0.01340669, 0.040407404, 0.04331079, -0.009140498, 0.009523339, 0.049168263, 0.0284045, -0.06313367, -0.0008451206, 0.004100473, -0.06074632, -0.07217381, 0.032435488, 0.06473907, 0.03406916, -0.059549183, -0.044292115, 0.031609397, 0.044596076, -0.0028771816, 0.030220198, 0.019543571, -0.0075386125, -0.04524859, 0.032873265, -0.047532767, -0.018407008, 0.009023139, 0.0150998905, -0.041756455, 0.06695454, -0.05100959, -0.011406823, -0.05693736, 0.0070760604, 0.017984968, -0.030613318, -0.023135275, -0.021216778, 0