(125, 'buku_sup_soto_sisca', '94', 95, '94\n\n77. Nasi Bakar omcom\n\nBahan:\n\nNasi:\n\n5 sdm minyak goreng\n4 piring nasi putih\n\nBumbu yang dihaluskan:\n\n8 butir bawang merah\n\n3 siung bawang putih\n\n5 cm kencur\n\n200 gram oncom, remas-remas\nGaram dan merica bubuk secukupnya\n\nEmpal Suwir:\n\n500 gram daging gandik, rebus\nmatang, lunak, suwir-suwir\nmi santan\n\n3 lembar daun salam\n\nCara membuat:\n\nBumbu yang dihaluskan:\n\n5 butir bawang merah\n\n3 siung bawang putih\n\n1 sdt ketumbar\n\nGaram, merica bubuk, dan gula pasir\nsecukupnya\n\nMinyak secukupnya, untuk\nmenggoreng\n\nPelengkap:\nDaun pisang, empal, tumis buncis,\nsambal terasi\n\nTaburan:\nTeri asin goreng dan bawang goreng\n\n1. Nasi: Panaskan minyak goreng, tumis bumbu halus hingga harum.\nmasukkan oncom, nasi putih, garam, dan merica bubuk, aduk rata,\nmasak hingga bumbu merata, angkat.\n\n2.  Empal Suwir: Masak santan bersama bumbu halus, daun salam, dan\ndaging suwir, masak hingga bumbu merata, angkat. Goreng hingga\nmatang dan berwarna kecokelatan, angkat.\n\n3. Ambil 2 lembar daun pisang, tata nasi, empal suwir, tumis buncis, dan\nsambal terasi, bungkus dan panggang hingga daun mengering, angkat.\n\n4. Sajikan hangat, taburi teri asin dan bawang goreng.\n\nHasil: 4-6 bungkus', '[-0.0019289338, 0.016996356, 0.029404925, -0.0043544658, 0.029051889, 0.005860583, -0.026095899, 0.010348152, -0.0042080525, 0.024693785, -0.014635686, 0.05591122, 0.08259671, -0.009252154, -0.04389598, -0.108787924, 0.06305374, 0.007675431, -0.06671451, 0.012063329, 0.02360688, 0.052456375, 0.052438367, -0.031733647, -0.06309208, -0.0009747628, -0.020107606, 0.043864794, -0.059134576, -0.0131610455, 0.052684326, 0.072359405, -0.0034425338, 0.0023290978, 0.03073107, 0.011370945, -0.025565028, 0.008435733, 0.009818939, -0.050250623, -0.026785647, 0.0044535957, 0.048762947, 0.041978747, -0.04737457, -0.01733786, 0.047593813, 0.058629002, -0.001944059, 0.03730349, 0.026440516, -0.010224412, -0.0062526604, 0.030561