(126, 'buku_sup_soto_sisca', '78. Nasi Kuning Rempah Bakar', 96, '78. Nasi Kuning Rempah Bakar\n\nBahan:\n2 sdm minyak goreng 1 sdt garam\n1 ekor ayam, potong 40 bagian 1 sdt merica bubuk\n3 lembar daun salam 500 mi santan dari 1 butir kelapa\n5 lembar daun jeruk\n2 cmjahe Nasi:\n2 cmlengkuas 500 gram beras\n2 batang serai, memarkan 800 mi santan dari 1 butir kelapa\n1 biji pala, memarkan Garam secukupnya\n5 butir cengkih 2 lembar daun pandan\n5  cmkayu manis 3 lembar daun salam\n100 gram kacang polong\nBumbu yang dihaluskan:\n8 butir bawang merah Pelengkap:\n5 siung bawang putih Daun pisang, irisan mentimun, dan\n5 butir kemiri bawang goreng\n10 cm kunyit\n\nCara membuat:\n\n1.\n\n4.\n\nPanaskan minyak goreng, tumis bumbu yang dihaluskan hingga harum.\nMasukkan ayam, daun salam, daun jeruk, jahe, lengkuas, serai, pala,\ncengkih, dan kayu manis, masak hingga ayam berubah warna. Masukkan\ngaram, merica, dan santan, masak hingga ayam lunak dan kuah\nmenyusut. Angkat.\n\nNasi: Masak santan, garam, daun pandan, dan daun jeruk hingga\nmendidih. Masukkan beras, masak hingga menjadi nasi aron. Masukkan\nayam dan kacang polong, aduk rata, dan kukus selama 30 menit\n\nhingga matang.\n\nAmbil 2 lembar daun, tata nasi, bungkus, panggang hingga daun\nmengering, angkat.\n\nSajikan hangat taburi bawang goreng dan irisan mentimun.\n\nUntuk: 4 orang\n\n95', '[-0.0022681144, 0.007410376, 0.029953215, -0.02408157, -0.0015961556, -0.00011532752, -0.040794887, 0.0024471553, 0.013217525, 0.03836985, -0.014849451, 0.036764797, 0.093613856, -0.05533285, -0.038773037, -0.12254743, 0.041482672, -0.010155935, -0.046473734, -0.008864815, 0.024407618, 0.034110334, 0.07265605, -0.027028257, -0.056902617, 0.006680241, -0.011872033, 0.032380264, -0.011137409, -0.0024667112, 0.03847944, 0.043261267, 0.010410172, -0.0080862595, 0.022661027, 0.012154812, -0.0037492376, -0.008199647, -0.004823545, -0.058264717, -0.05099046, 0.028928384, 0.04797796, 0.056138318, -0.06757062, -0.025255268, 0.020738523,