(127, 'buku_sup_soto_sisca', '79. Nasi Bakar Daging “Incang', 97, '79. Nasi Bakar Daging “Incang\n\nBahan:\n300 gram beras putih Garam secukupnya\n500 mi santan dari 1 butir kelapa Merica bubuk secukupnya\n2 lembar daun pandan\n300 gram daging sapi cincang Acar mentimun nanas (campur\n1 buah bawang bombai, cincang menjadi satu):\n5  cmkayu manis 1 buah mentimun, buang isi, iris\n5 biji cengkih 4 buahnanas, iris\n3 lembar daun salam 2 sdm gula pasir\n2 cm jahe, memarkan 4 sdt garam\n2 batang serai, memarkan 1 sdt cuka masak\n2 sdm kecap manis\n2 sdm minyak goreng Pelengkap:\nDaun pisang, telur asin, perkedel,\nBumbu yang dihaluskan: daun kemangi\n\n2 buah cabai merah besar\n8 siung bawang putih\n\nCara membuat:\n\n1. Panaskan minyak goreng, tumis bawang bombai dan bumbu halus\nhingga harum. Masukkan daging sapi cincang, kayu manis, cengkih,\ndaun salam, jahe, serai, dan kecap manis, masak hingga daging\nmatang, angkat.\n\n2. Masak santan bersama daun pandan hingga mendidih. Masukkan beras,\nmasak hingga menjadi nasi aron, angkat, campur dengan tumisan\ndaging, aduk rata. Kukus selama 30 menit hingga matang, angkat.\n\n3. Ambil 2 lembar daun, tata nasi, bungkus dan panggang hingga daun\nmengering, angkat.\n\n4. Sajikan hangat dengan dilengkapi telur asin, perkedel, daun\nkemangi, dan acar.\n\nUntuk: 6 orang', '[0.015181905, 0.01100182, 0.017257573, -0.02783929, -0.005709004, 0.0047903582, -0.030558102, -0.018311959, 0.03153095, 0.044466827, -0.0041497974, 0.05102817, 0.09397302, -0.036524776, -0.042611867, -0.11248463, 0.054556333, 0.009732181, -0.02306209, -0.023063572, 0.029551867, 0.021573227, 0.06917144, -0.046917506, -0.058294248, 0.0030840563, -0.049259055, 0.022391992, -0.01297115, -0.017355654, 0.052278686, 0.048120335, 0.0011276247, 0.023294201, 0.0044966806, 0.012800951, -0.027358782, -0.0036431202, 0.0025096252, -0.079618014, -0.03701881, 0.029882872, 0.06653021, 0.051030755, -0.0756948, -0.021336434, 0.042418577, 0.024971748, 0.009183472, 0.03415038, 0.027