(128, 'buku_sup_soto_sisca', 'Sajian Pelengkap', 98, 'Sajian Pelengkap\n\n20. Oseng Buncis / Kacang Panj ang\nBahan:\n\n2 sdm minyak goreng\n\n1 buah cabai merah besar, iris\n\n1 buah cabai hijau besar, potong 1 cm\n\n3 butir bawang merah, iris\n\n1 siung bawang putih, iris\n\n1 lembar daun salam\n\n150 gram buncis/ 6 lenjar kacang panjang, iris\n2 sdm kecap manis\n\n1 sdt garam\n\nsdt merica bubuk\n\nCara membuat:\nTumis semua bahan hingga matang, angkat.\n\n81.\n\nTelur Pindang\n\nBahan:\n\nbutir telur ayam\n\nliter air\n\ngram kulit bawang merah\nlembar daun jambu biji\nlembar daun salam\nbatang serai, memarkan\ncm lengkuas, memarkan\nsdt garam\n\nCara membuat:\nMasak semua bahan menjadi satu hingga air menyusut dan telur berwarna\ngelap. Angkat.\n\n97:', '[-0.01594956, -0.023734635, 0.04113031, -0.015292476, 0.015544995, -0.03514954, -0.037709866, 0.0047178855, 0.010599752, 0.049304295, -0.016366204, 0.018508982, 0.08867536, 0.014900069, -0.022141928, -0.111803964, 0.07452608, 0.04672933, -0.01691402, -0.014043593, 0.06157542, 0.013464574, 0.04145725, -0.04680854, -0.053626403, -0.027478108, -0.0127550885, 0.037405506, -0.036345527, -0.03841171, 0.07330073, 0.059205726, -0.00042612222, -0.021365562, 0.02189677, 0.02679649, -0.020990383, 0.012374923, -0.0066445153, -0.07314513, -0.035807703, 0.03917653, 0.05938994, 0.041847996, -0.056906685, -0.034616355, 0.026753193, 0.034002732, -0.0060570417, 0.045039516, -0.0113782985, 0.0085484795, -0.029381108, 0.022447338, -0.027034529, -0.0054526282, 0.023720913, 0.018305182, -0.04741867, 0.058396094, -0.034445968, -0.0050744866, -0.08241963, -0.041965574, 0.020105148, -0.0025515305, -0.037837535, -0.012990032, 0.03730551, 0.014551287, -0.018200353, 0.033229277, -0.059170146, 0.0657202, 0.052274626, -0.014958359, -0.00983512, -0.07094924, -0.0046974486, 0.0031535227, 0.0022445093, -0.017809644, 0.04231923, 0.072103016, -0.002281313, -0.022021556, 0.0081118215, -0.014504071, -0.044961758, 0.048654262, 0.06300463, 0.0608881