(129, 'buku_sup_soto_sisca', '98', 99, '98\n\nSL. Kering Tempe\n\nBahan:\n\n300 gram tempe, iris, goreng kering\n2 buah cabai merah besar, buang isinya, iris\n2 lembar daun salam\n\n2 cm lengkuas, memarkan\n\n50  mlair\n\n5  sdmirisan gula merah\n\n2 sdm air asam jawa\n\n1 sdt garam\n\n5 sdm bawang goreng\n\n3 sdm bawang putih goreng\n\n3 sdm minyak, untuk menumis\n\nCara membuat:\n\nTumis cabai, daun salam, dan lengkuas hingga harum. Masukkan air, gula\nmerah, air asam, dan garam. Masak hingga mendidih, masukkan tempe\ngoreng, bawang goreng, dan bawang putih goreng, aduk rata, angkat.\n\n35. Perkedel\n\nBahan: Celupan:\n300 gram kentang, goreng, haluskan 2 butir telur kocok\n50 gram daging cincang\n\n1 sdm irisan seledri Bumbu yang dihaluskan:\n\n4 sdt garam 3 butir bawang merah, 1 siung\n4 sdt merica bubuk bawang putih, /z sdt garam, dan\n4 sdt pala bubuk 14 sdt merica bubuk\n\nMinyak secukupnya, untuk\n\nmenggoreng\n\nCara membuat:\nCampur semua bahan menjadi satu, bentuk menjadi bulatan-bulatan 1 sendok\nmakan, celupkan ke telur kocok dan goreng matang.', '[0.0013415011, 0.0015779118, 0.020038059, -0.047617815, 0.046920758, -0.01770484, -0.02724715, 0.012695843, 0.030390473, 0.04988467, -0.03657949, 0.05067163, 0.060067706, -0.031032743, -0.02184999, -0.12455104, 0.049450688, 0.018968485, -0.04850001, -0.01860679, 0.04674131, 0.010986928, 0.07066777, -0.03661564, -0.077801615, -0.0015742357, -0.017786723, 0.030906383, -0.047900133, -0.013530283, 0.07544876, 0.050607253, 0.008020274, -0.0038167357, -0.0024041971, 0.013355813, 0.006975371, 0.0151273245, -0.0084968, -0.04384014, -0.035962388, 0.017993992, 0.057125796, 0.03463362, -0.05803964, -0.04587463, 0.014901034, 0.037976757, 0.002657087, 0.02472887, 0.019261638, 0.012309555, 0.010373106, 0.031224985, -0.01707598, -0.0060584834, 0.020842176, 0.017128216, -0.040710703, 0.06758996, 0.003487002, 0.035600245, -0.088007025, -0.031654518, -0.002915752, -0.018580025, -0.040058933, 0.0027828198, -0.0031388924, 0.01216