(130, 'buku_sup_soto_sisca', '54. Te empe Tahu Bacem', 100, '54. Te empe Tahu Bacem\n\nBahan:\n\n300 gram tempe\n\n10 buah tahu putih kecil\n\n500 mlair\n\nbutir bawang merah, memarkan\nlembar daun salam\n\ncm lengkuas, memarkan\n\nsdm gula merah sisir\n\nsdt garam\n\n2 sdt merica bubuk\n\nMinyak goreng secukupnya, untuk menggoreng\n\nSANYO\n\nCara membuat:\nMasak semua bahan menjadi satu, hingga menyusut dan berwarna gelap.\nMasukkan minyak, masak sebentar, angkat.\n\n85. Empat Daging\n\nBahan:\n\n500 gram daging gandik sapi, rebus matang dengan 3 lembar daun salam,\niris tipis\n\n100 mi santan kental\n\nMinyak secukupnya, untuk menggoreng\n\nBumbu yang dihaluskan:\nbutir bawang merah\nsiung bawang putih\nsdm ketumbar\n\nsdt garam\n\nsdm gula pasir\n\nAA. wa\n\nCara membuat:\nCampur santan dengan bumbu halus. celupkan irisan daging, goreng hingga\nberwarna kecokelatan, angkat.\n\n99', '[0.009631009, -0.0012366553, 0.019962432, -0.005021825, 0.039119393, -0.019243063, -0.013433381, 0.004477608, 0.0060983845, 0.034705766, -0.021482898, 0.07256528, 0.06683296, 0.0024826957, -0.056868494, -0.10607848, 0.034860995, 0.044719804, -0.075411044, 0.007773852, 0.06718692, 0.033106964, 0.065791726, -0.062303174, -0.08286705, 0.006887873, -0.031822227, 0.004616911, -0.04130699, -0.0144031225, 0.058285553, 0.05662675, 0.004830714, 0.002615978, 0.008428677, 0.012733923, 0.021052709, 0.027972883, -0.012010981, -0.057430927, -0.025936373, 0.023640612, 0.0460035, 0.02984604, -0.060727812, -0.024392236, 0.0031841965, 0.03240283, 0.004697175, 0.01175601, -0.011110122, 0.0062950905, 0.019375188, 0.0142772915, -0.03532057, 0.00039943805, 0.017446347, 0.009936398, -0.049214877, 0.059142698, -0.0139617, 0.022393888, -0.07186615, -0.026434155, 0.0020310828, 0.0031330062, -0.020326132, -0.036980573, -0.008879431, -0.021830527, -0.061029363, 0.014552109, -0.045256753, 0.025050092, 0.052114706, 0.004991565, -0.021016324, -0.08180765, -0.03243402, 0.0409077, 0.021201268, 0.015583358, 0.0481581