INSERT INTO `menu_langkah` (`id_langkah`, `id_menu`, `langkah_no`, `deskripsi`) VALUES
(1, 1, 1, 'Panaskan minyak goreng di wajan. Tumis bawang putih, bawang merah, dan cabai hingga harum.'),
(2, 1, 2, 'Masukkan nasi putih, aduk rata. Tambahkan garam, gula, dan kecap manis. Aduk hingga nasi panas merata.'),
(3, 1, 3, 'Koreksi rasa. Sajikan hangat dengan telur ceplok atau kerupuk sesuai selera.'),
(4, 2, 1, 'Rebus mie telur hingga matang, tiriskan.'),
(5, 2, 2, 'Tumis bawang putih dan bawang merah hingga harum, masukkan telur dan orak-arik.'),
(6, 2, 3, 'Masukkan mie, tambahkan garam, gula, kecap manis dan sedikit kecap asin. Aduk hingga rata dan sajikan.'),
(7, 3, 1, 'Tumis bawang putih dan bawang merah hingga harum, masukkan potongan ayam dan masak hingga berubah warna.'),
(8, 3, 2, 'Tambahkan kecap manis, garam, gula, dan sedikit air. Masak dengan api kecil hingga ayam empuk dan bumbu meresap.'),
(9, 3, 3, 'Koreksi rasa lalu sajikan bersama nasi putih.'),
(10, 4, 1, 'Rebus ayam dengan air hingga mendidih, buang busa yang mengapung.'),
(11, 4, 2, 'Masukkan wortel, kentang, daun bawang dan seledri. Tambahkan garam dan sedikit gula.'),
(12, 4, 3, 'Masak hingga sayuran empuk. Koreksi rasa dan sajikan hangat.'),
(13, 5, 1, 'Rebus air hingga mendidih, masukkan bawang putih geprek dan daun salam jika suka.'),
(14, 5, 2, 'Masukkan bayam, tambahkan garam dan sedikit gula. Masak sebentar hingga bayam layu.'),
(15, 5, 3, 'Matikan api, sajikan sayur bening selagi hangat.'),
(16, 6, 1, 'Potong tempe tipis sesuai selera.'),
(17, 6, 2, 'Buat larutan bumbu: bawang putih halus, garam, sedikit ketumbar bubuk (opsional), campur dengan air.'),
(18, 6, 3, 'Celupkan tempe ke bumbu lalu goreng dalam minyak panas hingga kuning kecokelatan.'),
(19, 7, 1, 'Potong tahu menjadi beberapa bagian, lumuri dengan bawang putih halus dan garam.'),
(20, 7, 2, 'Diamkan 10 menit agar bumbu meresap.'),
(21, 7, 3, 'Goreng hingga tahu keemasan dan renyah di bagian luar.'),
(22, 8, 1, 'Lumuri ikan nila dengan bawang putih, garam, kunyit atau bumbu kuning sesuai selera.'),
(23, 8, 2, 'Diamkan beberapa menit agar bumbu meresap.'),
(24, 8, 3, 'Goreng ikan dalam minyak panas hingga matang dan kulitnya garing.'),
(25, 9, 1, 'Tumis bawang putih dan bawang merah hingga harum, masukkan udang dan masak hingga berubah warna.'),
(26, 9, 2, 'Tambahkan kecap manis, saus tiram, garam, gula, dan sedikit air. Masak hingga saus mengental.'),
(27, 9, 3, 'Koreksi rasa dan sajikan selagi hangat.'),
(28, 10, 1, 'Potong tempe korek api, iris cabai hijau, bawang merah, dan bawang putih.'),
(29, 10, 2, 'Tumis bawang hingga harum, masukkan cabai hijau dan tempe. Aduk rata.'),
(30, 10, 3, 'Tambahkan garam, gula, dan kecap manis secukupnya. Masak hingga tempe agak kering.'),
(31, 11, 1, 'Kocok telur dengan garam, lada, dan bawang daun iris halus.'),
(32, 11, 2, 'Panaskan sedikit minyak, tuang kocokan telur.'),
(33, 11, 3, 'Masak hingga kedua sisi matang, angkat dan sajikan.'),
(34, 12, 1, 'Potong ayam kecil-kecil, marinasi dengan kecap manis, bawang putih halus, dan sedikit garam.'),
(35, 12, 2, 'Tusuk ayam pada tusuk sate, panggang di teflon dengan sedikit minyak hingga matang.'),
(36, 12, 3, 'Olesi kecap manis tambahan saat memanggang, sajikan dengan sambal dan nasi.'),
(37, 13, 1, 'Iris kol dan wortel, cincang bawang putih dan bawang merah.'),
(38, 13, 2, 'Tumis bawang hingga harum, masukkan wortel lalu kol.'),
(39, 13, 3, 'Tambahkan garam, gula, dan sedikit kecap asin. Masak sebentar hingga sayur layu tapi tetap renyah.'),
(40, 14, 1, 'Tumis bawang putih, bawang merah, dan cabai hingga harum, masukkan udang dan potongan ikan jika ada.'),
(41, 14, 2, 'Masukkan nasi putih, tambahkan garam, gula, dan kecap manis. Aduk hingga rata dan nasi panas.'),
(42, 14, 3, 'Sajikan dengan irisan tomat atau telur dadar.'),
(43, 15, 1, 'Rebus daging sapi hingga empuk, buang busa yang mengapung di permukaan.'),
(44, 15, 2, 'Masukkan wortel, kentang, daun bawang dan seledri. Tambahkan garam dan sedikit gula.'),
(45, 15, 3, 'Masak hingga sayuran empuk, koreksi rasa dan sajikan hangat.'),
(46, 16, 1, 'Panaskan minyak goreng di wajan.'),
(47, 16, 2, 'Tumis bawang putih dan bawang merah hingga harum.'),
(48, 16, 3, 'Masukkan bahan utama, aduk hingga berubah warna dan matang.'),
(49, 16, 4, 'Tambahkan garam dan bumbu lain sesuai selera, koreksi rasa.'),
(50, 16, 5, 'Masak hingga bumbu meresap, angkat dan sajikan hangat.'),
(99, 25, 1, 'Lumuri ayam dengan bumbu genep Bali, garam, dan gula merah hingga merata. Biarkan meresap minimal 1 jam atau semalaman.'),
(100, 25, 2, 'Ambil sedikit bumbu halus, campurkan dengan santan kental dan sedikit garam. Aduk rata.'),
(101, 25, 3, 'Siapkan selembar daun pisang. Letakkan ayam di atasnya, kemudian olesi dengan campuran santan.'),
(102, 25, 4, 'Masukkan beberapa lembar daun jeruk, serai yang sudah digeprek, dan daun salam ke dalam rongga ayam.'),
(103, 25, 5, 'Bungkus ayam dengan rapi menggunakan daun pisang. Ikat dengan tali kasur atau tali lainnya agar tidak terbuka.'),
(104, 25, 6, 'Kukus ayam yang sudah dibungkus selama kurang lebih 2-3 jam hingga benar-benar matang dan empuk.'),
(105, 25, 7, 'Setelah dikukus, ayam betutu siap disajikan. Bisa juga dibakar sebentar di atas bara api atau teflon untuk aroma smokey.'),
(106, 26, 1, 'Haluskan bawang putih, bawang merah, cabai merah besar, cabai rawit merah, jahe, dan kunyit.'),
(107, 26, 2, 'Tumis bumbu halus hingga harum.'),
(108, 26, 3, 'Masukkan tomat yang sudah diblender, masak hingga layu.'),
(109, 26, 4, 'Tambahkan saus tomat, saus sambal, saus tiram, kecap manis, Royco Bumbu Nasi Goreng, garam, dan gula pasir. Aduk rata.'),
(110, 26, 5, 'Tuang air, masak hingga mengental.'),
(111, 26, 6, 'Masukkan kepiting, masak hingga berubah warna dan matang.'),
(112, 26, 7, 'Kocok telur, lalu masukkan ke dalam masakan sambil terus diaduk hingga telur matang dan saus mengental.'),
(113, 26, 8, 'Terakhir, masukkan irisan daun bawang, aduk sebentar, lalu sajikan.'),
(126, 27, 1, 'Cuci bersih kepiting, lalu belah menjadi dua atau empat sesuai selera. Sisihkan.'),
(127, 27, 2, 'Haluskan bawang putih, bawang merah, cabai merah keriting, cabai rawit merah, dan jahe.'),
(128, 27, 3, 'Panaskan minyak goreng dalam wajan, lalu tumis bumbu halus hingga harum dan matang.'),
(129, 27, 4, 'Masukkan kepiting, aduk rata hingga berubah warna.'),
(130, 27, 5, 'Tambahkan saus tiram, saus sambal, saus tomat, kecap manis, garam, gula, dan kaldu bubuk. Aduk rata.'),
(131, 27, 6, 'Tuangkan air, masak hingga kepiting matang dan bumbu meresap. Koreksi rasa.'),
(132, 27, 7, 'Angkat dan sajikan kepiting saus tiram pedas selagi hangat.'),
(133, 28, 1, 'Cuci bersih kerang dara, buang yang rusak dan terbelah. Sisihkan.'),
(134, 28, 2, 'Haluskan bawang merah, bawang putih, cabai merah keriting, cabai rawit merah, dan tomat.'),
(135, 28, 3, 'Panaskan minyak goreng, tumis bumbu halus bersama daun salam dan serai hingga harum.'),
(136, 28, 4, 'Masukkan saus sambal, saus tomat, saus tiram, kecap manis, garam, gula pasir, dan air. Aduk rata, masak hingga bumbu meresap.'),
(137, 28, 5, 'Masukkan kerang dara, aduk rata. Tutup wajan dan masak hingga kerang terbuka dan matang, sekitar 5-10 menit.'),
(138, 28, 6, 'Sajikan kerang saus padang selagi hangat.'),
(139, 29, 1, 'Rebus air dalam panci hingga mendidih.'),
(140, 29, 2, 'Masukkan mie instan ke dalam air mendidih. Jika menggunakan sosis, iris sosis dan masukkan bersama mie. Jika menggunakan sayuran, masukkan sayuran pada 1 menit terakhir perebusan.'),
(141, 29, 3, 'Masak mie hingga matang sesuai petunjuk kemasan.'),
(142, 29, 4, 'Sambil menunggu mie matang, siapkan bumbu indomie di piring.'),
(143, 29, 5, 'Jika mie sudah matang, tiriskan mie (sisakan sedikit air rebusan jika suka sedikit berkuah).'),
(144, 29, 6, 'Masukkan telur ke dalam air rebusan mie yang masih panas (atau bisa juga telur diceplok/orak-arik terpisah).'),
(145, 29, 7, 'Aduk rata mie dengan bumbunya.'),
(146, 29, 8, 'Sajikan Indomie Ala Aloy selagi hangat.'),
(147, 30, 1, 'Cuci bersih kerang, buang kerang yang rusak atau terbuka.'),
(148, 30, 2, 'Haluskan bawang merah, bawang putih, cabai merah keriting, cabai rawit merah, tomat, dan jahe.'),
(149, 30, 3, 'Panaskan minyak goreng dalam wajan, tumis bumbu halus hingga harum.'),
(150, 30, 4, 'Masukkan saus tomat, saus sambal, kecap manis, garam, gula pasir, dan kaldu bubuk (jika menggunakan). Aduk rata.'),
(151, 30, 5, 'Tuang air, masak hingga bumbu mendidih dan sedikit mengental.'),
(152, 30, 6, 'Masukkan kerang, aduk rata dengan bumbu. Masak hingga kerang terbuka dan matang, sekitar 5-7 menit.'),
(153, 30, 7, 'Masukkan irisan daun bawang, aduk sebentar.'),
(154, 30, 8, 'Angkat dan sajikan kerang saus padang selagi hangat.'),
(155, 31, 1, 'Potong dada ayam fillet menjadi ukuran sekali gigit.'),
(156, 31, 2, 'Dalam sebuah wadah, campurkan tepung terigu, tepung maizena, bawang putih bubuk, garam, dan merica bubuk. Aduk rata.'),
(157, 31, 3, 'Dalam wadah terpisah, kocok telur. Jika menggunakan susu cair, campurkan susu cair ke dalam kocokan telur.'),
(158, 31, 4, 'Celupkan potongan ayam ke dalam campuran telur, pastikan terlumuri rata.'),
(159, 31, 5, 'Gulingkan ayam yang sudah dicelup telur ke dalam campuran tepung hingga terbalut sempurna. Tekan-tekan agar tepung menempel.'),
(160, 31, 6, 'Panaskan minyak goreng dalam jumlah banyak dengan api sedang.'),
(161, 31, 7, 'Goreng potongan ayam yang sudah dibalut tepung hingga berwarna kuning keemasan dan matang sempurna (sekitar 5-7 menit). Angkat dan tiriskan.'),
(162, 31, 8, 'Ayam goreng krispi siap disajikan.');
